ce;\\frac&amp;space;{1}{\\omega&amp;space;^^2}\" /></li><li>Karena sesuai dengan persamaan <img title=\"mr^^2 = \\frac {1}{\\omega ^^2}\" src=\"https://latex.codecogs.com/gif.latex?mr^^2&amp;space;=&amp;space;\\frac&amp;space;{1}{\\omega&amp;space;^^2}\" /></li><li>Karena sesuai dengan persamaan <img title=\"mr^^2 = \\omega ^^2\" src=\"https://latex.codecogs.com/gif.latex?mr^^2&amp;space;=&amp;space;\\omega&amp;space;^^2\" /></li><li>Karena sesuai dengan persamaan <img title=\"\\frac {m}{\\omega^^2} = \\omega ^^2\" src=\"https://latex.codecogs.com/gif.latex?\\frac&amp;space;{m}{\\omega^^2}&amp;space;=&amp;space;\\omega&amp;space;^^2\" /></li><li>Karena sesuai dengan persamaan <img title=\"mr = \\omega\" src=\"https://latex.codecogs.com/gif.latex?mr&amp;space;=&amp;space;\\omega\" /></li></ol>', 0.294, 1.362, 0.23, 0.67, -0.89, 0, 'C', 'B', 'CT.DR.3.1.4B'),
('S.078', 'MD.09', '<p style=\"text-align: center;\">Suatu cucian mobil modern menggunakan sistem hidrolik untuk mengangkat mobil seperti pada gambar dengan A, B, C, dan D adalah penampang besar dari sistem hidrolik dan a, b, c, dan d merupakan penampang kecil dari sistem hidrolik.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%2017%20(FILEminimizer)%20(1).jpg\" alt=\"Gambar 17 (FILEminimizer) (1)\" /></p>\r\n<p style=\"text-align: justify;\">Setiap hidrolik memiliki beban maksimal yang dapat ditahan. Sistem hidrolik pada gambar memiliki variable seperti pada Tabel berikut:</p>\r\n<table style=\"width: 771px; height: 56px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 37px;\">\r\n<th style=\"width: 21.4667px; height: 10px; text-align: center;\">No</th>\r\n<th style=\"width: 203.517px; height: 10px; text-align: center;\">Variabel</th>\r\n<th style=\"width: 110.283px; height: 10px; text-align: center;\">Penampang A</th>\r\n<th style=\"width: 129.367px; text-align: center; height: 10px;\">Penampang B</th>\r\n<th style=\"width: 142.383px; text-align: center; height: 10px;\">Penampang C</th>\r\n<th style=\"width: 126.783px; text-align: center; height: 10px;\">Penampang D</th>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 21.4667px; height: 18px; text-align: center;\">1</td>\r\n<td style=\"width: 203.517px; height: 18px; text-align: center;\">Perbandingan luas penampang besar</td>\r\n<td style=\"width: 110.283px; height: 18px; text-align: center;\">1</td>\r\n<td style=\"width: 129.367px; text-align: center; height: 18px;\">1</td>\r\n<td style=\"width: 142.383px; text-align: center; height: 18px;\">1</td>\r\n<td style=\"width: 126.783px; height: 18px; text-align: center;\">1</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 21.4667px; height: 10px; text-align: center;\">2</td>\r\n<td style=\"width: 203.517px; height: 10px;\">\r\n<p style=\"text-align: center;\">Perbandingan diameter penampang kecil</p>\r\n</td>\r\n<td style=\"width: 110.283px; height: 10px; text-align: center;\">0.5</td>\r\n<td style=\"width: 129.367px; text-align: center; height: 10px;\">1</td>\r\n<td style=\"width: 142.383px; text-align: center; height: 10px;\">0.25</td>\r\n<td style=\"width: 126.783px; height: 10px; text-align: center;\">0.125</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 21.4667px; text-align: center; height: 18px;\">3</td>\r\n<td style=\"width: 203.517px; text-align: center; height: 18px;\">Massa jenis fluida</td>\r\n<td style=\"width: 110.283px; text-align: center; height: 18px;\">1</td>\r\n<td style=\"width: 129.367px; text-align: center; height: 18px;\">1.2</td>\r\n<td style=\"width: 142.383px; text-align: center; height: 18px;\">0.9</td>\r\n<td style=\"width: 126.783px; height: 18px; text-align: center;\">0.8</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Pertanyaan:</strong> Berdasarkan informasi yang diberikan, hidrolik yang membutuhkan gaya input paling besar dan paling kecil untuk mengangkat beban sebesar <strong>F</strong> secara berurutan adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Hidrolik A dan Hidrolik B</li><li>Hidrolik B dan Hidrolik C</li><li>Hidrolik C dan Hidrolik D</li><li>Hidrolik D dan Hidrolik A</li><li>Hidrolik A dan Hidrolik D</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Luas penampang besar berbanding lurus dengan gaya angkat hidrolik, sedangkan diameter penampang kecil berbanding terbalik dengan gaya input</li><li>Luas penampang besar berbanding terbalik dengan gaya angkat hidrolik, sedangkan diameter penampang kecil berbanding lurus dengan gaya input</li><li>Luas penampang besar dan diameter penampang kecil tidak mempengaruhi gaya angkat hidrolik</li><li>Luas penampang besar dan masa jenis fluida tidak mempengaruhi gaya angkat hidrolik</li><li>Diemeter penampang kecil dan masa jenis fluida tidak mempengaruhi gaya angkat hidrolik</li></ol>', 0.2, 2.836, -0.13, 1.27, -1.14, 0, 'D', 'B', '*CT.AB.3.3.17'),
('S.079', 'MD.09', '<p>Perusahaan X merupakan perusahaan yang berfokus pada penyediaan perlatan memasak seperti panci, kuali, dan wajan yang terbuat dari logam. Saat ini perusahaan tersebut sedang berupaya untuk mengembangkan panci yang mampu mengoptimalkan waktu memasak. Caranya adalah dengan memilih bahan baku yang cepat panas, tahan lama, dan mampu menahan tekanan tinggi. Sebagai pembanding, berikut tersedia beberapa bahan yang berpotensi dijadikan bahan baku untuk membuat panci tersebut.</p>\r\n<table style=\"width: 567px; height: 127px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 37px;\">\r\n<th style=\"width: 26.5333px; height: 37px; text-align: center;\">No.</th>\r\n<th style=\"width: 112.917px; height: 37px; text-align: center;\">Jenis Zat</th>\r\n<th style=\"width: 96.0167px; height: 37px; text-align: center;\">Kalor Jenis (J/Kg<sup>o</sup>C)</th>\r\n<th style=\"width: 95.35px; text-align: center; height: 37px;\">Massa Jenis (Kg/m<sup>3</sup>)</th>\r\n<th style=\"width: 106.983px; text-align: center; height: 37px;\">Titik Didih (<sup>o</sup>C)</th>\r\n<th style=\"width: 92px; text-align: center; height: 37px;\">Titik Lebur (<sup>o</sup>C)</th>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 26.5333px; height: 18px; text-align: center;\">1</td>\r\n<td style=\"width: 112.917px; height: 18px; text-align: center;\">Aluminium (Al)</td>\r\n<td style=\"width: 96.0167px; height: 18px; text-align: center;\">900</td>\r\n<td style=\"width: 95.35px; text-align: center; height: 18px;\">2800</td>\r\n<td style=\"width: 106.983px; height: 18px; text-align: right;\">2519.00</td>\r\n<td style=\"width: 92px; height: 18px; text-align: right;\">660.32</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 26.5333px; height: 18px; text-align: center;\">2</td>\r\n<td style=\"width: 112.917px; height: 18px; text-align: center;\">Besi (Fe)</td>\r\n<td style=\"width: 96.0167px; height: 18px; text-align: center;\">450</td>\r\n<td style=\"width: 95.35px; text-align: center; height: 18px;\">7900</td>\r\n<td style=\"width: 106.983px; height: 18px; text-align: right;\">2750.00</td>\r\n<td style=\"width: 92px; height: 18px; text-align: right;\">1535.00</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 26.5333px; text-align: center; height: 18px;\">3</td>\r\n<td style=\"width: 112.917px; text-align: center; height: 18px;\">Tembaga (Cu)</td>\r\n<td style=\"width: 96.0167px; text-align: center; height: 18px;\">390</td>\r\n<td style=\"width: 95.35px; text-align: center; height: 18px;\">8920</td>\r\n<td style=\"width: 106.983px; height: 18px; text-align: right;\">2572.00</td>\r\n<td style=\"width: 92px; height: 18px; text-align: right;\">1085.00</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 26.5333px; text-align: center; height: 18px;\">4</td>\r\n<td style=\"width: 112.917px; text-align: center; height: 18px;\">Seng (Zn)</td>\r\n<td style=\"width: 96.0167px; text-align: center; height: 18px;\">390</td>\r\n<td style=\"width: 95.35px; text-align: center; height: 18px;\">8400</td>\r\n<td style=\"width: 106.983px; height: 18px; text-align: right;\">906.27</td>\r\n<td style=\"width: 92px; height: 18px; text-align: right;\">419.00</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 26.5333px; text-align: center; height: 18px;\">5</td>\r\n<td style=\"width: 112.917px; text-align: center; height: 18px;\">Timbal (Pb)</td>\r\n<td style=\"width: 96.0167px; text-align: center; height: 18px;\">130</td>\r\n<td style=\"width: 95.35px; text-align: center; height: 18px;\">1134</td>\r\n<td style=\"width: 106.983px; height: 18px; text-align: right;\">1749.00</td>\r\n<td style=\"width: 92px; height: 18px; text-align: right;\">327.46</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Pertanyaan: </strong>Bahan yang paling cocok digunakan berdasarkan kualifikasi yang diperlukan adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Aluminimum</li><li>Besi</li><li>Tembaga</li><li>Seng</li><li>Timbal</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin tinggi kalor jenis zat maka semakin mudah untuk dipanaskan, dan semakin tinggi titik lebur semakin mudah zat tersebut dilelehkan.</li><li>Semakin tinggi kalor jenis zat maka semakin mudah untuk dipanaskan, dan semakin tinggi titik lebur semakin sulit zat tersebut dilelehkan.</li><li>Semakin tinggi kalor jenis zat maka semakin sulit untuk dipanaskan, dan semakin tinggi masa jenis zat semakin mudah zat tersebut dilelehkan</li><li>Semakin tinggi kalor jenis zat maka semakin sulit untuk dipanaskan, dan semakin tinggi masa jenis zat semakin sulit zat tersebut dilelehkan.</li><li>Semakin tinggi titik didih zat maka semakin sulit untuk dipanaskan, dan semakin tinggi masa jenis zat semakin sulit zat tersebut dilelehkan.</li></ol>', 0.165, 1.525, -1.67, 4.54, -2.87, 0, 'A', 'B', '*CT.SM.3.5.18'),
('S.080', 'MD.09', '<p>Dalam penyusunan sistem instalasi air pada suatu Gedung atau rumah, aliran air biasanya dialirkan dengan menggunakan ukuran dan ketebalan pipa yang berbeda. Hal ini didasarkan pada hukum-hukum yang berlaku pada fluida statis dan fluida dinamis. Pada sistem tangki luar, biasanya disimpan di tempat yang lebih tinggi seperti pada Gambar.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%2024%20OK%20(FILEminimizer).jpg\" alt=\"Gambar 24 OK (FILEminimizer)\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Faktor-faktor yang menjadi pertimbangan untuk menentukan ukuran pipa adalah&hellip;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Masa jenis air, ketebalan pipa, panjang pipa, ketinggian pipa, kecepatan aliran fluida</li><li>Masa jenis air, ketinggian pipa, diameter pipa, ketinggian tangki</li><li>Masa jenis air, ketinggian pipa, diameter pipa, kecepatan aliran fluida</li><li>Ketinggian pipa, ketebalan pipa, panjang pipa, ketinggian tangki</li><li>Ketinggian pipa, ketebalan pipa, panjang pipa, kecepatan aliran fluida</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"P+\\frac{1}{2}\\rho v{^{2}}+\\rho gh=C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;P+\\frac{1}{2}\\rho&amp;space;v{^{2}}+\\rho&amp;space;gh=C\" /></li><li>Karena memenuhi persamaan <img title=\"P+\\frac{1}{2}\\rho ^{2}+\\rho gh=C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;P+\\frac{1}{2}\\rho&amp;space;^{2}+\\rho&amp;space;gh=C\" /></li><li>Karena memenuhi persamaan <img title=\"P+\\rho v^{2}+\\rho gh=C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;P+\\rho&amp;space;v^{2}+\\rho&amp;space;gh=C\" /></li><li>Karena memenuhi persamaan <img title=\"P=\\frac{1}{2}\\rho v^{2}+\\rho gh + \\pi r^{2}=C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;P=\\frac{1}{2}\\rho&amp;space;v^{2}+\\rho&amp;space;gh&amp;space;+&amp;space;\\pi&amp;space;r^{2}=C\" /></li><li>Karena memenuhi persamaan <img title=\"P+\\frac{1}{2}\\left ( \\rho v^2 + \\pi r^2 \\right ) = C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;P+\\frac{1}{2}\\left&amp;space;(&amp;space;\\rho&amp;space;v^2&amp;space;+&amp;space;\\pi&amp;space;r^2&amp;space;\\right&amp;space;)&amp;space;=&amp;space;C\" /></li></ol>', 0.135, 4.089, -0.19, 2.36, -2.17, 0, 'B', 'A', '*CT.MD.3.4.24');
