ign: center; height: 18px;\">4</td>\r\n<td style=\"width: 102.35px; text-align: center; height: 18px;\">10</td>\r\n<td style=\"width: 91.5667px; text-align: center; height: 18px;\">20</td>\r\n<td style=\"width: 86.8333px; text-align: center; height: 18px;\">2673</td>\r\n<td style=\"width: 95.1167px; text-align: center; height: 18px;\">27</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 26.5333px; text-align: center; height: 18px;\">5</td>\r\n<td style=\"width: 102.35px; text-align: center; height: 18px;\">15</td>\r\n<td style=\"width: 91.5667px; text-align: center; height: 18px;\">20</td>\r\n<td style=\"width: 86.8333px; text-align: center; height: 18px;\">1225</td>\r\n<td style=\"width: 95.1167px; text-align: center; height: 18px;\">27</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 26.5333px; text-align: center;\">4</td>\r\n<td style=\"width: 102.35px; text-align: center;\">20</td>\r\n<td style=\"width: 91.5667px; text-align: center;\">20</td>\r\n<td style=\"width: 86.8333px; text-align: center;\">865</td>\r\n<td style=\"width: 95.1167px; text-align: center;\">27</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 26.5333px; text-align: center;\">4</td>\r\n<td style=\"width: 102.35px; text-align: center;\">20</td>\r\n<td style=\"width: 91.5667px; text-align: center;\">20</td>\r\n<td style=\"width: 86.8333px; text-align: center;\">700</td>\r\n<td style=\"width: 95.1167px; text-align: center;\">27</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 26.5333px; text-align: center;\">4</td>\r\n<td style=\"width: 102.35px; text-align: center;\">20</td>\r\n<td style=\"width: 91.5667px; text-align: center;\">20</td>\r\n<td style=\"width: 86.8333px; text-align: center;\">700</td>\r\n<td style=\"width: 95.1167px; text-align: center;\">50</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 26.5333px; text-align: center;\">4</td>\r\n<td style=\"width: 102.35px; text-align: center;\">20</td>\r\n<td style=\"width: 91.5667px; text-align: center;\">20</td>\r\n<td style=\"width: 86.8333px; text-align: center;\">700</td>\r\n<td style=\"width: 95.1167px; text-align: center;\">70</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan data pada table diatas, grafik yang menunjukan hubungan antar variable dalam studi pengaruh jumlah lilitan, diameter, dan suhu terhadap konstanta pegas adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Opsi A&nbsp;<img src=\"/assets/source/Anchor%2028/28A.png\" alt=\"\" width=\"300\" height=\"226\" /></li><li>Opsi B <img src=\"/assets/source/Anchor%2028/28B.png\" alt=\"\" width=\"300\" /></li><li>Opsi C <img src=\"/assets/source/Anchor%2028/28C.png\" alt=\"\" width=\"300\" height=\"252\" /></li><li>Opsi D <img src=\"/assets/source/Anchor%2028/28D.png\" alt=\"Opsi D\" width=\"300\" height=\"262\" /></li><li>Opsi E <img src=\"/assets/source/Anchor%2028/28E.png\" alt=\"\" width=\"300\" height=\"256\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Suhu tidak berpengaruh terhadap konstanta pegas</li><li>Semakin banyak lilitan, semakin besar gaya pegas yang dihasilkan</li><li>Semakin besar diameter pegas, semakin besar gaya pegas yang dihasilkan</li><li>Semakin banyak lilitan, semakin besar kontanta pegas</li><li>Semakin besar diameter pegas, semakin kecil konstanta pegas</li></ol>', 0.172, 2.969, -2.01, 3.41, -1.4, 0, 'A', 'E', '*CT.DR.3.2.28'),
('S.286', 'MD.13', '<p>Pada saat melakukan gerakan memutar, penari balet biasanya menggunakan bentangan tangan untuk mengatur kecepatan berputar. Semakin kecil bentangan tangan penari balet, maka semakin besar kecepatan berputar si penari. Adapun grafik hubungan antara kecepatan berputar penari dengan lebar bentangan tangan ditunjukkan adalah sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%204A%20(FILEminimizer).png\" alt=\"\" width=\"644\" height=\"185\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan karakteristik kedua grafik yang dihasilkan, hubungan yang tepat antara lebar tangan, momen inersia, dan kecepatan sudut adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>&nbsp;<img title=\"I=\\frac {m}{r^2}=\\frac {1}{\\omega }\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;I=\\frac&amp;space;{m}{r^2}=\\frac&amp;space;{1}{\\omega&amp;space;}\" /></li><li><img title=\"I=mr^^2 = \\frac {1}{\\omega}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;I=mr^^2&amp;space;=&amp;space;\\frac&amp;space;{1}{\\omega}\" />&nbsp;</li><li><img title=\"I=mr^^2=\\omega ^^2\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;I=mr^^2=\\omega&amp;space;^^2\" /></li><li><img title=\"I=\\frac {m}{r^^2} = \\omega ^^2\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;I=\\frac&amp;space;{m}{r^^2}&amp;space;=&amp;space;\\omega&amp;space;^^2\" /></li><li><img title=\"I=mr=\\omega\" src=\"https://latex.codecogs.com/gif.latex?I=mr=\\omega\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar lebar tangan semakin besar momen inersia yang dihasilkan</li><li>Semakin besar momen inersia benda semakin besar massa benda yang berotasi</li><li>Semakin besar lebar tangan semakin besar kecepatan sudut yang dihasilkan</li><li>Semakin besar kecepatan sudut benda semakin besar momen inersia yang dihasilkan</li><li>Semakin besar massa benda semakin besar kecepatan rotasi yang dihasilkan</li></ol>', 0.449, 1.006, 0.32, 1.19, -1.51, 0, 'B', 'A', 'CT.DR.3.1.4A'),
('S.287', 'MD.13', '<p>Mesin terdiri dari sekumpulan elemen mesin yang diam dan bergerak. Elemen mesin yang bergerak dengan gerakan berputar disebut benda putar. Pada beberapa kasus sering kali diinginkan pengurangan massa dari benda putar tersebut untuk alasan ekonomis. Dengan pengurangan massa, berarti pengurangan material yang berarti penghematan ongkos produksi. Hal tersebut biasanya terjadi untuk elemen mesin yang diproduksi massal. Meskipun demikian, momen inersia suatu mesin tidak boleh terlalu rendah karena akan membahayakan. Sehingga, diperlukan upaya untuk menurunkan massa yang optimal dengan pengurangan momen inersia yang miniamal. Anto yang bekerja sebagai divisi R&amp;D dari perusahaan pembuatan elemen mesin menemukan grafik pengujian sebagai berikut:</p>\r\n<p><img src=\"/assets/source/Gambar%205A%20(FILEminimizer).jpg\" alt=\"\" width=\"713\" height=\"469\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan grafik yang dihasilkan Anto, pernyataan yang tepat adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Ukuran jari-jari optimal untuk menurunkan momen inersia adalah 9 cm</li><li>Ukuran jari-jari yang optimal untuk menurunkan massa adalah 4 cm</li><li>Ukuran jari-jari yang optimal torsi mesin adalah 7,5 cm</li><li>Pengurangan massa paling optimal untuk meningkatkan momen inersia adalah 0,44 kg</li><li>Ukuran jari-jari dengan biaya produksi paling tinggi adalah 7,5 cm</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar massa benda semakin kecil momen inersia</li><li>Semakin kecil jari-jari semakin kecil momen inersia</li><li>Semakin besar jari-jari semakin kecil pengurangan massa benda</li><li>Semakin kecil jari-jari semakin besar pengurangan massa benda</li><li>Semakin kecil jari-jari semakin kecil pengurangan massa benda</li></ol>', 0.244, 2.059, -2.43, 3.99, -1.57, 0, 'D', 'E', 'CT.AB.3.1.5A'),
('S.288', 'MD.13', '<p>Pak Joko memiliki kebun nanas dan kebun mangga yang biasa dipanen setiap minggu. Selain dijual, hasil kebun Pak Joko juga dibawa pulang untuk dikonsumsi dan dibagikan kepada tetangga. Saat membawa hasil panen pulang ke rumah, pak Joko biasa memikul dengan pemikul buah seperti pada gambar. Pada suatu ketika, buah-buahan terjatuh karena keranjang yang dipikul tidak seimbang. Waktu itu, keranjang depan berisikan 8 buah nanas dan 50 buah mangga. Diketahui, massa rata-rata buah nanas yang dibawa Pak Joko adalah 0.7 kg dan massa rata-rata buah mangga Pak Joko adalah 0.2 kg.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%206A%20(FILEminimizer).jpg\" alt=\"\" /></p>\r\n<p><strong>Pertanyaan: </strong>Jika panjang tongkat penyangga Pak Joko adalah 2 meter, maka posisi pundak Pak Joko yang tepat agar buah-buahan tidak berserakan adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>1.28 meter dari keranjang nanas</li><li>1.28 meter dari keranjang mangga</li><li>0.92 meter dari keranjang nanas</li><li>0.56 meter dari keranjang nanas</li><li>0.56 dari keranjang mangga</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"\\frac{F_{1}}{x_{1}}=\\frac {F_{2}}{x_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac{F_{1}}{x_{1}}=\\frac&amp;space;{F_{2}}{x_{2}}\" /></li><li>Karena memenuhi persamaan <img title=\"{F_{1}}\\times {x_{1}}= {F_{2}}\\times {x_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;{F_{1}}\\times&amp;space;{x_{1}}=&amp;space;{F_{2}}\\times&amp;space;{x_{2}}\" /></li><li>Karena memenuhi persamaan <img title=\"\\frac {x_{1}}{x_{2}}=\\frac {m_{1}}{m_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac&amp;space;{x_{1}}{x_{2}}=\\frac&amp;space;{m_{1}}{m_{2}}\" /></li><li>Karena memenuhi persamaan <img title=\"\\frac{\\left ( m_{1} + m_{2} \\right )}{\\left ( x_{1} + x_{2} \\right )}=C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac{\\left&amp;space;(&amp;space;m_{1}&amp;space;+&amp;space;m_{2}&amp;space;\\right&amp;space;)}{\\left&amp;space;(&amp;space;x_{1}&amp;space;+&amp;space;x_{2}&amp;space;\\right&amp;space;)}=C\" /></li><li>Karena memenuhi persamaan <img title=\"\\frac{\\left ( x_{1} + x_{2} \\right )}{\\left ( m_{1} + m_{2} \\right )}=C\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac{\\left&amp;space;(&amp;space;x_{1}&amp;space;+&amp;space;x_{2}&amp;space;\\right&amp;space;)}{\\left&amp;space;(&amp;space;m_{1}&amp;space;+&amp;space;m_{2}&amp;space;\\right&amp;space;)}=C\" /></li></ol>', 0.277, 2.274, -0.56, 0.56, -0.27, 0, 'A', 'B', 'CT.AD.3.1.6A'),
('S.289', 'MD.13', '<p>Pak Rahmad sedang melakukan renovasi untuk rumahnya. Salah satu bagian yang direnovasi adalah pintu utama. Di katalog yang diberikan, terdapat dua jenis pintu rumah yang disukai Pak Rahmad yaitu model kotak dengan satu pintu dan model setengah lingkaran dengan 2 ganggang pintu seperti pada gambar berikut:</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%207A%20(FILEminimizer).jpg\" alt=\"\" width=\"712\" height=\"267\" /></p>\r\n<p>Selanjutnya, terdapat lima pilihan pintu berdasarkan ukuran masing-masing pintu seperti yang terdapat dalam tabel berikut:</p>\r\n<table style=\"width: 567px; height: 127px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 37px;\">\r\n<th style=\"width: 39.5px; height: 37px; text-align: center;\">Kode</th>\r\n<th style=\"width: 110.467px; height: 37px; text-align: center;\">Jenis</th>\r\n<th style=\"width: 92.8167px; height: 37px; text-align: center;\">Massa (kg)</th>\r\n<th style=\"width: 92.25px; text-align: center; height: 37px;\">Tinggi (m)</th>\r\n<th style=\"width: 103.083px; text-align: center; height: 37px;\">Lebar (m)</th>\r\n<th style=\"width: 91.6833px; text-align: center; height: 37px;\">Ketebalan (cm)</th>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 39.5px; height: 18px; text-align: center;\">A</td>\r\n<td style=\"width: 110.467px; height: 18px; text-align: center;\">1 Ganggang</td>\r\n<td style=\"width: 92.8167px; height: 18px; text-align: center;\">18</td>\r\n<td style=\"width: 92.25px; text-align: center; height: 18px;\">215</td>\r\n<td style=\"width: 103.083px; text-align: center; height: 18px;\">1.0</td>\r\n<td style=\"width: 91.6833px; height: 18px; text-align: center;\">5</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 39.5px; height: 18px; text-align: center;\">B</td>\r\n<td style=\"width: 110.467px; height: 18px; text-align: center;\">1 Ganggang</td>\r\n<td style=\"width: 92.8167px; height: 18px; text-align: center;\">16</td>\r\n<td style=\"width: 92.25px; text-align: center; height: 18px;\">215</td>\r\n<td style=\"width: 103.083px; text-align: center; height: 18px;\">1.0</td>\r\n<td style=\"width: 91.6833px; height: 18px; text-align: center;\">4</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 39.5px; text-align: center; height: 18px;\">C</td>\r\n<td style=\"width: 110.467px; text-align: center; height: 18px;\">2 Ganggang</td>\r\n<td style=\"width: 92.8167px; text-align: center; height: 18px;\">20</td>\r\n<td style=\"width: 92.25px; text-align: center; height: 18px;\">250</td>\r\n<td style=\"width: 103.083px; text-align: center; height: 18px;\">1.6</td>\r\n<td style=\"width: 91.6833px; height: 18px; text-align: center;\">5</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 39.5px; text-align: center; height: 18px;\">D</td>\r\n<td style=\"width: 110.467px; text-align: center; height: 18px;\">2 Ganggang</td>\r\n<td style=\"width: 92.8167px; text-align: center; height: 18px;\">18</td>\r\n<td style=\"width: 92.25px; text-align: center; height: 18px;\">250</td>\r\n<td style=\"width: 103.083px; text-align: center; height: 18px;\">1.8</td>\r\n<td style=\"width: 91.6833px; height: 18px; text-align: center;\">4</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 39.5px; text-align: center; height: 18px;\">E</td>\r\n<td style=\"width: 110.467px; text-align: center; height: 18px;\">2 Ganggang</td>\r\n<td style=\"width: 92.8167px; text-align: center; height: 18px;\">16</td>\r\n<td style=\"width: 92.25px; text-align: center; height: 18px;\">250</td>\r\n<td style=\"width: 103.083px; text-align: center; height: 18px;\">2.0</td>\r\n<td style=\"width: 91.6833px; height: 18px; text-align: center;\">5</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Pertanyaan:</strong> Jenis pintu yang tepat digunakan oleh Pak Rahmad agar mudah saat dibuka adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pintu A</li><li>Pintu B</li><li>Pintu C</li><li>Pintu D</li><li>Pintu E</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar torsi, semakin mudah pintu untuk dibuka</li><li>Semakin besar torsi, semakin sulit pintu untuk dibuka</li><li>Semakin besar massa pintu, semakin sulit pintu untuk dibuka</li><li>Semakin tinggi pintu, semakin sulit pintu untuk dibuka</li><li>Semakin tebal pintu, semakin sulit pintu untuk dibuka</li></ol>', 0.21, 4.326, -0.18, 3.46, -3.28, 0, 'B', 'B', 'CT.SM.3.1.7A'),
('S.290', 'MD.13', '<p>Saat ini, dispenser tidak lagi hanya berfungsi sebagai alat untuk memanaskan air. Lebih dari itu, saat ini dispenser juga dapat digunakan untuk membuat air dingin dan air panas dalam waktu bersamaan. Sebagai perbandingan, perhatikan data berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20A/13.png\" alt=\"13\" /></p>\r\n<p><strong>Pertanyaan:</strong> Konsep fisika yang tepat digunakan untuk menentukan jenis dispenser yang memiliki efisiensi yang baik adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Laju perpindahan kalor</li><li>Kapasitas Kalor</li><li>Kalor Jenis</li><li>Asas Black</li><li>Koefisien muai zat</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Jumlah kalor yang diberikan oleh mesin pada mesin pemanas, sama dengan kalor yang diberikan pada mesin pendingin</li><li>Jumlah kalor yang dikonversi dari listrik, sama dengan kalor yang diterima oleh pemanas</li><li>Jumlah kalor yang diberikan oleh mesin pemanas dan pendingin sebanding dengan kalor jenis zat.</li><li>Jumlah kalor yang dikonversi dari listrik sebanding dengan laju perpindahan kalor pada dispenser</li><li>Jumlah kalor yang diserap oleh dispenser sebanding dengan kapasitas kalor dari dispenser tersebut.</li></ol>', 0.249, 2.768, -0.19, 0.77, -0.57, 0, 'D', 'B', 'CT.DC.3.5.13A'),
('S.291', 'MD.13', '<p>Percobaan mengenai hukum Archimedes bertujuan untuk menunjukkan fenomena mengapung, melayang, dan tenggelam. Dalam salah satu percobaan, objek yang digunakan adalah telur yang dimasukkan ke dalam larutan garam seperti pada Gambar.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%2012C%20(FILEminimizer).jpg\" alt=\"\" width=\"720\" height=\"405\" /></p>\r\n<p>Pada kondisi normal, telur akan tenggelam dan berada pada bagian dasar gelas. Untuk membuat telur menjadi melayang, garam ditambahkan secara perlahan dan diaduk hingga dengan campuran tertentu menjadi melayang dan mengapung.</p>\r\n<p><strong>Pertanyaan: </strong>Permasalahan yang ingin diselesaikan dengan mengatur konsentrasi garam adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Bagaimana pengaruh konsentrasi larutan terhadap gaya berat telur?</li><li>Bagaimana pengaruh konsentrasi larutan terhadap gaya apung telur?</li><li>Bagaimana pengaruh konsentrasi larutan terhadap gaya berat larutan?</li><li>Bagaimana pengaruh konsentrasi larutan terhadap gaya apung larutan?</li><li>Bagaimana pengaruh konsentrasi larutan terhadap massa jenis telur?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Benda akan mengapung ketika massa benda lebih kecil dibandingkan dengan massa larutan</li><li>Benda akan melayang ketika massa jenis benda sama dengan massa jenis larutan</li><li>Benda akan tenggelam ketika massa benda lebih besar dibandingkan dengan massa larutan</li><li>Gaya apung benda berbanding terbalik dengan konsentrasi larutan</li><li>Gaya berat benda berbanding lurus dengan konsentrasi larutan</li></ol>', 0.188, 3.267, -0.2, 0.82, -0.62, 0, 'D', 'B', 'CT.RP.3.3.14A'),
('S.292', 'MD.13', '<p>Daerah deformasi elastis merupakan area yang mana benda masih dapat kembali ke bentuk semula, sedangkan pada daerah deformasi plastis benda yang diberikan gaya tidak akan kembali ke bentuk semula. Daerah deformasi elastis dan plastis suatu bahan bersifat spesifik dan berbeda untuk setiap jenis bahan. Perhatikan Gambar berikut!</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%2015A%20(FILEminimizer).png\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Faktor-faktor yang menentukan besar luas area deformasi elastis dan deformasi praktis adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Gaya yang diberikan, panjang awal benda, dan diameter bahan</li><li>Panjang awal benda, pertambahan panjang dan diameter bahan</li><li>Gaya yang diberikan, volume benda, dan volume akhir benda</li><li>Volume benda, diameter benda, dan penampang bahan.</li><li>Gaya yang diberikan, panjang awal benda, dan luas penampang bahan.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"Y=\\frac {F \\times l_{o}}{A \\times \\Delta l}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;Y=\\frac&amp;space;{F&amp;space;\\times&amp;space;l_{o}}{A&amp;space;\\times&amp;space;\\Delta&amp;space;l}\" /></li><li>Karena memenuhi persamaan <img title=\"F=-k \\times \\Delta l\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;F=-k&amp;space;\\times&amp;space;\\Delta&amp;space;l\" /></li><li>Karena memenuhi persamaan <img title=\"P=B \\frac {\\Delta V}{V}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;P=B&amp;space;\\frac&amp;space;{\\Delta&amp;space;V}{V}\" /></li><li>Karena memenuhi persamaan <img title=\"G=\\frac {F \\times h}{A \\times \\Delta l}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;G=\\frac&amp;space;{F&amp;space;\\times&amp;space;h}{A&amp;space;\\times&amp;space;\\Delta&amp;space;l}\" /></li><li>Karena memenuhi persamaan <img title=\"F=-\\frac {k_{pegas}^{n}}{\\sum_{1}^{n}k_{pegas}}\\left ( \\frac {YA}{L} \\right ) \\Delta x\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;F=-\\frac&amp;space;{k_{pegas}^{n}}{\\sum_{1}^{n}k_{pegas}}\\left&amp;space;(&amp;space;\\frac&amp;space;{YA}{L}&amp;space;\\right&amp;space;)&amp;space;\\Delta&amp;space;x\" /></li></ol>', 0.551, -0.84, -0.64, 0.61, 0.03, 0, 'E', 'A', 'CT.MD.3.2.15A'),
('S.293', 'MD.13', '<p>Sabun cuci tangan saat ini menjadi salah satu hal wajib yang kita jumpai baik di pusat keramaian, kampus, sekolah, dan sebagainya. Selain sabun cuci tangan, handsanitizer juga menjadi perlengkapan wajib yang disediakan. Hal ini mendorong pelaku UMKM mengembangkan hand sanitizer dan sabun cuci tangan. Meskipun demikian, terkadang sabun cuci tangan dan hand sanitizer yang diproduksi oleh UMKM mendapatkan banyak kendala seperti sulit untuk dipompa keluar. Kendala-kendala yang ditemukan pada produk rumahan biasanya disebabkan kurangnya pengujian terkait produk yang dilakukan, dalam hal ini berkaitan dengan masalah packaging. Surya yang bekerja di dinas koperasi dan UMKM, ditugaskan untuk membantu pelaku UMKM menyelesaikan permasalahan tersebut dengan menghasilkan data pengujian sebagai berikut:</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%2016A%20(FILEminimizer).png\" alt=\"\" /></p>\r\n<p>Informasi yang dihasilkan cukup sulit untuk dipahami oleh masyarakat sehingga perlu disederhanakan. Tabung yang ideal sebaiknya kecepatan yang diperlukan tidak lebih dari 1,7 m.s<sup>-1</sup>.</p>\r\n<p><strong>Pertanyaan: </strong>Pernyataan yang tepat berdasarkan informasi yang dihasilkan adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Ketinggian tabung sebaiknya tidak lebih dari 10 cm</li><li>Ketinggian tabung sebaiknya tidak kurang dari 10 cm</li><li>Massa jenis zat cair sebaiknya tidak lebih dari massa jenis udara yaitu 1.2 kg/m<sup>3</sup></li><li>Massa jenis zat cair sebaiknya tidak kurang dari massa jenis udara yaitu 1.2 kg/m<sup>3</sup></li><li>Massa jenis zat cair minimal yang digunakan adalah 1.4 kg/m<sup>3</sup></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"v=2 \\sqrt {\\frac {\\rho_{udara}gh}{\\rho_{zat cair}}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;v=2&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{\\rho_{udara}gh}{\\rho_{zat&amp;space;cair}}}\" /></li><li>Karena memenuhi persamaan&nbsp;<img title=\"v=2 \\sqrt{\\frac {\\rho_{zat cair}gh}{\\rho_{udara}}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;v=2&amp;space;\\sqrt{\\frac&amp;space;{\\rho_{zat&amp;space;cair}gh}{\\rho_{udara}}}\" /></li><li>Karena memenuhi persamaan <img title=\"v=\\frac {1}{2} \\sqrt {\\frac {\\rho_{zat cair}gh}{\\rho_{udara}}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;v=\\frac&amp;space;{1}{2}&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{\\rho_{zat&amp;space;cair}gh}{\\rho_{udara}}}\" /></li><li>Karena memenuhi persamaan <img title=\"v=\\frac {1}{2} \\sqrt {\\frac {\\rho_{udara}gh}{\\rho_{zat cair}}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;v=\\frac&amp;space;{1}{2}&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{\\rho_{udara}gh}{\\rho_{zat&amp;space;cair}}}\" /></li><li>Karena memenuhi persamaan <img title=\"v=\\sqrt {\\frac {2 \\rho_{zat cair}gh}{\\rho_{udara}}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;v=\\sqrt&amp;space;{\\frac&amp;space;{2&amp;space;\\rho_{zat&amp;space;cair}gh}{\\rho_{udara}}}\" /></li></ol>', 0.428, 2.11, -1.26, -0.3, 1.56, 0, 'E', 'E', 'CT.DR.3.3.16A'),
('S.294', 'MD.13', '<p>Eksperimen lapisan pelangi merupakan eksperimen sederhana yang juga digunakan sebagai hiburan. Dalam melakukan eksperimen lapisan pelangi, bahan-bahan yang diperlukan tergolong mudah ditemui seperti gelas, air, pewarna, dan garam/gula. Pertama-tama, peserta akan membuat larutan dengan berbagai perbandingan dan warna. Selanjutnya, peserta diharuskan menyusun larutan ke dalam gelas secara berurutan seperti pada gambar!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2019A%20(FILEminimizer).jpg\" alt=\"\" /></p>\r\n<p>Meskipun terlihat mudah, membuat lapisan pelangi memerlukan perhitungan yang akurat. Jika tidak, lapisan tidak akan terbentuk dengan sempurna. Misalnya dalam memilih urutan larutan ke dalam gelas. Ketika salah memilih urutan larutan, makan lapisan pelangi yang terbentuk akan berantakan.</p>\r\n<p><strong>Pertanyaan: </strong>Agar terbentuk lapisan pelangi sempurna (merah-jingga-kuning-hijau-biru-nila-ungu), maka urutan konsentrasi yang tepat adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Opsi A <img src=\"/assets/source/Paket%20A/19a.png\" alt=\"\" width=\"400\" /></li><li>Opsi B <img src=\"/assets/source/Paket%20A/19b.png\" alt=\"\" width=\"400\" /></li><li>Opsi C <img src=\"/assets/source/Paket%20A/19c.png\" alt=\"\" width=\"400\" height=\"117\" /></li><li>Opsi D <img src=\"/assets/source/Paket%20A/19d.png\" alt=\"\" width=\"400\" height=\"114\" /></li><li>Opsi E <img src=\"/assets/source/Paket%20A/19e.png\" alt=\"\" width=\"400\" height=\"116\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Larutan harus disusun berdasarkan massa zat terlarut</li><li>Larutan harus disusun berdasarkan volum pelarut</li><li>Larutan harus disusun berdasarkan massa pelarut</li><li>Larutan harus disusun berdasarkan volum zat terlarut</li><li>Larutan harus disusun berdasarkan massa jenis larutan</li></ol>', 0.196, 2.93, 0.57, 0.47, -1.04, 0, 'B', 'E', 'CT.SM.3.3.19A'),
('S.295', 'MD.13', '<p style=\"text-align: justify;\">Tim ofisial dari atlet panahan Indonesia pada Olimipade Rusia tahun 2014 harus menghadapi situasi genting karena busur panah yang disiapkan mengalami kerusakan karena perbedaan suhu yang ekstrem. Setingan busur pada masa pelatihan disiapkan untuk mampu menembakkan anak panah yang bermassa 250 gr dengan kecepatan 4 m/s dengan tarikan oleh atlet sebesar 20 N dan pertambahan panjang pada busur sejauh 20 cm. Pada saat uji coba di arena, ternyata kecepatan yang dihasilkan hanya sebesar 3 m/s yang menyebabkan anak panah meleset. Solusi yang bisa dilakukan adalah dengan mengganti busur panah atau dengan membuat kalkulasi gaya yang harus diberikan oleh atlet. Besar pertambahan panjang busur yang harus diciptakan adalah 9,6 cm.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Jika opsi penyelesaian yang diambil oleh tim ofisial adalah dengan membuat kalkulasi terkait pemberian gaya oleh atlet, maka konsep fisika yang dapat dipertimbangkan untuk menyelesaikan permasalahan adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Modul Young</li><li>Modulus Bulk</li><li>Modulus Shear</li><li>Energi kinetik pegas</li><li>Energi potensial anak panah</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"\\Delta x=\\frac {mv^^2}{k}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\Delta&amp;space;x=\\frac&amp;space;{mv^^2}{k}\" /></li><li>Karena memenuhi persamaan <img title=\"F=\\frac {mv^2}{k}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;F=\\frac&amp;space;{mv^2}{k}\" /></li><li>Karena memenuhi persamaan <img title=\"\\Delta x = \\sqrt {\\frac {mv^^2}{k}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\Delta&amp;space;x&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{mv^^2}{k}}\" /></li><li>Karena memenuhi persamaan <img title=\"F=\\sqrt{\\frac {mg \\Delta x}{k}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;F=\\sqrt{\\frac&amp;space;{mg&amp;space;\\Delta&amp;space;x}{k}}\" /></li><li>Karena memenuhi persamaan <img title=\"\\Delta x=F\\sqrt{\\frac {mgh}{k}}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\Delta&amp;space;x=F\\sqrt{\\frac&amp;space;{mgh}{k}}\" /></li></ol>', 0.215, 2.934, -0.05, 2.94, -2.89, 0, 'D', 'C', 'CT.DC.3.2.25A'),
('S.296', 'MD.13', '<p>Pada saat menembakkan air, pemadam kebakaran biasanya akan membentuk sudut sebesar <em>&theta; </em>dengan tujuan untuk mendapatkan jangkauan air pada jarak maksimum. Lintasan air yang dihasilkan juga membentuk gerak parabola yang memenuhi persamaan <img title=\"x_{max}=\\frac {v_{0}^{2} \\sin 2\\theta}{g}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;x_{max}=\\frac&amp;space;{v_{0}^{2}&amp;space;\\sin&amp;space;2\\theta}{g}\" />. Hal ini memungkinkan pemadam kebakaran menjaga jarak dari sumber api.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2026A%20(FILEminimizer).jpg\" alt=\"\" /></p>\r\n<p>Jika sudah mencapai sudut 45<sup>o</sup>, pemadam menambah debit air yang masuk menjadi 2 kali lipat sehingga menambah jarak tembakan menjadi 4 kali lipat.</p>\r\n<p><strong>Pertanyaan: </strong>Jika debit air maksimal yang dapat ditembakkan adalah 2 kali lipat, maka untuk mencapai jarak 16 kali jarak semula maka pernyataan yang tepat adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Sudut = 30<sup>o</sup>; diameter = &frac12; kali awal; debit = 1 kali awal</li><li>Sudut = 30<sup>o</sup>; diameter = 1 kali awal; debit = 2 kali awal</li><li>Sudut = 45<sup>o</sup>; diameter = 1 kali awal; debit = 2 kali awal</li><li>Sudut = 45<sup>o</sup>; diameter = &frac12; kali awal; debit = 1 kali awal</li><li>Sudut = 60<sup>o</sup>; diameter = 2 kali awal; debit = 2 kali awal</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar sudut maka semakin jauh jarak air ditembakkan</li><li>Semakin besar diameter selang semakin besar kecepatan air yang ditembakkan</li><li>Semakin besar diameter selang semakin kecil kecepatan air yang ditembakkan</li><li>Semakin besar debit air semakin kecil kecepatan air yang ditembakkan</li><li>Semakin besar debit air semakin jauh jarak air yang ditembakkan</li></ol>', 0.378, 1.5, -0.69, 0.69, -0.01, 0, 'D', 'C', 'CT.AB.3.4.26A'),
('S.297', 'MD.13', '<p style=\"text-align: justify;\">Baut merupakan komponen penting dalam industri modern. Setiap elemen dalam peralatan yang dibuat biasanya dihubungkan dengan baut yang memiliki ukuran besar maupun ukuran kecil. Pada perangkat elektronik misalnya, baut didesain dengan ukuran yang relatif kecil karena dimensi peralatan juga dibuat sepadat mungkin. Selain itu, peralatan elektronik juga cenderung mudah panas sehingga memungkinkan terjadinya pemuaian pada baut yang digunakan. Akibatnya, cukup sering terjadi kerusakan yang disebabkan karena baut hilang atau longgar pada peralatan elektronik. Tanto sebagai teknisi di salah satu perusahaan elektronik berupaya mengoptimalkan baut dengan memilih bahan yang tepat. Berikut adalah hasil percobaan Tanto yang menggunakan campuran U, V, X, Y dan Z.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%2026D%20(FILEminimizer).jpg\" alt=\"\" width=\"438\" height=\"335\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan hasil percobaan yang dilakukan Tanto, permasalahan yang ingin diselesaikan oleh Tanto adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Manakah jenis bahan yang menghasilkan pertambahan panjang yang maksimal untuk baut?</li><li>Manakah jenis bahan yang menghasilkan pertambahan panjang yang minimal untuk baut?</li><li>Manakah jenis bahan yang menghasilkan kenaikan suhu yang maksimal untuk baut?</li><li>Manakah jenis bahan yang menghasilkan kenaikan suhu yang minimal untuk baut?</li><li>Manakah jenis bahan yang memiliki koefisien muai optimal untuk baut?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar kemiringan grafik, semakin kecil pertambahan panjang logam</li><li>Semakin besar kemiringan grafik, semakin besar koefisien muai panjang</li><li>Semakin besar kemiringan grafik, semakin besar energi panas yang diserap</li><li>Semakin besar kemiringan grafik semakin besar pertambahan temperatur yang terjadi.</li><li>Pertambahan panjang berbanding terbalik dengan energi yang diserap</li></ol>', 0.384, 1.802, 0.01, 0.44, -0.46, 0, 'E', 'B', 'CT.RP.3.5.27A'),
('S.298', 'MD.13', '<p>Pelampung pada prinsipnya membantu seseorang untuk mengapung pada saat berada dalam air. Namun demikian, tidak semua pelampung bisa digunakan oleh semua orang. Terdapat aturan mengenai berat badan yang harus diperhatikan pada saat memilih pelampung. Selain ukuran pelampung, massa jenis pelampung adalah hal yang paling penting diperhatikan agar ketika digunakan orang yang menggunakan pelampung tidak tenggelam. Salah satu pelampung yang paling sering digunakan terbuat dari busa dengan massa jenis <img title=\"\\rho_{busa}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\rho_{busa}\" />. Pelampung akan digunakan oleh seseorang yang memiliki massa jenis <img title=\"\\rho_{orang}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\rho_{orang}\" /> dan massa <img title=\"m_{orang}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;m_{orang}\" /> pada air dengan massa jenis <img title=\"\\rho_{fluida}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\rho_{fluida}\" />.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2014B%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"267\" /></p>\r\n<p><strong>Pertanyaan: </strong>Jika volum persentase tubuh tenggelam dinyatakan dengan <em>x </em>dan volum tubuh mengapung adalah <em>y, </em>persamaan yang dapat digunakan untuk menentukan volum busa minimal yang digunakan adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Opsi A <img title=\"V_{busa}=V_{org}\\left [ \\frac {\\left(\\rho_{org} - x\\rho_{fluida} \\right )}{\\left(\\rho_{fluida} - \\rho_{busa} \\right )} \\right ]\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;V_{busa}=V_{org}\\left&amp;space;[&amp;space;\\frac&amp;space;{\\left(\\rho_{org}&amp;space;-&amp;space;x\\rho_{fluida}&amp;space;\\right&amp;space;)}{\\left(\\rho_{fluida}&amp;space;-&amp;space;\\rho_{busa}&amp;space;\\right&amp;space;)}&amp;space;\\right&amp;space;]\" /></li><li>Opsi B <img title=\"V_{busa}=\\frac {1}{V_{org}}\\left [\\frac {\\left (\\rho_{fluida} - \\rho_{busa} \\right )}{\\left (\\rho_{org - x\\rho_{fluida}} \\right )} \\right ]\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;V_{busa}=\\frac&amp;space;{1}{V_{org}}\\left&amp;space;[\\frac&amp;space;{\\left&amp;space;(\\rho_{fluida}&amp;space;-&amp;space;\\rho_{busa}&amp;space;\\right&amp;space;)}{\\left&amp;space;(\\rho_{org&amp;space;-&amp;space;x\\rho_{fluida}}&amp;space;\\right&amp;space;)}&amp;space;\\right&amp;space;]\" /></li><li>Opsi C <img title=\"V_{busa}=V_{org} + \\frac {\\left(\\rho_{org} - y\\rho_{fluida} \\right )}{\\left(\\rho_{fluida} - \\rho_{busa} \\right )}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;V_{busa}=V_{org}&amp;space;+&amp;space;\\frac&amp;space;{\\left(\\rho_{org}&amp;space;-&amp;space;y\\rho_{fluida}&amp;space;\\right&amp;space;)}{\\left(\\rho_{fluida}&amp;space;-&amp;space;\\rho_{busa}&amp;space;\\right&amp;space;)}\" /></li><li>Opsi D <img title=\"V_{busa}=V_{org} - \\frac {\\left (\\rho_{org} - y\\rho_{fluida} \\right )}{\\left (\\rho_{fluida} - \\rho_{busa} \\right )}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;V_{busa}=V_{org}&amp;space;-&amp;space;\\frac&amp;space;{\\left&amp;space;(\\rho_{org}&amp;space;-&amp;space;y\\rho_{fluida}&amp;space;\\right&amp;space;)}{\\left&amp;space;(\\rho_{fluida}&amp;space;-&amp;space;\\rho_{busa}&amp;space;\\right&amp;space;)}\" /></li><li>Opsi E&nbsp; <img title=\"V_{busa}= \\frac {\\left(y\\rho_{org} - x\\rho_{fluida} \\right )}{\\left(x\\rho_{fluida} - y\\rho_{busa} \\right )}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;V_{busa}=&amp;space;\\frac&amp;space;{\\left(y\\rho_{org}&amp;space;-&amp;space;x\\rho_{fluida}&amp;space;\\right&amp;space;)}{\\left(x\\rho_{fluida}&amp;space;-&amp;space;y\\rho_{busa}&amp;space;\\right&amp;space;)}\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin massa jenis fluida, semakin kecil gaya angkat yang dihasilkan</li><li>Semakin besar volum tubuh seseorang, semakin kecil gaya angkat yang dihasilkan</li><li>Semakin besar volum tubuh yang mengapung, semakin besar gaya angkat yang diperlukan</li><li>Semakin besar volum tubuh yang tenggelam, semakin besar gaya angkat yang diperlukan</li><li>Semakin besar massa jenis busa semakin besar gaya angkat yang dihasilkan</li></ol>', 0.26, 2.185, -0.11, 1.94, -1.83, 0, 'A', 'C', 'CT.AD.3.3.29A'),
('S.299', 'MD.13', '<p>Botol parfum menerapkan konsep fluida dalam proses penyemburan parfum dari dalam botol. Terdapat banyak variasi ukuran yang terdapat pada ujung botol sehingga memungkinkan pengguna untuk mengatur semburan yang dihasilkan. Selain itu, variasi juga terdapat pada ukuran botol dan ukuran selang yang terdapat dalam botol.<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2014D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"400\" /></p>\r\n<p><strong>Pertanyaan: </strong>Variasi ukuran ukuran ujung botol dan variasi ukuran selang bertujuan untuk menyelesaikan permasalahan&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Berapa besar volume yang perlu dipindahkan pada setiap kali menyemprotkan parfum?</li><li>Berapa besar tekanan yang perlu diberikan pada setiap kali menyemprotkan parfum?</li><li>Berapa besar perbedaan tekanan udara yang diperlukan pada setiap kali menyemprotkan parfum?</li><li>Berapa besar kecepatan aliran parfum yang dihasilkan pada setiap kali menyemprot parfum?</li><li>Berapa besar ketinggian maksimal untuk setiap volum botol?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena sesuai dengan persamaan <img title=\"\\frac {v^^2 \\rho_{zat cair}}{4}=\\rho_{udara}gh\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac&amp;space;{v^^2&amp;space;\\rho_{zat&amp;space;cair}}{4}=\\rho_{udara}gh\" /></li><li>Karena sesuai dengan persamaan <img title=\"v^^2\\rho_{udara}=\\sqrt {2 \\rho_{zat cair} g h}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;v^^2\\rho_{udara}=\\sqrt&amp;space;{2&amp;space;\\rho_{zat&amp;space;cair}&amp;space;g&amp;space;h}\" /></li><li>Karena sesuai dengan persamaan <img title=\"\\frac {v^^2 \\rho_{udara}}{4}=\\rho_{zat cair}gh\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac&amp;space;{v^^2&amp;space;\\rho_{udara}}{4}=\\rho_{zat&amp;space;cair}gh\" /></li><li>Karena sesuai dengan persamaan <img title=\"4v^^2\\rho_{zat cair} = \\rho_{udara}gh\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;4v^^2\\rho_{zat&amp;space;cair}&amp;space;=&amp;space;\\rho_{udara}gh\" /></li><li>Karena sesuai dengan persamaan <img title=\"\\frac {1}{2}\\rho_{udara}v^^2=\\rho_{zat cair}gh\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac&amp;space;{1}{2}\\rho_{udara}v^^2=\\rho_{zat&amp;space;cair}gh\" /></li></ol>', 0.168, 3.294, -1.77, 4.34, -2.58, 0, 'C', 'E', 'CT.RP.3.4.2B'),
('S.300', 'MD.13', '<p style=\"text-align: justify;\">Menentukan momen inersia suatu benda dapat dilakukan dengan membandingkan momen inersia benda yang sudah diketahui dengan benda yang belum diketahui. Selain itu, untuk menentukan momen inersia suatu benda juga dapat dilakukan dengan mengitung nilai momen inersia dengan persamaan&nbsp;<img title=\"I=\\frac{\\tau }{\\alpha }\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;I=\\frac{\\tau&amp;space;}{\\alpha&amp;space;}\" /> yang mana untuk masing-masing nilai <img title=\"\\tau\" src=\"https://latex.codecogs.com/gif.latex?\\tau\" /> dan&nbsp;<em><img title=\"\\alpha\" src=\"https://latex.codecogs.com/gif.latex?\\alpha\" /> </em>bisa diperoleh dari percobaan yang dilakukan kemudian dimasukan ke dalam persamaan <img title=\"\\frac {1}{a}=\\frac {1}{R_{y}R_{x}}\\frac {1}{m}+\\frac{1}{g}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\frac&amp;space;{1}{a}=\\frac&amp;space;{1}{R_{y}R_{x}}\\frac&amp;space;{1}{m}+\\frac{1}{g}\" />.&nbsp;<img title=\"\\tau\" src=\"https://latex.codecogs.com/gif.latex?\\tau\" /> adalah momen gaya,&nbsp;<img title=\"\\alpha\" src=\"https://latex.codecogs.com/gif.latex?\\alpha\" /> yaitu percepatan sudut, <em>R<sub>y</sub></em> yaitu jari-jari lempengan yang diketahui dan <em>R<sub>y</sub></em> yaitu jari-jari lempengan yang divariasikan. Dalam grafik yang dibuat, dipakai 1/<em>a</em> sebagai variabel terikat, 1/<em>m</em> sebagai variabel bebas dimana <em>m</em> yaitu massa dari beban, 1/<em>g</em> yaitu konstanta dari gradien yaitu 1/<em>Rb.g</em>.</p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan narasi diatas, grafik yang menunjukkan nilai <em>a </em>adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Opsi A <img src=\"/assets/source/Paket%20B/5a.png\" alt=\"\" width=\"300\" height=\"243\" /></li><li>Opsi B <img src=\"/assets/source/Paket%20B/5b.png\" alt=\"\" width=\"300\" height=\"234\" /></li><li>Opsi C&nbsp;<img src=\"/assets/source/Paket%20B/5c.png\" alt=\"\" width=\"300\" height=\"251\" /></li><li>Opsi D <img src=\"/assets/source/Paket%20B/5d.png\" alt=\"\" width=\"300\" height=\"241\" /></li><li>Opsi E <img src=\"/assets/source/Paket%20B/5e.png\" alt=\"\" width=\"300\" height=\"250\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Percepatan dan massa benda dalam gerak rotasi berbanding lurus</li><li>Percepatan dan massa benda dalam gerak rotasi berbanding terbalik</li><li>Percepatan dan massa benda dalam gerak rotasi berbanding lurus secara kuadratik</li><li>Percepatan dan massa benda dalam gerak rotasi berbanding terbalik secara kuadratik</li><li>Percepatan benda selama gerak rotasi bersifat konstan</li></ol>', 0.364, 1.391, -1.59, 1.14, 0.45, 0, 'A', 'A', 'CT.AB.3.1.5B'),
('S.301', 'MD.13', '<p>Mesin Crane tipe Derek STC250 menggunakan penggerak gandar ganda yang menyediakan pengangkutan yang dengan kinerja handal. Sistem tiang super panjang dan super kuat dengan kapasitas beban angkat yang sangat sensitif memiliki fitur empat bagian tiang yang terbuat dari baja kekuatan tinggi dan bagian berbentuk U yang dioptimalkan mengurangi berat dan secara signifikan meningkatkan keamanan. Pengait memungkinkan bekerja pada sudut 0&deg;, 15&deg; hingga 30&deg; menjamin perubahan-bertukar cepat antara kondisi operasi yang berbeda sehingga dapat meningkatkan efisiensi kerja mesin.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%206B%20(FILEminimizer).jpg\" alt=\"\" width=\"635\" height=\"236\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berapakah massa beban maksimum yang boleh diangkat oleh Crane STC250 jika kapasitas angkat maksimum sebesar 25 ton (sudut 90<sup>o</sup>) pada panjang kail (<em>boom</em>) maksimum 42 meter?</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>119 kg</li><li>990 kg</li><li>1190 kg</li><li>5119 kg</li><li>11905 kg</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"m_{x max}=\\frac {M_{max}}{gr \\sin \\theta}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;m_{x&amp;space;max}=\\frac&amp;space;{M_{max}}{gr&amp;space;\\sin&amp;space;\\theta}\" /></li><li>Karena memenuhi persamaan <img title=\"m_{x max}=\\frac {M_{max} g}{r \\cos \\theta}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;m_{x&amp;space;max}=\\frac&amp;space;{M_{max}&amp;space;g}{r&amp;space;\\cos&amp;space;\\theta}\" /></li><li>Karena memenuhi persamaan <img title=\"m_{x max}=\\frac {M_{max}g \\cos \\theta}{r}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;m_{x&amp;space;max}=\\frac&amp;space;{M_{max}g&amp;space;\\cos&amp;space;\\theta}{r}\" /></li><li>Karena memenuhi persamaan <img title=\"m_{x max}=\\frac {M_{max} g}{r \\sin \\theta}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;m_{x&amp;space;max}=\\frac&amp;space;{M_{max}&amp;space;g}{r&amp;space;\\sin&amp;space;\\theta}\" /></li><li>Karena memenuhi persamaan <img title=\"m_{x max}=\\frac {M_{max}}{r \\sin \\theta}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;m_{x&amp;space;max}=\\frac&amp;space;{M_{max}}{r&amp;space;\\sin&amp;space;\\theta}\" /></li></ol>', 0.25, 2.68, -1.37, 5.15, -3.78, 0, 'C', 'E', 'CT.AD.3.1.6B'),
('S.302', 'MD.13', '<p style=\"text-align: justify;\">Mesin Crane memiliki fungsi untuk memindahkan material baik secara horizontal maupun secara vertikal. Untuk mengangkat material secara vertikal, mesin Crane memanfaatkan skema katrol. Karena kesalahan teknis, katrol pada mesin Crane mengalai kerusakan dan perlu diganti. Penggantian memakan waktu 2 hari (1 hari untuk membongkar dan 1 hari untuk memasang). Sebagai teknisi yang bertugas, kamu diharuskan memilih jenis katrol yang paling efisien untuk digunakan dalam proyek ini. Berikut adalah katalog katrol yang disediakan <em>supplier</em>.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20B/7.png\" alt=\"\" /></p>\r\n<p><strong>Pertanyaan: </strong>Jika kamu hanya memungkinkan untuk mengganti katrol sebanyak 1x, jenis katrol yang tepat untuk menunjang kinerja proyek adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Katrol K01A</li><li>Katrol K02Y</li><li>Katrol K01T</li><li>Katrol K07Z</li><li>Katrol K17A</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"a_{beban}=\\frac{1}{2}M_{katrol} T_{tegangan tali}\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;a_{beban}=\\frac{1}{2}M_{katrol}&amp;space;T_{tegangan&amp;space;tali}\" /></li><li>Karena memenuhi persamaan <img title=\"a_{beban}=\\alpha_{rotasi}R\" src=\"https://latex.codecogs.com/gif.latex?a_{beban}=\\alpha_{rotasi}R\" /></li><li>Karena memenuhi persamaan <img title=\"a_{beban}=\\frac {m_{beban}.g}{m_{beban}+\\frac {1}{2}M_{katrol}}\" src=\"https://latex.codecogs.com/gif.latex?a_{beban}=\\frac&amp;space;{m_{beban}.g}{m_{beban}+\\frac&amp;space;{1}{2}M_{katrol}}\" /></li><li>Karena memenuhi persamaan <img title=\"a_{beban}=\\frac {2h}{t^2}\" src=\"https://latex.codecogs.com/gif.latex?a_{beban}=\\frac&amp;space;{2h}{t^2}\" /></li><li>Karena memenuhi persamaan <img title=\"a_{beban}=\\frac {2T_{tegangan tali}}{M_{katrol}}\" src=\"https://latex.codecogs.com/gif.latex?a_{beban}=\\frac&amp;space;{2T_{tegangan&amp;space;tali}}{M_{katrol}}\" /></li></ol>', 0.264, 2.828, 0.78, 1.42, -2.19, 0, 'E', 'C', 'CT.SM.3.1.7B');
INSERT INTO `soal` (`id_soal`, `id_mode`, `soal`, `jawaban`, `alasan`, `a`, `b`, `bi1`, `bi2`, `bi3`, `c`, `kunci_jawaban`, `kunci_alasan`, `kode`) VALUES
('S.303', 'MD.13', '<p style=\"text-align: justify;\">Suatu kompor listrik merek X memiliki daya sebesar 1200 watt. Kompor tersebut memiliki efisiensi 95% untuk mengubah energi listrik menjadi panas sehingga bisa memanaskan air dingin (10<sup>o</sup>C) menjadi mendidih (100<sup>o</sup>C) dalam waktu 7 menit saja. Akibatnya, Sherly yang baru pertama kali memasak menggunakan kompor listrik tersebut mendapati kompor yang kosong karena ia meninggalkan kompor selama 15 menit untuk mandi.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan narasi yang disajikan, konsep fisika yang dapat dipertimbangkan untuk menyelesaikan permasalahan Sherly adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Laju perpindahan kalor</li><li>Kapasitas Kalor</li><li>Kalor Jenis</li><li>Asas Black</li><li>Koefisien muai zat</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"P\\rho V=tc \\Delta T\" src=\"https://latex.codecogs.com/gif.latex?P\\rho&amp;space;V=tc&amp;space;\\Delta&amp;space;T\" /></li><li>Karena memenuhi persamaan <img title=\"Vc \\Delta T=Pt\\rho\" src=\"https://latex.codecogs.com/gif.latex?Vc&amp;space;\\Delta&amp;space;T=Pt\\rho\" /></li><li>Karena memenuhi persamaan <img title=\"PtV=\\rho c \\Delta T\" src=\"https://latex.codecogs.com/gif.latex?PtV=\\rho&amp;space;c&amp;space;\\Delta&amp;space;T\" /></li><li>Karena memenuhi persamaan <img title=\"PV=\\rho c t \\Delta T\" src=\"https://latex.codecogs.com/gif.latex?PV=\\rho&amp;space;c&amp;space;t&amp;space;\\Delta&amp;space;T\" /></li><li>Karena memenuhi persamaan <img title=\"Pt=V\\rho c \\Delta T\" src=\"https://latex.codecogs.com/gif.latex?Pt=V\\rho&amp;space;c&amp;space;\\Delta&amp;space;T\" /></li></ol>', 0.3, 3.546, -0.44, 2.79, -2.35, 0, 'D', 'E', 'CT.DC.3.5.13B'),
('S.304', 'MD.13', '<p>Pelampung pada prinsipnya membantu seseorang untuk mengapung pada saat berada dalam air. Namun demikian, tidak semua pelampung bisa digunakan oleh semua orang. Terdapat aturan mengenai berat badan yang harus diperhatikan pada saat memilih pelampung. Selain ukuran pelampung, massa jenis pelampung adalah hal yang paling penting diperhatikan agar ketika digunakan orang yang menggunakan pelampung tidak tenggelam. Salah satu pelampung yang paling sering digunakan terbuat dari busa dengan massa jenis <img title=\"\\rho_{busa}\" src=\"https://latex.codecogs.com/gif.latex?\\rho_{busa}\" />. Pelampung akan digunakan oleh seseorang yang memiliki massa jenis <img title=\"\\rho_{org}\" src=\"https://latex.codecogs.com/gif.latex?\\rho_{org}\" />&nbsp;dan massa <img title=\"m_{org}\" src=\"https://latex.codecogs.com/gif.latex?m_{org}\" /> pada air dengan massa jenis <img title=\"\\rho_{fluida}\" src=\"https://latex.codecogs.com/gif.latex?\\rho_{fluida}\" />. Selain itu, penentuan pelampung juga mempertimbangkan persentase volum tubuh tenggelam dan volum tubuh mengapung.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2014B%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"267\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan variabel yang dijadikan pertimbangan dalam memilih pelampung, permasalahan yang ingin diselesaikan dalam konteks tersebut adalah&hellip;.</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Bagaimana perbandingan ideal volum tubuh pengguna dengan volum pelampung?</li><li>Bagaimana perbandingan ideal massa jenis tubuh pengguna dengan massa jenis pelampung?</li><li>Bagaimana perbandingan ideal massa jenis tubuh pengguna dengan massa jenis fluida?</li><li>Bagaimana perbandingan ideal massa jenis pelampung dengan massa jenis fluida?</li><li>Bagaimana perbandingan ideal persentase tubuh didalam air dan di luar air saat menggunakan pelampung?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin massa jenis fluida, semakin kecil gaya angkat yang dihasilkan</li><li>Semakin besar volum tubuh seseorang, semakin kecil gaya angkat yang dihasilkan</li><li>Semakin besar volum tubuh yang mengapung, semakin besar gaya angkat yang diperlukan</li><li>Semakin besar volum tubuh yang tenggelam, semakin besar gaya angkat yang diperlukan</li><li>Semakin besar massa jenis busa semakin besar gaya angkat yang dihasilkan</li></ol>', 0.256, 2.512, -0.1, 1.24, -1.14, 0, 'A', 'C', 'CT.RP.3.3.14B'),
('S.305', 'MD.13', '<p>Ban merupakan komponen penting bagi kendaraan. Biasanya, ban dibuat menggunakan campuran karet dengan pertimbangan diameter, lebar, ketebalan, jenis jalan, kecepatan rerata pengguna dan tekstur permukaan. Selanjutnya, ban akan diisi angin sebagai penopang beban.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2015B%20(FILEminimizer).jpg\" alt=\"\" width=\"480\" height=\"240\" /></p>\r\n<p><strong>Pertanyaan: </strong>Variabel yang perlu dipertimbangkan untuk memilih ban dalam adalah....</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Diameter, lebar, dan tekstur permukaan</li><li>Diameter, lebar, dan kecepatan rerata pengguna</li><li>Diameter, lebar, dan beban maksimal pengguna</li><li>Diameter, lebar, dan ketebalan ban.</li><li>Diameter, lebar, dan jenis jalan.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Tekstur ban dalam adalah sama untuk semua jenis ban</li><li>Ban dalam tidak berinteraksi dengan ban luar</li><li>Ban dalam berinteraksi dengan tekstur jalanan</li><li>Pemilihan Ban dalam tidak dipengaruhi oleh beban pengguna</li><li>Kecepatan gerak kendaraan memperbesar diameter ban dalam.</li></ol>', 0.408, -0.97, -1.88, 2.27, -0.39, 0, 'D', 'D', 'CT.MD.3.2.15B'),
('S.306', 'MD.13', '<p style=\"text-align: justify;\">Sabun cuci tangan saat ini menjadi salah satu hal wajib yang kita jumpai baik di pusat keramaian, kampus, sekolah, dan sebagainya. Hal ini mendorong pelaku UMKM mengembangkan sabun cuci tangan. Meskipun demikian, terkadang sabun cuci tangan yang diproduksi oleh UMKM mendapatkan banyak kendala seperti sulit untuk dipompa keluar. Kendala-kendala yang ditemukan pada produk rumahan biasanya disebabkan kurangnya pengujian terkait produk yang dilakukan, dalam hal ini berkaitan dengan masalah Viskositas sabun sabun cair normal yang tersedia secara komersial terletak pada kisaran 1000 hingga 3500 cps (centipoises). Adrian yang bekerja di dinas koperasi dan UMKM, ditugaskan untuk membantu pelaku UMKM menyelesaikan permasalahan tersebut dengan menghasilkan data pengujian sebagai berikut:</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/16B%20OK.png\" alt=\"16B OK\" width=\"553\" height=\"325\" /></p>\r\n<p style=\"text-align: justify;\">Adrian melakukan pengujian dengan menggunakan kelereng yang dijatuhkan ke dalam sabun yang dibuat, kemudian dicatat waktu tempuh kelereng dari permukaan sabun hingga menyentuh dasar. Meski menggunakan eksperimen yang sederhana, informasi yang dihasilkan masih cukup sulit untuk dipahami oleh masyarakat sehingga perlu disederhanakan.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Untuk memudahkan pengujian yang dilakukan, pernyataan yang tepat berdasarkan informasi pada grafik untuk membuat kesimpulan adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Massa jenis larutan tidak boleh lebih dari 250 kg/m3</li><li>Massa jenis larutan tidak boleh kurang dari 250 kg/m3</li><li>Waktu jatuh kelereng tidak boleh lebih dari 10 detik</li><li>Waktu jatuh kelereng tidak boleh kurang dari 80 detik</li><li>Waktu jatuh kelereng antara 15 hingga 35 detik</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"\\eta =\\frac {2R^^2gt}{9x}\\left (\\rho_{benda} - \\rho_{zat cair} \\right )\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\eta&amp;space;=\\frac&amp;space;{2R^^2gt}{9x}\\left&amp;space;(\\rho_{benda}&amp;space;-&amp;space;\\rho_{zat&amp;space;cair}&amp;space;\\right&amp;space;)\" /></li><li>Karena memenuhi persamaan <img title=\"\\eta =\\frac {9R^^2gt}{2x}\\left (\\rho_{benda} - \\rho_{zat cair} \\right )\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\eta&amp;space;=\\frac&amp;space;{9R^^2gt}{2x}\\left&amp;space;(\\rho_{benda}&amp;space;-&amp;space;\\rho_{zat&amp;space;cair}&amp;space;\\right&amp;space;)\" /></li><li>Karena memenuhi persamaan <img title=\"\\eta =\\frac {2R^^2gx}{9t}\\left (\\rho_{benda} - \\rho_{zat cair} \\right )\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\eta&amp;space;=\\frac&amp;space;{2R^^2gx}{9t}\\left&amp;space;(\\rho_{benda}&amp;space;-&amp;space;\\rho_{zat&amp;space;cair}&amp;space;\\right&amp;space;)\" /></li><li>Karena memenuhi persamaan <img title=\"\\eta =\\frac {9R^^2gx}{2t}\\left (\\rho_{benda} - \\rho_{zat cair} \\right )\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\eta&amp;space;=\\frac&amp;space;{9R^^2gx}{2t}\\left&amp;space;(\\rho_{benda}&amp;space;-&amp;space;\\rho_{zat&amp;space;cair}&amp;space;\\right&amp;space;)\" /></li><li>Karena memenuhi persamaan <img title=\"\\eta =\\frac {2R^^2gt}{9x}\\left (\\rho_{zat cair} - \\rho_{benda} \\right )\" src=\"https://latex.codecogs.com/gif.latex?\\inline&amp;space;\\eta&amp;space;=\\frac&amp;space;{2R^^2gt}{9x}\\left&amp;space;(\\rho_{zat&amp;space;cair}&amp;space;-&amp;space;\\rho_{benda}&amp;space;\\right&amp;space;)\" /></li></ol>', 0.266, 3.137, 1.01, 0.54, -1.55, 0, 'E', 'A', 'CT.DR.3.3.16B'),
('S.307', 'MD.13', '<p style=\"text-align: justify;\">Cairan pendingin atau air radiator pada mesin kendaraan bermotor memiliki fungsi untuk mendinginkan mesin kendaraan pada saat digunakan. Pada umumnya, air radiator digunakan pada kendaraan yang memiliki ukuran mesin yang besar seperti motor sport atau mobil. Pada kondisi umum, mesin akan bekerja secara optimal pada suhu 90-95<sup>o</sup></p>\r\n<p><sup><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2019B%20(FILEminimizer).jpg\" alt=\"\" /></sup></p>\r\n<p style=\"text-align: justify;\">Mesin kendaraan yang dimiliki oleh Pak Hari menghasilkan daya sebesar 97HP (Hourse Power) yang dihasilkan dari proses pembakaran. Karena sudah cukup tua, mesin mobil Pak Hari hanya mampu mengoptimalkan 70% dari daya mesin sebagai daya dorong dan 30% lainnya dikonversi menjadi panas yang memiliki suhu rata-rata 150<sup>o</sup>C. Sehingga, Pak Hari memerlukan penyesuaian dengan jenis cairan pendingin. Berikut adalah jenis cairan pendingin yang tersedia.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20B/19.png\" alt=\"\" /></p>\r\n<p><strong>Pertanyaan: </strong>Jenis cairan pendingin yang tepat digunakan oleh Pak Hari untuk menjaga kinerja mesin optimal adalah.... (diketahui 1 Hp = 745,7 Joule per detik [J/s])</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Merek P</li><li>Merek Q</li><li>Merek R</li><li>Merek S</li><li>Merek T</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Kemampuan cairan pendingin dalam menjaga suhu berbanding lurus dengan kalor yang dihasilkan</li><li>Kemampuan cairan pendingin dalam menjaga suhu berbanding terbalik dengan massa larutan yang digunakan</li><li>Kemampuan cairan pendingin dalam menjaga suhu berbanding terbalik dengan massa jenis yang digunakan</li><li>Kemampuan cairan pendingin dalam menjaga suhu berbanding lurus dengan kalor jenis larutan yang digunakan</li><li>Kemampuan cairan pendingin dalam menjaga suhu terbalik dengan volum larutan yang digunakan</li></ol>', 0.145, 2.48, -2.27, 2.81, -0.54, 0, 'A', 'D', 'CT.SM.3.3.19B'),
('S.308', 'MD.13', '<p style=\"text-align: justify;\"><em>Springbed</em> (Kasur Per) merupakan kasur yang disertai dengan per pada kerangkanya. Pada awal pengembangannya, orang-orang menambahkan per pada bagian bawah kasur sehingga kasur terasa lebih empuk. Akan tetapi seiring dengan perkembangan ilmu pengetahuan, pada saat ini banyak muncul inovasi <em>springbed</em> yang tidak menggunakan per sebagai instrumen elastis. Biasanya, harga <em>springbed </em>tanpa pegas lebih mahal dibandingkan dengan <em>springbed</em> yang menggunakan per. Karena keterbatasan biaya, pak Tama berencana membeli <em>springbed</em> yang menggunakan per dengan katalog sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20B/25.png\" alt=\"\" width=\"584\" height=\"130\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Jika diasumsikan bahwa <em>springbed </em>memiliki kualitas bagus adalah <em>springbed </em>yang empuk, maka konsep fisika yang dapat digunakan untuk menganalisis kebutuhan Pak Tama adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Modul Young</li><li>Modulus Bulk</li><li>Modulus Shear</li><li>Hukum Hooke</li><li>Energi potensial pegas</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac {Fx}{YA}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac&amp;space;{Fx}{YA}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac {Fk_{pegas}}{\\sum_{1}^{n}n_{pegas}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac&amp;space;{Fk_{pegas}}{\\sum_{1}^{n}n_{pegas}}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x =\\frac {Fn_{pegas}}{k_{pegas}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=\\frac&amp;space;{Fn_{pegas}}{k_{pegas}}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac {F}{n_{pegas}k_{pegas}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac&amp;space;{F}{n_{pegas}k_{pegas}}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"F=-\\frac {k_{pegas}}{n_{pegas}}\\Delta x\" src=\"https://latex.codecogs.com/gif.latex?F=-\\frac&amp;space;{k_{pegas}}{n_{pegas}}\\Delta&amp;space;x\" /></li></ol>', 0.196, 1.988, -4.4, 4.49, -0.09, 0, 'D', 'D', 'CT.DC.3.2.25B'),
('S.309', 'MD.13', '<p>Pembangunan sistem instalasi air bersih dalam suatu rumah atau gedung biasanya menggunakan pipa dengan berbagai ukuran. Biasanya, pipa utama memiliki ukuran yang paling besar dan pipa paling ujung memiliki ukuran yang relatif lebih kecil.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2026B%20(FILEminimizer).jpg\" alt=\"\" /></p>\r\n<p>Asumsikan bahwa air bersumber dari pipa besar yang dipasang secara horizontal dengan diameter <em>R </em>dan mengalir dengan kecepatan <em>v. </em>Kemudian air dialirkan menuju pipa abu-abu dengan diameter 0,75R, pipa merah dan pipa biru dengan <em>diameter</em> 0,5R, serta pipa kuning dengan 0,25R.</p>\r\n<p><strong>Pertanyaan: </strong>Bentuk persamaan yang dapat digunakan untuk menentukan kecepatan aliran air pada masing-masing pipa (<em>v<sub>x</sub></em>) adalah&hellip;.</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li><img title=\"v_{x}=R_{x}^{2}v\" src=\"https://latex.codecogs.com/gif.latex?v_{x}=R_{x}^{2}v\" /> dengan R<sub>x</sub> merupakan diameter pipa <em>x</em></li><li><img title=\"v_{x}=\\frac {2}{3}R_{x}^{2}v\" src=\"https://latex.codecogs.com/gif.latex?v_{x}=\\frac&amp;space;{2}{3}R_{x}^{2}v\" />&nbsp;dengan R<sub>x</sub> merupakan diameter pipa <em>x</em></li><li><img title=\"v_{x}=\\frac {2v}{3R_{x}}\" src=\"https://latex.codecogs.com/gif.latex?v_{x}=\\frac&amp;space;{2v}{3R_{x}}\" />&nbsp;dengan R<sub>x</sub> merupakan diameter pipa <em>x</em></li><li><img title=\"v_{x}=\\frac {4}{9} R_{x}^{2}v\" src=\"https://latex.codecogs.com/gif.latex?v_{x}=\\frac&amp;space;{4}{9}&amp;space;R_{x}^{2}v\" />&nbsp;dengan R<sub>x</sub> merupakan diameter pipa <em>x</em></li><li><img title=\"v_{x}=\\frac {4v}{9R_{x}}\" src=\"https://latex.codecogs.com/gif.latex?v_{x}=\\frac&amp;space;{4v}{9R_{x}}\" />&nbsp;dengan R<sub>x</sub> merupakan diameter pipa <em>x</em></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Kecepatan aliran fluida dalam sistem instalasi berbanding lurus dengan luas penampang pipa yang digunakan.</li><li>Kecepatan aliran fluida dalam sistem instalasi berbanding terbalik dengan luas penampang pipa yang digunakan.</li><li>Jumlah kecepatan aliran pada setiap pipa kecil adalah kecepatan aliran air pada pipa utama</li><li>Jumlah kecepatan aliran pada setiap pipa kecil lebih kecil dibandingkan dengan kecepatan aliran air pada pipa utama</li><li>Jumlah debit air yang dialir pada setiap pipa kecil adalah sama</li></ol>', 0.395, 2.263, 0.59, 1, -1.59, 0, 'D', 'A', 'CT.AB.3.4.26B'),
('S.310', 'MD.13', '<p style=\"text-align: justify;\">Perhatikan Gambar Berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2011A.jpg\" alt=\"\" /></p>\r\n<p>Pada tahap nomor 2, terdapat tahapan menambahkan garam kedalam balok es.</p>\r\n<p><strong>Pertanyaan: </strong>Permasalahan yang iingin diselesaikan pada tahap nomor 2 adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Bagaimana meningkatkan kapasitas panas sistem?</li><li>Bagaimana menurunkan kapasitas panas sistem?</li><li>Bagaimana meningkatkan kalor jenis sistem?</li><li>Bagaimana menurunkan kalor jenis sistem?</li><li>Bagaimana menurunkan titik beku sistem?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga temperature sistem menjadi lebih tinggi.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga temperature sistem menjadi lebih rendah.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga menyebabkan kalor yang diserap menjadi lebih banyak.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga menyebabkan kalor yang diserap menjadi lebih sedikit.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga menyebabkan titik beku sistem menjadi lebih tinggi.</li></ol>', 0.461, 2.694, 0.86, 2.44, -3.3, 0, 'E', 'C', 'CT.RP.3.5.27B'),
('S.311', 'MD.13', '<p>Tangki penyimpanan bahan bakar di SPBU disimpan dibawah tanah yang disebut dengan tangki pendam. Hal ini bertujuan untuk menghemat tempat karena pada tangki bahan bakar memiliki ukuran yang relatif besar. Selain itu, faktor keamanan juga menjadi alasan menempatkan tangki penyimpanan di bawah tanah.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2029B%20(FILEminimizer).jpg\" alt=\"\" width=\"648\" height=\"287\" /></p>\r\n<p>Penyimpanan tangki di bawah tanah tentu memiliki konsekuensi berupa alat tambahan guna menarik bahan bakar dari bawah tanah ke atas. Oleh karena itu, pompa bensin menjadi faktor penting dalam skema pembangungan SPBU. Jika diketahui kedalaman tanki maksimal adalah <em>h<sub>max</sub>, </em>luas selang penghisap adalah <em>A</em>, tekanan dalam tangki adalah <em>P<sub>x</sub>, </em>tekanan di permukaan adalah <em>P<sub>y</sub></em>, dan massa jenis minya adalah <em>&rho;.</em></p>\r\n<p><strong>Pertanyaan: </strong>Tentukan perbedaan tekanan <em>P<sub>x</sub> </em>dan <em>P<sub>y </sub></em>yang harus diciptakan pompa bahan bakar agar mampu menarik bahan secara vertikal sejauh <em>h </em>meter&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li><img title=\"P_{x} - P_{y}=\\frac {1}{\\rho g h}\" src=\"https://latex.codecogs.com/gif.latex?P_{x}&amp;space;-&amp;space;P_{y}=\\frac&amp;space;{1}{\\rho&amp;space;g&amp;space;h}\" /></li><li><img title=\"P_{x} - P_{y} = \\rho g h\" src=\"https://latex.codecogs.com/gif.latex?P_{x}&amp;space;-&amp;space;P_{y}&amp;space;=&amp;space;\\rho&amp;space;g&amp;space;h\" /></li><li><img title=\"P_{x} - P_{y} = \\frac {1}{2}\\rho g h\" src=\"https://latex.codecogs.com/gif.latex?P_{x}&amp;space;-&amp;space;P_{y}&amp;space;=&amp;space;\\frac&amp;space;{1}{2}\\rho&amp;space;g&amp;space;h\" /></li><li><img title=\"P_{x} - P_{y} = A \\rho g h\" src=\"https://latex.codecogs.com/gif.latex?P_{x}&amp;space;-&amp;space;P_{y}&amp;space;=&amp;space;A&amp;space;\\rho&amp;space;g&amp;space;h\" /></li><li><img title=\"P_{x} - P_{y} = \\frac {\\rho g h}{A}\" src=\"https://latex.codecogs.com/gif.latex?P_{x}&amp;space;-&amp;space;P_{y}&amp;space;=&amp;space;\\frac&amp;space;{\\rho&amp;space;g&amp;space;h}{A}\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar masa jenis minyak semakin tinggi h yang bisa dicapai</li><li>Semakin besar masa jenis minyak, semakin kecil tekanan yang dihasilkan</li><li>Semakin besar masa jenis minyak semakin besar perbedaan tekanan yang diperlukan</li><li>Semakin besar luas selang penghisap A, semakin besar tekanan yang dihasilkan</li><li>Semakin besar luas selang penghisap <em>A, </em>semakin kecil tekanan yang dihasilkan</li></ol>', 0.198, 2.303, 0.73, 0.66, -1.39, 0, 'B', 'C', 'CT.AD.3.3.29B'),
('S.312', 'MD.13', '<p>Tantri merupakan seorang teknisi di unit pengembangan produk yang berfokus pada pembuatan alat masak menggunakan daya listrik. Salah satu produk yang dikembangkan Tantri adalah dispenser model terbaru yang mampu memanaskan air dan mendinginkan air dalam waktu bersamaan. Untuk mendapatkan hasil yang optimal, Tantri melakukan pengujian mengenai terkait konsumsi daya listrik dan lama waktu pemanasan untuk mendapatkan temperatur yang ideal. Berikut adalah hasil data percobaan Tantri.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/4.png\" alt=\"\" width=\"355\" height=\"406\" /></p>\r\n<p>Karena variabel data yang relatif banyak, Tantri mengalami kesulitan untuk menentukan pilihan terbaik untuk menghasilkan model dispenser yang baik. Oleh karena itu Tantri berinisiatif melaporkan hasil pengujian dalam bentuk grafik.</p>\r\n<p><strong>Pertanyaan: </strong>Grafik percobaan yang tepat berdasarkan data hasil percobaan Tantri adalah&hellip;.</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Opsi A <img src=\"/assets/source/Paket%20C/4a.png\" alt=\"\" width=\"300\" height=\"260\" /></li><li>Opsi B <img src=\"/assets/source/Paket%20C/4b.png\" alt=\"\" width=\"300\" height=\"253\" /></li><li>Opsi C <img src=\"/assets/source/Paket%20C/4c.png\" alt=\"\" width=\"300\" height=\"254\" /></li><li>Opsi D <img src=\"/assets/source/Paket%20C/4d.png\" alt=\"\" width=\"300\" height=\"259\" /></li><li>Opsi E <img src=\"/assets/source/Paket%20C/4e.png\" alt=\"\" width=\"300\" height=\"257\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20C/4-a.png\" alt=\"\" width=\"100\" height=\"54\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20C/4-b.png\" alt=\"\" width=\"100\" height=\"41\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20C/4-c%20(1).png\" alt=\"4-c (1)\" width=\"100\" /></li><li>Karena sesuai dengan persamaan&nbsp;<img src=\"/assets/source/Paket%20C/4-d.png\" alt=\"\" width=\"100\" height=\"40\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20C/4-e.png\" alt=\"\" width=\"100\" height=\"21\" /></li></ol>', 0.285, 1.735, 1.85, -1, -0.85, 0, 'D', 'B', 'CT.DR.3.5.4C'),
('S.313', 'MD.13', '<p>Rani sedang melakukan percobaan mengenai pengaruh jumlah karet terhadap konstanta pegas. Rani mencatat hasil temuannya dalam sebuah tabel seperti berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/5.png\" alt=\"\" width=\"482\" height=\"115\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan hasil percobaan yang dilakukan oleh Rani, pernyataan yang tepat adalah....</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Modulus elastis (Modulus Young) yang dihasilkan berbanding lurus dengan gaya yang diberikan</li><li>konstanta pegas yang dihasilkan berbanding lurus dengan gaya yang diberikan</li><li>Konstanta pegas yang digunakan pada rangkaian seri adalah 400 N/m</li><li>Konstanta pegas yang digunakan pada rangkaian paralel adalah 160 N/m</li><li>Konstanta pegas yang digunakan pada rangkaian seri dan rangkaian paralel adalah sama</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Penambahan gaya pada pegas menambah panjang pada pegas awal sehingga konstanta pegas mengalami pengurangan</li><li>Penambahan gaya pada pegas menambah panjang pada pegas sehingga Modulus Young pegas awal mengalami pengurangan</li><li>Perangkaian pegas secara paralel, memperkecil pertambahan panjang sehingga konstanta pegas awal menjadi bertambah</li><li>Perangkaian pegas secara paralel, memperbesar pertambahan panjang sehingga konstanta pegas awal menjadi berkurang</li><li>Perangkaian pegas secara seri atau paralel tidak mengubah konstanta pegas awal akan tetapi mengubah konstanta pegas sistem</li></ol>', 0.322, 2.359, -2.31, -0.58, 2.89, 0, 'E', 'E', 'CT.AB.3.2.5C'),
('S.314', 'MD.13', '<p style=\"text-align: justify;\">Suatu kompor listrik merek X memiliki daya sebesar 1200 watt. Kompor tersebut memiliki efisiensi 95% untuk mengubah energi listrik menjadi panas sehingga bisa memanaskan air dingin (10<sup>o</sup>C) menjadi mendidih (100<sup>o</sup>C) dalam waktu 7 menit saja. Akibatnya, Sherly yang baru pertama kali memasak menggunakan kompor listrik tersebut mendapati kompor yang kosong karena ia meninggalkan kompor selama 15 menit untuk mandi.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berapakah volum air minimal yang harus dimasak oleh Sherli agar ia bisa memasak air dan meninggalkannya 15 menit untuk mandi? (c<sub>air </sub>4200 J/kg<sup>o</sup>C, <em>&rho;</em><sub>air </sub>= 1000 kg/m<sup>3</sup>)</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>1,14 liter</li><li>1,20 liter</li><li>2,30 liter</li><li>2,44 liter</li><li>2,57 liter</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"V=\\frac {P\\rho}{tc\\Delta T}\" src=\"https://latex.codecogs.com/gif.latex?V=\\frac&amp;space;{P\\rho}{tc\\Delta&amp;space;T}\" /></li><li>Karena memenuhi persamaan <img title=\"V=\\frac {Pt\\rho}{c\\Delta T}\" src=\"https://latex.codecogs.com/gif.latex?V=\\frac&amp;space;{Pt\\rho}{c\\Delta&amp;space;T}\" /></li><li>Karena memenuhi persamaan <img title=\"V=\\frac {\\rho c \\Delta T}{Pt}\" src=\"https://latex.codecogs.com/gif.latex?V=\\frac&amp;space;{\\rho&amp;space;c&amp;space;\\Delta&amp;space;T}{Pt}\" /></li><li>Karena memenuhi persamaan <img title=\"V=\\frac {\\rho c \\Delta T t}{P}\" src=\"https://latex.codecogs.com/gif.latex?V=\\frac&amp;space;{\\rho&amp;space;c&amp;space;\\Delta&amp;space;T&amp;space;t}{P}\" /></li><li>Karena memenuhi persamaan <img title=\"V=\\frac {P t }{\\rho c \\Delta T}\" src=\"https://latex.codecogs.com/gif.latex?V=\\frac&amp;space;{P&amp;space;t&amp;space;}{\\rho&amp;space;c&amp;space;\\Delta&amp;space;T}\" /></li></ol>', 0.224, 2.853, -1.46, 3.98, -2.52, 0, 'D', 'E', 'CT.AD.3.5.6C'),
('S.315', 'MD.13', '<p style=\"text-align: justify;\"><em>Springbed</em> (Kasur Per) merupakan kasur yang disertai dengan per pada kerangkanya. Pada awal pengembangannya, orang-orang menambahkan per pada bagian bawah kasur sehingga kasur terasa lebih empuk. Akan tetapi seiring dengan perkembangan ilmu pengetahuan, pada saat ini banyak muncul inovasi <em>springbed</em> yang tidak menggunakan per sebagai instrumen elastis. Biasanya, harga <em>springbed </em>tanpa pegas lebih mahal dibandingkan dengan <em>springbed</em> yang menggunakan per. Karena keterbatasan biaya, pak Tama berencana membeli <em>springbed</em> yang menggunakan per dengan katalog sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/7.png\" alt=\"\" width=\"600\" height=\"169\" /></p>\r\n<p><strong>Pertanyaan: </strong>Jika diasumsikan bahwa <em>springbed </em>memiliki kualitas bagus adalah <em>springbed </em>yang empuk, maka merek <em>springbed </em>yang tepat dipilih oleh Pak Tama adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Merek A</li><li>Merek B</li><li>Merek C</li><li>Merek D</li><li>Merek E</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac {Fx}{YA}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac&amp;space;{Fx}{YA}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac{Fk_{pegas}}{\\sum_{1}^{n}n_{pegas}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac{Fk_{pegas}}{\\sum_{1}^{n}n_{pegas}}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac{Fn_{pegas}}{k_{pegas}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac{Fn_{pegas}}{k_{pegas}}\" /></li><li>Springbed yang empuk tidak kaku, sehingga berlaku <img title=\"\\Delta x = \\frac{F}{n_{pegas} k_{pegas}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac{F}{n_{pegas}&amp;space;k_{pegas}}\" /></li><li>Springbe<em>d </em>yang empuk tidak kaku, sehingga berlaku <img title=\"F=-\\frac{k_{pegas}}{n_{pegas}}\\Delta x\" src=\"https://latex.codecogs.com/gif.latex?F=-\\frac{k_{pegas}}{n_{pegas}}\\Delta&amp;space;x\" /></li></ol>', 0.244, 3.076, -1.38, 3.07, -1.69, 0, 'C', 'D', 'CT.SM.3.2.7C'),
('S.316', 'MD.13', '<p>Pekerjaan sebagai pemadam kebakaran memiliki tingkat risiko kecelakaan yang tinggi terutama saat tidak terdapat area yang dapat menyuplai air. Oleh karena itu, mobil pemadam kebakaran biasanya mengisi tangki mobil dengan air sehingga dapat digunakan kapan saja. Meskipun demikian, pada beberapa kasus petugas pemadam kebakaran tetap mengalami kendala ketika tidak terdapat akses yang memadai menuju lokasi kebakaran. Alternatif yang dilakukan adalah dengan menggunakan selang yang disambung-sambung. Maka dari itu, pemadam kebakaran biasanya diberikan pelatihan mengenai pemilihan selang yang sesuai dengan medan kerja yang akan dihadapi. Diantara faktor yang menentukan ukuran selang pemadam kebakaran sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/13.png\" alt=\"\" width=\"500\" height=\"132\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan teks informasi yang diberikan, konsep fisika yang dapat digunakan untuk menyelesaikan permasalahan tersebut adalah&hellip;.</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Tekanan Hidrostatis</li><li>Hukum Pascal</li><li>Hukum Archimedes</li><li>Hukum Stokes</li><li>Asas Bernoulli</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin panjang selang, semakin jauh air ditembakkan</li><li>Semakin pendek selang, semakin kuat air ditembakkan</li><li>Semakin besar selang, semakin kuat air ditembakkan</li><li>Semakin kecil selang, semakin kuat air ditembakkan</li><li>Semakin besar selang, semakin jauh air ditembakkan</li></ol>', 0.505, -0.88, -0.39, -0.41, 0.79, 0, 'E', 'D', 'CT.DC.3.4.13C'),
('S.317', 'MD.13', '<p>Rudi dan rekan-rekannya diminta untuk mengamati suatu objek dan mengidentifikasi sifat-sifat fisis dari objek tersebut. Pada saat akan melakukan pengukuran suhu, termometer yang dimiliki oleh Rudi dan tim rusak sehingga mereka harus membuat termometer sederhana menggunakan cairan X. Kemudian, hasil pengamatan menggunakan termometer akan di analisis di laboratorium. Berikut, adalah variabel yang berhasil dikumpulkan Rudi dan tim setelah melakukan analisis di laboratorium:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/15.png\" alt=\"\" width=\"500\" height=\"179\" /></p>\r\n<p><strong>Pertanyaan: </strong>Variabel yang diperlukan untuk mengonversi suhu benda ke dalam skala Celsius dan menentukan kalor jenis zat X adalah...</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Ketinggian awal, ketinggian akhir, ketinggian pengukuran, volume cairan X, dan diameter pipa/selang</li><li>Ketinggian awal, ketinggian akhir, ketinggian pengukuran, volume cairan X, dan massa jenis cairan X</li><li>Ketinggian awal, ketinggian akhir, ketinggian pengukuran, massa jenis cairan X, dan diameter pipa/selang</li><li>Ketinggian awal, ketinggian akhir, ketinggian pengukuran, massa jenis cairan X, dan waktu mendidih cairan X</li><li>Ketinggian awal, ketinggian akhir, ketinggian pengukuran, diameter pipa/selang, dan waktu mendidih cairan X</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20C/15a.png\" alt=\"\" width=\"200\" height=\"44\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20C/15b.png\" alt=\"\" width=\"200\" height=\"42\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20C/15c.png\" alt=\"\" width=\"200\" height=\"41\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20C/15d.png\" alt=\"\" width=\"200\" height=\"44\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20C/15e.png\" alt=\"\" width=\"200\" height=\"39\" /></li></ol>', 0.424, 1.918, -0.33, 1.68, -1.36, 0, 'B', 'E', 'CT.MD.3.5.15C'),
('S.318', 'MD.13', '<p>Pesawat memiliki kecepatan gerak yang sangat tinggi. Sebelum diketahui koordinat GPS, kecepatan gerak pesawat diukur dengan menghitung perbandingan ketinggian fluida pada tabung pengukuran. Bahkan setelah ditemukan peralatan canggih, konsep pengukuran kecepatan pesawat masih menggunakan konsep yang serupa. Diperlukan ketelitian yang tinggi dalam membuat alat ukur pesawat ini. Resiko yang dihasilkan dari kegagalan indikator pengukur kecepatan pesawat sangat fatal sehingga biasanya dilakukan pengukuran rutin dan perawatan secara berkala.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2016C%20(FILEminimizer)%20(1).jpg\" alt=\"\" width=\"500\" height=\"185\" />Rio merupakan salah satu pekerja di Airbus Industrie SE, bertugas melakukan pengujuan pada komponen kecepatan pesawat dengan mengalirkan udara dengan kecepatan 150 m/s menghasilkan grafik sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/16.png\" alt=\"\" width=\"300\" height=\"262\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan grafik hasil pengukuran yang dihasilkan, pernyataan yang sesuai adalah&hellip;.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Kecepatan udara yang teramati lebih besar dibandingkan yang seharusnya</li><li>Kecepatan udara yang teramati lebih kecil dibandingkan yang seharusnya</li><li>Ketinggian h yang terukur lebih besar dibandingkan seharunys</li><li>Massa jenis zat cair di dalam tabung pengukuran lebih kecil dibandingkan seharusnya</li><li>Massa jenis udara yang mengalir ke dalam tabung pengukuran lebih kecil dibandingkan seharusnya</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"v = \\sqrt {\\frac {\\rho g h}{2 \\left (\\rho_{cair} - \\rho_{udara} \\right )}}\" src=\"https://latex.codecogs.com/gif.latex?v&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{\\rho&amp;space;g&amp;space;h}{2&amp;space;\\left&amp;space;(\\rho_{cair}&amp;space;-&amp;space;\\rho_{udara}&amp;space;\\right&amp;space;)}}\" /></li><li>Karena memenuhi persamaan <img title=\"v = \\sqrt {\\frac {\\rho g h}{2} \\left (\\rho_{cair} - \\rho_{udara} \\right )}\" src=\"https://latex.codecogs.com/gif.latex?v&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{\\rho&amp;space;g&amp;space;h}{2}&amp;space;\\left&amp;space;(\\rho_{cair}&amp;space;-&amp;space;\\rho_{udara}&amp;space;\\right&amp;space;)}\" /></li><li>Karena memenuhi persamaan <img title=\"v = \\sqrt {\\frac {2 g h }{\\rho \\left (\\rho_{cair} - \\rho_{udara} \\right )}}\" src=\"https://latex.codecogs.com/gif.latex?v&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{2&amp;space;g&amp;space;h&amp;space;}{\\rho&amp;space;\\left&amp;space;(\\rho_{cair}&amp;space;-&amp;space;\\rho_{udara}&amp;space;\\right&amp;space;)}}\" /></li><li>Karena memenuhi persamaan <img title=\"v = \\sqrt {\\frac{2gh}{\\rho} \\left (\\rho_{cair} - \\rho_{udara} \\right )}\" src=\"https://latex.codecogs.com/gif.latex?v&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac{2gh}{\\rho}&amp;space;\\left&amp;space;(\\rho_{cair}&amp;space;-&amp;space;\\rho_{udara}&amp;space;\\right&amp;space;)}\" /></li><li>Karena memenuhi persamaan <img title=\"v = \\sqrt {\\frac{gh}{2\\rho} \\left (\\rho_{cair} - \\rho_{udara} \\right )}\" src=\"https://latex.codecogs.com/gif.latex?v&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac{gh}{2\\rho}&amp;space;\\left&amp;space;(\\rho_{cair}&amp;space;-&amp;space;\\rho_{udara}&amp;space;\\right&amp;space;)}\" /></li></ol>', 0.302, 2.749, -1.28, 4.1, -2.81, 0, 'A', 'D', 'CT.DR.3.4.16C'),
('S.319', 'MD.13', '<p>Pak Tono merupakan seorang petugas kebun di suatu taman bermain. Dalam tugasnya, Pak Tono diharuskan menyiram tanaman di seluruh taman bermain. Pada suatu ketika, mesin pompa tanaman yang disediakan pengelola mengalami kerusakan, sehingga Pak Tono diminta untuk membeli mesin pompa yang baru ke toko peralatan. Pak Tono kemudian diberikan lima pilihan pompa dengan spesifikasi sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/19.png\" alt=\"\" width=\"500\" height=\"197\" /><strong>Pertanyaan: </strong>Jika Pak Tono membutuhkan pompa air dengan spesifikasi mampu menjangkau lahan yang sangat luas, maka jenis pompa air yang diperlukan oleh Pak Tono adalah....</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pompa A001</li><li>Pompa B072</li><li>Pompa C310</li><li>Pompa D441</li><li>Pompa E512</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Untuk menjangkau lahan yang luas, diperlukan pompa yang memberikan tekanan besar pada pipa output.</li><li>Untuk menjangkau lahan yang luas, diperlukan pompa yang memberikan kecepatan besar pada pipa output.</li><li>Untuk menjangkau lahan yang luas, diperlukan pompa yang memberikan tekanan besar pada pipa input.</li><li>Untuk menjangkau lahan yang luas, diperlukan pompa yang memberikan kecepatan besar pada pipa input</li><li>Untuk menjangkau lahan yang luas, diperlukan pompa yang memiliki Daya yang besar.</li></ol>', 0.26, 2.849, -0.94, 2.57, -1.63, 0, 'D', 'B', 'CT.SM.3.4.19C'),
('S.320', 'MD.13', '<p style=\"text-align: justify;\">Pelampung pada prinsipnya membantu seseorang untuk mengapung pada saat berada dalam air. Namun demikian, tidak semua pelampung bisa digunakan oleh semua orang. Terdapat aturan mengenai berat badan yang harus diperhatikan pada saat memilih pelampung. Selain ukuran pelampung, massa jenis pelampung adalah hal yang paling penting diperhatikan agar ketika digunakan orang yang menggunakan pelampung tidak tenggelam. Salah satu pelampung yang paling sering digunakan terbuat dari busa dengan massa jenis <img title=\"\\rho_{busa}\" src=\"https://latex.codecogs.com/gif.latex?\\rho_{busa}\" />. Pelampung akan digunakan oleh seseorang yang memiliki massa jenis <img title=\"\\rho_{org}\" src=\"https://latex.codecogs.com/gif.latex?\\rho_{org}\" /> dan massa&nbsp;<img title=\"m_{org}\" src=\"https://latex.codecogs.com/gif.latex?m_{org}\" /> pada air dengan massa jenis <img title=\"\\rho_{fluida}\" src=\"https://latex.codecogs.com/gif.latex?\\rho_{fluida}\" />. Diketahui volum persentase tubuh tenggelam dinyatakan dengan <em>x </em>dan volum tubuh mengapung adalah <em>y.</em></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan informasi yang tersedia, konsep fisika yang dapat digunakan untuk menentukan jenis pelampung yang digunakan adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Hukum Archimedes</li><li>Hukum Pascal</li><li>Hukum Stokes</li><li>Asas Kontinuitas</li><li>Asas Bernoulli</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin massa jenis fluida, semakin kecil gaya angkat yang dihasilkan</li><li>Semakin besar volum tubuh seseorang, semakin kecil gaya angkat yang dihasilkan</li><li>Semakin besar volum tubuh yang mengapung, semakin besar gaya angkat yang diperlukan</li><li>Semakin besar volum tubuh yang tenggelam, semakin besar gaya angkat yang diperlukan</li><li>Semakin besar massa jenis busa semakin besar gaya angkat yang dihasilkan</li></ol>', 0.45, 1.045, -0.39, 1.99, -1.6, 0, 'A', 'C', 'CT.DC.3.3.25C'),
('S.321', 'MD.13', '<p style=\"text-align: justify;\">Saat ini, dispenser tidak lagi hanya berfungsi sebagai alat untuk memanaskan air. Lebih dari itu, saat ini dispenser juga dapat digunakan untuk membuat air dingin dan air panas dalam waktu bersamaan. Sebagai perbandingan, perhatikan data pada Tabel berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20C/26.png\" alt=\"\" width=\"500\" height=\"141\" /></p>\r\n<p><strong>Pertanyaan: </strong>Pernyataan yang tepat berdasarkan data yang diperoleh adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Dispenser X membutuhkan waktu untuk memanaskan air dengan waktu paling cepat</li><li>Dispenser Y membutuhkan waktu untuk memanaskan air paling cepat</li><li>Dispenser Z membutuhkan waktu untuk mendinginkan air paling cepat</li><li>Dispenser U membutuhkan waktu untuk mendingin air paling cepat</li><li>Dispenser V menghasilkan air dingin dengan temperatur paling tinggi.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Volum air memiliki pengaruh yang berbanding terbalik dengan temperatur akhir yang dihasilkan</li><li>Volum air memiliki pengaruh yang berbanding terbalik dengan daya yang digunakan</li><li>Volum air memiliki pengaruh yang berbanding terbalik dengan waktu untuk memanaskan air</li><li>Volum air memiliki pengaruh yang berbanding lurus dengan peningkatan temperatur yang terjadi</li><li>Volume air memiliki pengaruh yang berbanding lurus dengan kalor jenis air</li></ol>', 0.33, 2.181, -0.96, 2.13, -1.17, 0, 'D', 'B', 'CT.AB.3.5.26C'),
('S.322', 'MD.13', '<p style=\"text-align: justify;\">Indonesia sendiri memiliki permainan sepak bola versi ekstrem yang melibatkan api. Permainan bola api biasanya dimainkan sebagai sarana hiburan seperti pada perayaan kemerdekaan, idul fitri, idul adha, dan sebagainya. Uniknya lagi, bola api tidak menggunakan bola sungguhan seperti pada permainan sepak bola. Bola api biasanya terbuat dari kelapa tua yang sudah dikeringkan. Selanjutnya kelapa tersebut akan direndam dalam minyak tanah selama beberapa hari, barulah pada saat akan memulai pertandingan, bola tersebut dibakar.</p>\r\n<p><strong>&nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2022B%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"276\" /></strong></p>\r\n<p style=\"text-align: justify;\">Meskipun dengan tingkat risiko cedera berupa luka bakar pada kulit, permainan bola api justru dilakukan tanpa menggunakan pelindung kaki seperti pada olahraga sepak bola pada umumnya. Selain itu, sepak bola api hanya dilakukan pada malam hari saja.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pada proses pembuatan bola api, pengeringan buah kelapa dan perendaman bola ke dalam minyak tanah selama beberapa hari bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengurangi risiko ledakan pada saat bola dibakar.</li><li>Mengurangi risiko bola hangus saat terbakar</li><li>Memperlambat waktu bola menjadi hangus</li><li>Mengurangi risiko luka bakar pada saat bola ditendang</li><li>Mempermudah untuk membakar bola ketika mati pada saat pertandingan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Minyak tanah cenderung mudah dibakar akan tetapi memiliki titik didih yang lebih tinggi dibandingkan bensin sehingga penguapan lebih lama</li><li>Minyak tanah cenderung mudah dibakar akan tetapi memiliki titik didih yang lebih rendah dibandingkan bensin sehingga penguapan lebih cepat</li><li>Minyak tanah cenderung mudah dibakar dan menghasilkan panas yang lebih tinggi dibandingkan dengan bensin sehingga penguapan lebih cepat</li><li>Minyak tanah cenderung mudah dibakar dan menghasilkan panas yang lebih rendah dibandingkan dengan bensin sehingga penguapan lebih lama</li><li>Minyak tanah cenderung mudah dibakar dan menghasilkan panas yang aman pada saat ditendang dan penguapan lebih cepat.</li></ol>', 0.282, 1.635, -2.31, 4.53, -2.22, 0, 'C', 'A', 'CT.RP.3.5.27C'),
('S.323', 'MD.13', '<p>Keran air biasanya menghasilkan semburan air yang menyebar sehingga untuk menghasilkan semburan air yang terpusat dipasang pipa pendek sejauh 5 cm. Ukuran pipa yang digunakan biasanya lebih kecil dibandingkan dengan ukuran keran sehingga terjadi perbedaan kecepatan aliran air pada saat keluar keran dengan di ujung pipa.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2029C%20(FILEminimizer).jpg\" alt=\"\" width=\"491\" height=\"494\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Persamaan yang menunjukan hubungan antara kecepatan, luas, luas penampang, dan panjang pipa adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li><img src=\"/assets/source/Paket%20C/29a.png\" alt=\"\" width=\"150\" height=\"63\" /></li><li><img src=\"/assets/source/Paket%20C/29b.png\" alt=\"\" width=\"150\" height=\"78\" /></li><li><img src=\"/assets/source/Paket%20C/29c.png\" alt=\"\" width=\"150\" height=\"53\" /></li><li><img src=\"/assets/source/Paket%20C/29d.png\" alt=\"\" width=\"150\" height=\"28\" /></li><li><img src=\"/assets/source/Paket%20C/29e.png\" alt=\"\" width=\"150\" height=\"77\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Akibat perbedaan luas berlaku <img title=\"A_{1}v_{1}=A_{2}v_{2}\" src=\"https://latex.codecogs.com/gif.latex?A_{1}v_{1}=A_{2}v_{2}\" /> dan berakibat pada jarak yang ditempuh dengan <img title=\"v_{t}^{2}=v_{0}^^{2} + 2 a \\Delta s\" src=\"https://latex.codecogs.com/gif.latex?v_{t}^{2}=v_{0}^^{2}&amp;space;+&amp;space;2&amp;space;a&amp;space;\\Delta&amp;space;s\" /></li><li>Akibat perbedaan luas berlaku <img title=\"A_{1}v_{1}=A_{2}v_{2}\" src=\"https://latex.codecogs.com/gif.latex?A_{1}v_{1}=A_{2}v_{2}\" /> dan berakibat pada jarak yang ditempuh dengan <img title=\"v_{t}^^{2}=v_{0}^^{2}+\\frac {1}{2}a s^^{2}\" src=\"https://latex.codecogs.com/gif.latex?v_{t}^^{2}=v_{0}^^{2}+\\frac&amp;space;{1}{2}a&amp;space;s^^{2}\" /></li><li>Akibat perbedaan luas berlaku <img title=\"\\frac {A_{1}}{v_{1}} = \\frac {A_{2}}{v_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\frac&amp;space;{A_{1}}{v_{1}}&amp;space;=&amp;space;\\frac&amp;space;{A_{2}}{v_{2}}\" /> dan berakibat pada jarak yang ditempuh dengan <img title=\"v_{t}^{2}=v_{0}^^{2} + 2 a \\Delta s\" src=\"https://latex.codecogs.com/gif.latex?v_{t}^{2}=v_{0}^^{2}&amp;space;+&amp;space;2&amp;space;a&amp;space;\\Delta&amp;space;s\" /></li><li>Akibat perbedaan luas berlaku&nbsp; <img title=\"\\frac {A_{1}}{v_{1}} = \\frac {A_{2}}{v_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\frac&amp;space;{A_{1}}{v_{1}}&amp;space;=&amp;space;\\frac&amp;space;{A_{2}}{v_{2}}\" /> dan berakibat pada jarak yang ditempuh dengan <img title=\"v_{t}^^{2}=v_{0}^^{2}+\\frac {1}{2}a s^^{2}\" src=\"https://latex.codecogs.com/gif.latex?v_{t}^^{2}=v_{0}^^{2}+\\frac&amp;space;{1}{2}a&amp;space;s^^{2}\" /></li><li>Akibat perbedaan luas berlaku <img title=\"A_{1}v_{1}=A_{2}v_{2}\" src=\"https://latex.codecogs.com/gif.latex?A_{1}v_{1}=A_{2}v_{2}\" /> dan berakibat pada jarak yang ditempuh dengan <img title=\"v_{t} = v_{0} + 2 a s\" src=\"https://latex.codecogs.com/gif.latex?v_{t}&amp;space;=&amp;space;v_{0}&amp;space;+&amp;space;2&amp;space;a&amp;space;s\" /></li></ol>', 0.283, 2.331, -0.37, 1.11, -0.74, 0, 'E', 'A', 'CT.AD.3.4.29C');
INSERT INTO `soal` (`id_soal`, `id_mode`, `soal`, `jawaban`, `alasan`, `a`, `b`, `bi1`, `bi2`, `bi3`, `c`, `kunci_jawaban`, `kunci_alasan`, `kode`) VALUES
('S.324', 'MD.13', '<p style=\"text-align: justify;\">Pak Habibie merupakan seorang penelitia yang berfokus pada pengembangan material maju untuk keperluan rangka pesawat. Saat ini, pak habibi mendapatkan tiga sampel bahan yaitu bahan X, bahan Y, dan bahan Z yang kemudian akan dilakukan pengujian mengenai sifat termal dari bahan tersebut. Hal ini dilakukan agar pemuaian yang terjadi pada rangka pesawat karena suhu tinggi dapat di prediksi. Oleh karena itu, Pak Habibie meminta asistennya Tresno untuk melakukan pengujian terhadap ketiga bahan tersebut dan diperoleh data sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20D/4.png\" alt=\"\" width=\"500\" height=\"246\" /></p>\r\n<p>Karena data yang relatif banyak, Tresno kemudian berencana membuat dalam bentuk grafik sehingga memudahkan Pak Habibie untuk menganalisis data tersebut.</p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan data yang diperoleh oleh Tresno, bentuk grafik yang paling tepat adalah&hellip;.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li><img src=\"/assets/source/Paket%20D/4a.png\" alt=\"\" width=\"200\" height=\"177\" /></li><li><img src=\"/assets/source/Paket%20D/4b.png\" alt=\"\" width=\"200\" height=\"184\" /></li><li><img src=\"/assets/source/Paket%20D/4c.png\" alt=\"\" width=\"200\" height=\"177\" /></li><li><img src=\"/assets/source/Paket%20D/4d.png\" alt=\"\" width=\"200\" height=\"175\" /></li><li><img src=\"/assets/source/Paket%20D/4e.png\" alt=\"\" width=\"200\" height=\"178\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/4-a.png\" alt=\"\" width=\"100\" height=\"43\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/4-b.png\" alt=\"\" width=\"100\" height=\"19\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/4-c.png\" alt=\"\" width=\"100\" height=\"36\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/4-d.png\" alt=\"\" width=\"100\" height=\"21\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/4-e.png\" alt=\"\" width=\"100\" height=\"40\" /></li></ol>', 0.257, 2.144, -1.3, 2.36, -1.06, 0, 'B', 'E', 'CT.DR.3.5.4D'),
('S.325', 'MD.13', '<p style=\"text-align: justify;\">Tim ofisial dari atlet panahan Indonesia pada Olimipade Rusia tahun 2014 harus menghadapi situasi genting karena busur panah yang disiapkan mengalami kerusakan karena perbedaan suhu yang ekstrem. Setingan busur pada masa pelatihan disiapkan untuk mampu menembakkan anak panah yang bermassa 250 gr dengan kecepatan 4 m/s dengan tarikan oleh atlet sebesar 20 N dan pertambahan panjang pada busur sejauh 20 cm. Pada saat uji coba di arena, ternyata kecepatan yang dihasilkan hanya sebesar 3 m/s yang menyebabkan anak panah meleset. Solusi yang bisa dilakukan adalah dengan mengganti busur panah atau dengan membuat kalkulasi gaya yang harus diberikan oleh atlet.</p>\r\n<p><strong>Pertanyaan: </strong>Jika opsi penyelesaian yang diambil oleh tim ofisial adalah dengan membuat kalkulasi terkait pemberian gaya oleh atlet, maka pernyataan yang tepat adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Besar gaya yang harus diberikan adalah &radic;96 N</li><li>Besar gaya yang harus diberikan adalah 9,6 N</li><li>Besar gaya yang harus diberikan adalah 0,96 N</li><li>Besar pertambahan panjang busur yang harus diciptakan adalah &radic;96 cm</li><li>Besar pertambahan panjang busur yang harus diciptakan adalah 9,6 cm</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"\\Delta x = \\frac {mv^^{2}}{k}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\frac&amp;space;{mv^^{2}}{k}\" /></li><li>Karena memenuhi persamaan <img title=\"F = \\frac {mv^^2}{k}\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;\\frac&amp;space;{mv^^2}{k}\" /></li><li>Karena memenuhi persamaan <img title=\"\\Delta x = \\sqrt {\\frac {mv^^2}{k}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{mv^^2}{k}}\" /></li><li>Karena memenuhi persamaan <img title=\"F = \\sqrt {\\frac {mv^^2}{k}}\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{mv^^2}{k}}\" /></li><li>Karena memenuhi persamaan <img title=\"\\Delta x = F \\sqrt {\\frac {mv^^2}{k}}\" src=\"https://latex.codecogs.com/gif.latex?\\Delta&amp;space;x&amp;space;=&amp;space;F&amp;space;\\sqrt&amp;space;{\\frac&amp;space;{mv^^2}{k}}\" /></li></ol>', 0.168, 4.465, -2.01, 5.56, -3.55, 0, 'D', 'C', 'CT.AB.3.2.5D'),
('S.326', 'MD.13', '<p style=\"text-align: justify;\">Saat ini, dispenser tidak lagi hanya berfungsi sebagai alat untuk memanaskan air. Lebih dari itu, saat ini dispenser juga dapat digunakan untuk membuat air dingin dan air panas dalam waktu bersamaan. Dispenser merek X misalnya, membutuhkan daya sebesar 420 watt untuk memanaskan 3,5 liter air dari suhu 27<sup>o</sup>C menjadi 92<sup>o</sup> Sedangkan untuk mendinginkan 0,7 liter air hingga suhu 15<sup>o</sup>C dispenser tersebut hanya membutuhkan Daya sebesar 80 watt. Dispenser Y menawarkan opsi yang berbeda yaitu dengan mampu memanaskan 2 liter air dari suhu 25<sup>o</sup>C menjadi 90<sup>o</sup>C dengan 190 watt dan mendinginkan 1,5 liter air menjadi suhu 10<sup>o</sup>C dengan daya sebesar 80 watt. Dispenser Z menawarkan opsi dengan mampu memanaskan 2 liter air dari suhu 25<sup>o</sup>C menjadi 92<sup>o</sup>C dengan 200 watt dan mendinginkan 1 liter air menjadi suhu 10<sup>o</sup>C dengan daya sebesar 80 watt. Dispenser U menawarkan opsi dengan mampu memanaskan 3 liter air dari suhu 25<sup>o</sup>C menjadi 90<sup>o</sup>C dengan 400 watt dan mendinginkan 1 liter air menjadi suhu 15<sup>o</sup>C dengan daya sebesar 80 watt. Dan Dispenser V menawarkan opsi dengan mampu memanaskan 2,5 liter air dari suhu 27<sup>o</sup>C menjadi 92<sup>o</sup>C dengan 300 watt dan mendinginkan 1,5 liter air menjadi suhu 15<sup>o</sup>C dengan daya sebesar 80 watt.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Jika Pak Ence ingin membeli mesin dispenser yang mampu memanaskan air dan mendinginkan air dengan waktu paling singkat, maka dispenser yang paling tepat dibeli Pak Ence adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Dispenser X</li><li>Dispenser Y</li><li>Dispenser Z</li><li>Dispenser U</li><li>Dispenser V</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/6a.png\" alt=\"\" width=\"50\" height=\"28\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/6b.png\" alt=\"\" width=\"50\" height=\"30\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/6c.png\" alt=\"\" width=\"50\" height=\"29\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/6d.png\" alt=\"\" width=\"50\" height=\"26\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/6e.png\" alt=\"\" width=\"50\" height=\"31\" /></li></ol>', 0.268, 2.822, -0.83, 2.16, -1.33, 0, 'D', 'E', 'CT.AD.3.5.6D'),
('S.327', 'MD.13', '<p style=\"text-align: justify;\">Gonta-ganti <em>sokbreker</em> belakang sering dilakukan, entah demi kenyamanan atau Fashion. Satu hal yang perlu diperhatikan adalah ukurannya.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%207D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"261\" /></p>\r\n<p style=\"text-align: justify;\">Pada dasarnya, <em>sokbreker</em> belakang ini mayoritas ada 5 ukuran, yaitu 280 mm, 300 mm, 320 mm, 350 mm dan 336 mm. Selain itu ada juga ukuran minimal, posisi ketika <em>sokbreker</em> terdorong memendek maksimal. Selisih antara ukuran panjang dan minimal, didapat jarak main atau stroke.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan ukuran sokbeker, ukuran yang tepat digunakan pada kendaraan pengangkut barang adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Sokbeker 350 mm</li><li>Sokbeker 336 mm</li><li>Sokbeker 320 mm</li><li>Sokbeker 300 mm</li><li>Sokbeker 280 mm</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"F = \\frac {YAx}{\\Delta x}\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;\\frac&amp;space;{YAx}{\\Delta&amp;space;x}\" /></li><li>Karena memenuhi persamaan <img title=\"F = - \\frac {n_{pegas}}{\\sum_{1}^^{n}k_{pegas}}\\Delta x\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;-&amp;space;\\frac&amp;space;{n_{pegas}}{\\sum_{1}^^{n}k_{pegas}}\\Delta&amp;space;x\" /></li><li>Karena memenuhi persamaan <img title=\"F= - \\left (\\frac {k_{pegas}}{n_{pegas}} \\right ) \\Delta x\" src=\"https://latex.codecogs.com/gif.latex?F=&amp;space;-&amp;space;\\left&amp;space;(\\frac&amp;space;{k_{pegas}}{n_{pegas}}&amp;space;\\right&amp;space;)&amp;space;\\Delta&amp;space;x\" /></li><li>Karena memenuhi persamaan <img title=\"F = - \\frac {k_{pegas}^^{n}}{\\sum_{1}^^{n}} \\left (\\frac {YA}{L} \\right ) \\Delta x\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;-&amp;space;\\frac&amp;space;{k_{pegas}^^{n}}{\\sum_{1}^^{n}}&amp;space;\\left&amp;space;(\\frac&amp;space;{YA}{L}&amp;space;\\right&amp;space;)&amp;space;\\Delta&amp;space;x\" /></li><li>Karena memenuhi persamaan <img title=\"F = -k_{pegas} \\left (\\frac {YA}{L} \\right ) \\Delta x\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;-k_{pegas}&amp;space;\\left&amp;space;(\\frac&amp;space;{YA}{L}&amp;space;\\right&amp;space;)&amp;space;\\Delta&amp;space;x\" /></li></ol>', 0.24, 1.449, -2.5, 2.01, 0.49, 0, 'A', 'A', 'CT.SM.3.2.7D'),
('S.328', 'MD.13', '<p>Turi bekerja di divisi perawatan pada salah satu perusahaan pertambangan minyak. Ia bertugas untuk mengontrol laju aliran minyak dari tempat pengolahan ke tempat penyimpanan. Oleh karena itu, Turi berencana membuat venturimeter yang dipasang pada setiap titik percabangan. Akan tetapi, ketinggian maksimal pipa tambahan yang bisa dibuat oleh turi adalah 1-meter sehingga ia perlu melakukan pengujian jenis cairan yang akan digunakan. Adapun hasil percobaan yang dilakukan oleh Turi adalah sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20D/13.png\" alt=\"\" width=\"400\" height=\"332\" /></p>\r\n<p>Untuk mendapatkan hasil pengukuran yang optimal, disyaratkan bahwa massa jenis zat cair tidak boleh lebih rendah dari massa jenis minyak yaitu 0,75 g/cm<sup>3</sup>.</p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan informasi yang diberikan, konsep fisika yang dapat digunakan untuk menentukan jenis cairan yang digunakan adalah &hellip;.</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Persamaan Hidrostatistika umum</li><li>Persamaan Kontinuitas</li><li>Hukum Pascal</li><li>Hukum Archimedes</li><li>Hukum Stokes</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13a.png\" alt=\"\" width=\"150\" height=\"41\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13b.png\" alt=\"\" width=\"150\" height=\"30\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13c.png\" alt=\"\" width=\"150\" height=\"30\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13d.png\" alt=\"\" width=\"150\" height=\"36\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13e.png\" alt=\"\" width=\"150\" height=\"38\" /></li></ol>', 0.269, 2.384, 0.24, 0.84, -1.08, 0, 'B', 'D', 'CT.DC.3.4.13D'),
('S.329', 'MD.13', '<p><em>Frozen food </em>atau makanan beku menjadi primadona saat ini. Makanan beku disimpan di dalam freezer dalam bentuk mentah, kemudian dipanaskan atau dimasak terlebih dahulu ketika ingin dikonsumsi. Sebagai contoh, Tahu Walik yang disimpan di dalam freezer harus direbus atau digoreng terlebih dahulu agar tekstur tahu menjadi lebih kenyal dan siap dikonsumsi.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2015D%20(FILEminimizer).jpg\" alt=\"\" width=\"383\" height=\"200\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan konsep fisika, proses perubahan makanan beku menjadi makanan jadi pada saat menggoreng Tahu Walik melibatkan....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Kalor jenis tahu, kalor lebur minyak, kalor jenis air, kalor uap air.</li><li>Kalor lebur es, kalor jenis tahu, kalor lebur minyak, kalor uap minyak.</li><li>Kalor lebur minyak, kalor jenis tahu, kalor jenis minyak, kalor uap air.</li><li>Kalor jenis es, kalor jenis tahu, kalor jenis air, kalor uap air.</li><li>Kalor lebur es, kalor jenis tahu, kalor jenis air, kalor uap air.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pada proses penggorengan Tahu Walik, proses penguapan hanya terjadi pada kandungan air</li><li>Pada proses penggorengan Tahu Walik, proses peleburan hanya terjadi pada kandungan minyak</li><li>Pada proses penggorengan Tahu Walik, proses peleburan hanya terjadi pada struktur makanan</li><li>Pada proses penggorengan Tahu Walik, proses penguapan terjadi pada minyak gorang</li><li>Pada proses penggorengan Tahu Walik, tidak terjadi proses penguapan sama sekali.</li></ol>', 0.169, 1.719, -1.25, 2.59, -1.34, 0, 'E', 'A', 'CT.MD.3.5.15D'),
('S.330', 'MD.13', '<p>Turi bekerja di divisi perawatan pada salah satu perusahaan pertambangan minyak. Ia bertugas untuk mengontrol laju aliran minyak dari tempat pengolahan ke tempat penyimpanan. Oleh karena itu, Turi berencana membuat venturimeter yang dipasang pada setiap titik percabangan. Akan tetapi, ketinggian maksimal pipa tambahan yang bisa dibuat oleh turi adalah 1-meter sehingga ia perlu melakukan pengujian jenis cairan yang akan digunakan. Adapun hasil percobaan yang dilakukan oleh Turi adalah sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20D/13.png\" alt=\"\" width=\"400\" height=\"332\" /></p>\r\n<p>Untuk mendapatkan hasil pengukuran yang optimal, disyaratkan bahwa massa jenis zat cair tidak boleh lebih rendah dari massa jenis minyak yaitu 0,75 g/cm<sup>3</sup>.</p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan informasi yang terdapat dalam grafik, pernyataan yang tepat adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Massa jenis zat cair tidak boleh lebih dari 1,25 g/cm3</li><li>Massa jenis zat cair tidak boleh kurang dari 1,25 g/cm3</li><li>Jari-jari pipa kecil tidak boleh kurang dari 1 meter</li><li>Jari-jari pipa kecil tidak boleh lebih dari 40 cm</li><li>Semakin besar masa jenis zat cair, semakin besar jari-jari pipa kecil yang diperlukan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13a.png\" alt=\"\" width=\"150\" height=\"39\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13b.png\" alt=\"\" width=\"150\" height=\"30\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13c.png\" alt=\"\" width=\"150\" height=\"30\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13d.png\" alt=\"\" width=\"150\" height=\"36\" /></li><li>Karena sesuai dengan persamaan <img src=\"/assets/source/Paket%20D/13e.png\" alt=\"\" width=\"150\" height=\"38\" /></li></ol>', 0.304, 2.094, -0.21, 1.97, -1.76, 0, 'B', 'D', 'CT.DR.3.4.16D'),
('S.331', 'MD.13', '<p style=\"text-align: justify;\">Pekerjaan sebagai pemadam kebakaran memiliki tingkat risiko kecelakaan yang tinggi terutama saat tidak terdapat area yang dapat menyuplai air. Oleh karena itu, mobil pemadam kebakaran biasanya mengisi tangki mobil dengan air sehingga dapat digunakan kapan saja. Meskipun demikian, pada beberapa kasus petugas pemadam kebakaran tetap mengalami kendala ketika tidak terdapat akses yang memadai menuju lokasi kebakaran. Alternatif yang dilakukan adalah dengan menggunakan selang yang disambung-sambung. Maka dari itu, pemadam kebakaran biasanya diberikan pelatihan mengenai pemilihan selang yang sesuai dengan medan kerja yang akan dihadapi. Diantara faktor yang menentukan ukuran selang pemadam kebakaran sebagai berikut:</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20D/19.png\" alt=\"\" width=\"500\" height=\"132\" /></p>\r\n<p><strong>Pertanyaan: </strong>Jenis selang yang tepat digunakan untuk mencapai titik sumber api yang berjarak 60 meter dari mobil pemadam kebakaran adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Jenis T1000</li><li>Jenis T2000</li><li>Jenis T3000</li><li>Jenis T4000</li><li>Jenis T5000</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin panjang selang, semakin jauh air ditembakkan</li><li>Semakin pendek selang, semakin kuat air ditembakkan</li><li>Semakin besar selang, semakin kuat air ditembakkan</li><li>Semakin kecil selang, semakin kuat air ditembakkan</li><li>Semakin besar selang, semakin jauh air ditembakkan</li></ol>', 0.269, 1.161, -1.01, 0.43, 0.58, 0, 'C', 'D', 'CT.SM.3.4.19D'),
('S.332', 'MD.13', '<p>Eksperimen lapisan pelangi merupakan eksperimen sederhana yang juga digunakan sebagai hiburan. Dalam melakukan eksperimen lapisan pelangi, bahan-bahan yang diperlukan tergolong mudah ditemui seperti gelas, air, pewarna, dan garam/gula. Pertama-tama, peserta akan membuat larutan dengan berbagai perbandingan dan warna. Selanjutnya, peserta diharuskan menyusun larutan ke dalam gelas secara berurutan seperti pada gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2019A%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"142\" /></p>\r\n<p>Meskipun terlihat mudah, membuat lapisan pelangi memerlukan perhitungan yang akurat. Jika tidak, lapisan tidak akan terbentuk dengan sempurna. Misalnya dalam memilih urutan larutan ke dalam gelas. Ketika salah memilih urutan larutan, makan lapisan pelangi yang terbentuk juga akan berantakan.</p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan teks yang disajikan, konsep fisika yang tepat digunakan untuk menyelesaikan permasalahan tersebut adalah&hellip;.</p>\r\n<p>&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Massa jenis</li><li>Tekanan Hidrostatis</li><li>Tegangan permukaan</li><li>Hukum pascal</li><li>Hukum Archimedes</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Larutan harus disusun berdasarkan massa zat terlarut</li><li>Larutan harus disusun berdasarkan volum pelarut</li><li>Larutan harus disusun berdasarkan massa pelarut</li><li>Larutan harus disusun berdasarkan volum zat terlarut</li><li>Larutan harus disusun berdasarkan massa jenis larutan</li></ol>', 0.476, -0.68, -0.99, 1.21, -0.22, 0, 'A', 'E', 'CT.DC.3.3.25D'),
('S.333', 'MD.13', '<p style=\"text-align: justify;\">Baut merupakan komponen penting dalam industri modern. Setiap elemen dalam peralatan yang dibuat biasanya dihubungkan dengan baut yang memiliki ukuran besar maupun ukuran kecil. Pada perangkat elektronik misalnya, baut didesain dengan ukuran yang relatif kecil karena dimensi peralatan juga dibuat sepadat mungkin. Selain itu, peralatan elektronik juga cenderung mudah panas sehingga memungkinkan terjadinya pemuaian pada baut yang digunakan. Akibatnya, cukup sering terjadi kerusakan yang disebabkan karena baut hilang atau longgar pada peralatan elektronik. Tanto sebagai teknisi di salah satu perusahaan elektronik berupaya mengoptimalkan baut dengan memilih bahan yang tepat. Berikut adalah hasil percobaan Tanto yang menggunakan campuran U, V, X, Y dan Z.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2026D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"306\" /></p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan hasil percobaan yang dilakukan Tanto, kesimpulan yang dapat diperoleh adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Campuran U mampu menyerap energi panas paling sedikit.</li><li>Campuran V menghasilkan pertambahan panjang paling besar</li><li>Campuran X menghasilkan pertambahan panjang paling kecil</li><li>Campuran Y mampu menyerap energi panas paling besar.</li><li>Campuran Z memiliki koefisien muai panjang paling besar</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar kemiringan grafik, semakin kecil pertambahan panjang logam</li><li>Semakin besar kemiringan grafik, semakin besar koefisien muai panjang</li><li>Semakin besar kemiringan grafik, semakin besar energi panas yang diserap</li><li>Semakin besar kemiringan grafik semakin besar pertambahan temperatur yang terjadi.</li><li>Pertambahan panjang berbanding terbalik dengan energi yang diserap</li></ol>', 0.342, 1.198, -1.1, 1.29, -0.19, 0, 'E', 'B', 'CT.AB.3.5.26D'),
('S.334', 'MD.13', '<p style=\"text-align: justify;\">Suatu kompor listrik merek X memiliki daya sebesar 1200 watt. Kompor tersebut memiliki efisiensi 95% untuk mengubah energi listrik menjadi panas sehingga bisa memanaskan air dingin (10<sup>o</sup>C) menjadi mendidih (100<sup>o</sup>C) dalam waktu 7 menit saja. Akibatnya, Sherly yang baru pertama kali memasak menggunakan kompor listrik tersebut mendapati kompor yang kosong karena ia meninggalkan kompor selama 15 menit untuk mandi.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan narasi yang disajikan, permasalahan yang harus diselesaikan oleh Sherly adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Berapakah waktu mandi minimal yang dibutuhkan Sherly?</li><li>Berapakah kenaikan suhu awal air yang diperlukan Sherly?</li><li>Berapakah daya kompor yang diperlukan Sherly?</li><li>Berapakah volum air yang diperlukan oleh Sherly?</li><li>Berapakah massa jenis air yang diperlukan oleh Sherly?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/27a.png\" alt=\"\" width=\"100\" height=\"21\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/27b.png\" alt=\"\" width=\"100\" height=\"26\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/27c.png\" alt=\"\" width=\"100\" height=\"23\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/27d.png\" alt=\"\" width=\"100\" height=\"26\" /></li><li>Karena memenuhi persamaan <img src=\"/assets/source/Paket%20D/27e.png\" alt=\"\" width=\"100\" height=\"23\" /></li></ol>', 0.322, 2.087, -0.83, 2.64, -1.81, 0, 'D', 'E', 'CT.RP.3.5.27D'),
('S.335', 'MD.13', '<p style=\"text-align: justify;\">Pipa saluran minyak didesain untuk bekerja dalam tekanan tinggi. Tujuannya adalah untuk menghindari kebocoran yang terjadi selama pengaliran minyak. Oleh karena itu sangat beresiko untuk membuka pipa pada saat minyak masih mengalir. Untuk mengetahui laju aliran minyak, diperlukan pemasangan peralatan tertentu yang menggunakan prinsip venturimeter seperti pada Gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2029D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"480\" /></p>\r\n<p style=\"text-align: justify;\">Venturimeter menggunakan dua cairan berbeda dengan <em>&rho;</em><sub>1 &shy;</sub>merupakan massa jenis fluida yang mengalir dan <em>&rho;</em><sub>1 </sub>merupakan fluida yang berada dalam tabung U. <em>A<sub>1 </sub></em>merupakan penampang besar dan <em>A<sub>2 </sub></em>merupakan penampang kecil serta <em>h</em> adalah perbedaan ketinggian cairan pada tabung U.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan informasi yang terdapat dalam Gambar, solusi untuk menentukan kecepatan fluida adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li><img src=\"/assets/source/Paket%20D/29a.png\" alt=\"\" width=\"100\" height=\"54\" /></li><li><img src=\"/assets/source/Paket%20D/29b.png\" alt=\"\" width=\"100\" height=\"62\" /></li><li><img src=\"/assets/source/Paket%20D/29c.png\" alt=\"\" width=\"100\" height=\"63\" /></li><li><img src=\"/assets/source/Paket%20D/29d.png\" alt=\"\" width=\"100\" height=\"59\" /></li><li><img src=\"/assets/source/Paket%20D/29e.png\" alt=\"\" width=\"100\" height=\"62\" /></li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar ukuran A1 semakin besar kecepatan aliran minyak</li><li>Semakin besar ukuran A2 semakin besar kecepatan aliran minyak</li><li>Semakin besar nilai &rho;1 semakin besar kecepatan aliran minyak</li><li>Semakin besar nilai &rho;2 semakin besar kecepatan aliran minyak</li><li>Semakin besar nilai <em>h </em>semakin besar kecepatan aliran minyak</li></ol>', 0.178, 4.232, -0.32, -0.33, 0.65, 0, 'E', 'E', 'CT.AD.3.4.29D'),
('S.336', 'MD.14', '<p style=\"text-align: justify;\">Permasalahan yang sering ditemukan bagi pengguna layanan sumber air dari PDAM (Perusahaan Daerah Air dan Minum) adalah debit air yang menjadi kecil pada saat jam sibuk (pukul 06.00 hingga pukul 08.00, dan 18.00 hingga 20.00). Akibatnya, kecepatan aliran air menjadi pelan dan volume air menjadi sedikit. Hal ini berlawanan dengan tingkat kebutuhan air yang mana pada jam sibuk, setiap rumah akan memerlukan air dengan volume lebih besar dibanding biasanya.</p>\r\n<p><strong>Pertanyaan: </strong>Solusi yang dapat diambil untuk mengatasi permasalahan tersebut adalah&hellip;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Menggunakan mesin pompa air untuk menambah tekanan pada sumber air</li><li>Menggunakan mesin pompa air untuk menambah kecepatan aliran air</li><li>Menggunakan pipa dengan ukuran yang lebih besar sehingga menambah cadangan air pasif.</li><li>Memasang dua sumber PDAM bersamaan sehingga mendapatkan tambahan sumber air.</li><li>Menggunakan sistem tangki atap dan mengisinya diluar jam sibuk</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Penambahan tekanan akan menyebabkan debit air menjadi lebih besar</li><li>Ukuran pipa mempengaruhi laju aliran air pada pipa</li><li>Tambahan sumber air akan meningkatkan volume air yang dialirkan</li><li>Semakin tinggi posisi sumber air, semakin besar kecepatan aliran air yang dialirkan</li><li>Semakin cepat aliran air maka volume air yang diperoleh mejadi semakin besar</li></ol>', 0.139, 3.784, -3.56, 2.83, 0.74, 0, 'E', 'D', '*LS.SK.3.4.30'),
('S.337', 'MD.14', '<p style=\"text-align: justify;\">Ban kendaraan biasanya terdiri dari dua lapisan yaitu ban luar dan ban dalam. Meskipun kedua jenis ban ini sama-sama terbuat dari karet, ban luar lebih kaku dibandingkan dengan ban dalam. Ketika dimasukkan udara, maka ban akan mengembang hingga memenuhi ruang yang disediakan.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%208D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"200\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pernyataan yang benar terkait pemakaian ban luar dan ban dalam adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pada ruang terbuka, diameter ban luar lebih besar dibandingkan ban dalam.</li><li>Pada ruang terbuka, diameter ban luar lebih kecil dibandingkan ban dalam.</li><li>Pada ruang tertutup, pertambahan volum ban dalam lebih besar dibandingkan ban luar.</li><li>Pada ruang tertutup, pertambahan volum ban dalam lebih kecil dibandingkan ban luar.</li><li>Ban dalam dan ban luar memiliki diameter dan pertambahan volum yang sama.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Konstanta pegas ban dalam lebih besar dibandingkan konstanta pegas ban luar</li><li>Konstanta pegas ban dalam lebih kecil dibandingkan konstanta pegas ban luar</li><li>Konstanta pegas ban dalam sama dibandingkan konstanta pegas ban luar</li><li>Koefisien muai volum ban dalam lebih besar dibandingkan ban luar</li><li>Koefisien muai volum ban dalam lebih kecil dibandingkan ban luar</li></ol>', 0.195, 3.195, -0.61, 5.5, -4.89, 0, 'C', 'B', 'LS.KT.3.2.8D'),
('S.338', 'MD.14', '<p style=\"text-align: justify;\">Tarian balet lebih dari sekadar kesenian yang indah, balet memiliki manfaat yang luar biasa bagi tubuh, mulai dari memperbaiki penampilan hingga menjaga kesehatan. Selain itu, balet bisa dilakukan oleh siapa saja baik laki-laki maupun perempuan dari segala usia. Sehingga, sangat pas dijadikan olahraga rutin.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%209D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"250\" /></p>\r\n<p style=\"text-align: justify;\">Fisika dalam tari balet terdapat pada beberapa gerakan tari balet tersebut, teori fisika tentang gaya sentrifugal salah satunya digunakan pada saat penari balet menari berputar dengan tumpuan kaki. Pada bulan April 1999 diadakan pertemuan fisika terbesar abad 20 bertempat di World Conggress Building, Atlanta, AS. Dalam pertemuan itu digelar ratusan tema-tema seminar seperti mekanika klasik, laser, fisika nuklir hingga fisika abad 21. Tema seminar yang menjadi pusat perhatian banyak pengunjung adalah Physics of Dance. Dalam seminar ini membahas penerapan hukum fisika pada gerakan balet yang menghasilkan sesuatu yang berguna, mengejutkan, dan mendorong orang lebih menghargai balet. Sebagian besar gerakan tarian balet menerapkan hukum kelembaman. Gerakan-gerakan ini antara lain diam seimbang, bergerak, melompat, dan berputar.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pada saat melakukan gerakan berputar, terdapat dua variasi posisi yang dilakukan penari balet yaitu membuka tangan dan mengatupkan tangan. Tujuan dari membuka dan mengatupkan tangan pada saat penari balet berputar adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengatur gaya sentrifugal tubuh</li><li>Mengatur kecepatan kecepatan sudut</li><li>Mengatur pusat massa tubuh</li><li>Mengatur momen gaya tubuh</li><li>Mengatur momen inersia tubuh</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"\\tau = \\overrightarrow{F} \\times \\overrightarrow{r}\" src=\"https://latex.codecogs.com/gif.latex?\\tau&amp;space;=&amp;space;\\overrightarrow{F}&amp;space;\\times&amp;space;\\overrightarrow{r}\" /></li><li>Karena memenuhi persamaan <img title=\"I=mr^^2\" src=\"https://latex.codecogs.com/gif.latex?I=mr^^2\" /></li><li>Karena memenuhi persamaan <img title=\"F=mg\" src=\"https://latex.codecogs.com/gif.latex?F=mg\" /></li><li>Karena memenuhi persamaan <img title=\"x = m_{1}x_{1}+m_{2}x_{2}+....+m_{n}x_{n}\" src=\"https://latex.codecogs.com/gif.latex?x&amp;space;=&amp;space;m_{1}x_{1}+m_{2}x_{2}+....+m_{n}x_{n}\" /></li><li>Karena memenuhi persamaan <img title=\"P_{total}=\\frac {mg}{r^^2}\" src=\"https://latex.codecogs.com/gif.latex?P_{total}=\\frac&amp;space;{mg}{r^^2}\" /></li></ol>', 0.395, -0.87, -1.17, 0.55, 0.62, 0, 'E', 'B', 'LS.KP.3.1.9D'),
('S.339', 'MD.14', '<p>Jembatan gantung merupakan salah satu alternatif perjalanan ketika tidak jembatan permanen tidak memungkinkan untuk dibangun. Jembatan gantung biasanya memiliki ukuran yang lebih kecil dan beban maksimal cenderung lebih kecil dibandingkan dengan beban pada jembatan permanen. Meskipun demikian, jembatan gantung memiliki nilai estetika yang tinggi sehingga banyak pengunjung yang berburu foto di jembatan gantung. Padahal secara teknis, jembatan gantung hanya ditopang oleh tali yang diikatkan di ujung-ujung jembatan.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2010D-%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"209\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Sebagai seorang fisikawan, sikap yang tepat untuk dilakukan pada saat melewati jembatan gantung adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Berpegangan pada tali jembatan sehingga jembatan tidak bergoyang.</li><li>Melewati jembatan gantung secara bergantian karena jalur yang relatif sempit.</li><li>Tidak berdiam diri di tengah jembatan karena merupakan pusat massa sistem.</li><li>Menggunakan sabuk pengaman pada saat melewati jembatan gantung.</li><li>Mengatur jarak pada saat melewati jembatan sehingga pusat massa dapat terdistribusi.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pusat massa sistem bersifat konstan dan berada di bagian tengah jembatan</li><li>Pusat massa sistem bersifat konstan dan berada di ujung-ujung jembatan</li><li>Pusat massa sistem bersifat dinamis dan cenderung berada di bagian tengah jembatan</li><li>Tali pada jembatan mendistribusikan massa ke seluruh sistem</li><li>Tali pada jembatan mendistribusikan gaya berat ke seluruh sistem</li></ol>', 0.244, 1.804, -0.72, 0.97, -0.25, 0, 'C', 'C', 'LS.SK.3.1.10D'),
('S.340', 'MD.14', '<p style=\"text-align: justify;\">Balon merupakan salah satu benda elastis yang akan mengalami penambahan ukuran ketika ditiup. Akan tetapi, balon lama kelamaan akan meledak jika terus ditiup.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2011D%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"200\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan hukum fisika, pertambahan ukuran balon disebabkan oleh&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pertambahan massa balon</li><li>Pertambahan massa gas di dalam balon</li><li>Pertambahan tekana udara di luar balon</li><li>Pertambahan tekanan udara di dalam balon</li><li>Pengurangan tekanan udara di dalam balon</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi kondisi hukum Hooke</li><li>Karena memenuhi kondisi modulus Young</li><li>Karena memenuhi kondisi modulus Geser</li><li>Karena memenuhi kondisi modulus Bulk</li><li>Karena memenuhi kondisi modulus kompresi</li></ol>', 0.395, -0.84, -3.3, -4.7, -1.4, 0, 'D', 'D', 'LS.PG.3.2.11D'),
('S.341', 'MD.14', '<p style=\"text-align: justify;\"><em>Sphygmomanometer</em> analog atau tensimeter analog merupakan peralatan yang digunakan untuk mengukur tekanan darah seseorang. Pada versi analog, dokter atau petugas akan memompa udara ke dalam manset yang disematkan pada lengan pasien. Selanjutnya, dokter atau petugas akan mendengarkan denyut nadi menggunakan Stetoskop.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2012D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"248\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Tujuan dari dokter untuk memompa udara ke dalam manset adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengatur laju aliran darah pada saat melewati manset</li><li>Mengatur tekanan udara di dalam manset</li><li>Memberikan tekanan pada pembuluh darah</li><li>Mempercepat detak nadi sehingga bisa di dengar di stetoskop</li><li>Memperlambat detak nadi sehingga bisa di dengar di stetoskop</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Laju aliran dalam manset darah menggerakkan jarum pada ujung tensimeter.</li><li>Tekanan udara dalam manset menggerakkan jarum pada ujung tensimeter.</li><li>Pada saat udara dilepaskan, ujung tensimeter akan mencatat detak jantung.</li><li>Pada saat udara dipompa, ujung tensimeter akan mencatat detak jantung.</li><li>Pada saat udara dipompa, pembuluh nadi akan mengecil dan terdeteksi di stetoskop.</li></ol>', 0.206, 1.691, -3.02, 4.35, -1.33, 0, 'C', 'C', 'LS.KP.3.3.12D'),
('S.342', 'MD.14', '<p style=\"text-align: justify;\">Pada saat bermain di kolam berenang, Tanto memasukkan bola ke dalam air dan menahannya. Sesaat kemudian, bola dilepaskan dan terlempar seperti sebuah meriam ke udara seperti pada Gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2020B%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"192\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pernyataan yang tepat mengenai lompatan bola dari dalam air adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin dalam bola ditekan ke dalam air, semakin mudah bola tersebut untuk dilontarkan</li><li>Semakin dalam bola ditekan ke dalam air, semakin sulit bola tersebut untuk dilontarkan</li><li>Semakin dalam bola ditekan ke dalam air, semakin rendah bola dilontarkan</li><li>Semakin dalam bola ditekan ke dalam air, semakin tinggi bola dilontarkan</li><li>Semakin besar ukuran bola, semakin sulit bola untuk dilontarkan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin dalam bola, semakin besar tekanan hidrostatis yang diterima bola.</li><li>Semakin dalam bola, semakin kecil tekanan hidrostatis yang diterima bola.</li><li>Semakin dalam bola, semakin besar gaya apung yang diterima bola.</li><li>Semakin dalam bola, semakin kecil gaya apung yang diterima bola.</li><li>Semakin besar ukuran bola, semakin besar tekanan hidrostatis yang diterima</li></ol>', 0.374, 1.339, -0.88, 2.36, -1.49, 0, 'D', 'C', 'LS.KT.3.3.20D'),
('S.343', 'MD.14', '<p style=\"text-align: justify;\">Mobil balap F1 memiliki pergerakan yang sangat cepat. Pada jalan lurus, kecepatan mobil F1 mencapai 325,6 km/j dengan kecepatan rata-rata saat berbelok adalah 80-110 km/j. Kecepatan ini relatif hampir sama dengan kecepatan MotoGP dengan efisiensi pengereman yang lebih baik. Berbeda dengan MotoGP yang pengaturan kecepatan dapat dikondisikan dengan posisi pembalap, pada mobil F1 optimalisasi fungsi aerodinamik dilakukan pada desain mobil yang lancip ke depan seperti pada Gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2021D%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"169\" /></p>\r\n<p style=\"text-align: justify;\">Fungsi aerodinamik dikondisikan dengan memanfaatkan banyak lubang yang ditemukan pada rangka mobil F1. Lubang-lubang tersebut mengalirkan udara ke bagian bawah dan samping dari mobil.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan bacaan, fungsi dari lubang yang dibuat pada rangka mobil F1 adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Meningkatkan kecepatan aliran udara pada bagian bawah mobil</li><li>Meningkatkan kecepatan aliran udara pada bagian atas mobil</li><li>Meningkatkan kecepatan aliran udara pada bagian samping mobil</li><li>Mengurangi kecepatan aliran udara pada bagian bawah mobil</li><li>Mengurangi kecepatan aliran udara pada bagian belakang mobil</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin cepat aliran fluida pada bagian bawah, semakin besar gaya angkat yang diterima</li><li>Semakin cepat aliran fluida pada bagian bawah, semakin kecil gaya angkat yang diterima</li><li>Semakin cepat aliran fluida pada bagian bawah, semakin besar gaya tekan yang diterima</li><li>Semakin cepat aliran fluida pada bagian bawah, semakin kecil gaya tekan yang diterima</li><li>Semakin cepat aliran fluida pada bagian samping mobil, semakin besar turbulensi yang terjadi</li></ol>', 0.28, 1.83, -1.11, 3.09, -1.98, 0, 'A', 'B', 'LS.KP.3.4.21D'),
('S.344', 'MD.14', '<p style=\"text-align: justify;\">Dewasa ini, kita sering menemukan penggunaan rem cakram pada kendaraan bermotor dibandingkan dengan rem tromol. Pemilihan rem cakram didasarkan pada banyak keuntungan. Kelebihan dari rem cakram (<em>disk brake</em>) adalah daya pengereman dapat mencapai 100%, karena seluruh <em>pad</em> bergesekan langsung dengan cakram sehingga pengereman dapat maksimal. Keunggulan yang kedua adalah pendinginan rem lebih baik karena menganut sistem pengereman terbuka dan untuk memperbaiki pendinginan kadang kala cakram di buat berongga atau berlubang.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2022D%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"141\" /></p>\r\n<p style=\"text-align: justify;\">Pengoperasian dari rem cakram juga sangat berbeda dengan rem tromol. Pada rem tromol, kawat digunakan untuk menarik piringan sehingga terjadi gesekan antara kampas rem dengan roda. Sedangkan pada rem cakram, piringan diapit oleh cakram yang dihubungkan dengan selang yang diisi oleh minyak tertentu.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan bacaan yang disajikan, sikap rasa ingin tahu yang berkaitan dengan pengoperasian rem cakram diwakilkan oleh pertanyaan....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Rudi mengganti minyak rem dengan oli</li><li>Tara mengolesi piringan rem dengan minyak rem</li><li>Ahmad mengolesi piringan rem dengan oli</li><li>Jodi memvariasikan kekentalan minyak rem</li><li>Tedi memvariasikan ketebalan piringan rem</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengganti jenis minyak dapat mempengaruhi gaya yang diterima piringan</li><li>Penggunaan oli sebagai minyak rem dapat meningkatkan gaya yang diberikan oleh piringan</li><li>Semakin tipis piringan, semakin mudah kendaraan dihentikan</li><li>Mengolesi piringan dengan oli dapat mengurangi gesekan sehingga tidak mudah panas</li><li>Mengolesi piringan dengan minyak rem dapat meningkatkan gesekan sehingga kendaraan lebih cepat berhenti</li></ol>', 0.286, 2.475, -1.03, 1.46, -0.43, 0, 'D', 'A', 'LS.SK.3.3.22D'),
('S.345', 'MD.14', '<p style=\"text-align: justify;\">Perhatikan Gambar berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2023%20(FILEminimizer).png\" alt=\"\" width=\"400\" height=\"271\" /></p>\r\n<p style=\"text-align: justify;\">Salah satu ekstrem yang memiliki keterkaitan dengan ilmu fisika adalah olahraga <em>Highline</em>. Dalam olahraga ini, atlet akan diminta untuk berjalan di atas sebuah tali yang telah dikaitkan dari ujung ke ujung. Biasanya, ketinggian tali memberi tantangan tersendiri sehingga memacu adrenalin. Selain dikategorikan sebagai olahraga ekstrem, <em>Highline</em> juga digunakan sebagai seni pertunjukan. Pada seni pertunjukan ataupun dalam olahraga, para atlet dan <em>Performance</em> biasanya membentangkan tangan dan bahkan memegang batang kayu atau batang besi secara horizontal.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Konsep fisika yang berkaitan dengan penggunaan batang kayu atau batang besi adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Momen Gaya</li><li>Momen Inersia</li><li>Momen Kopel</li><li>Momentum sudut</li><li>Tuas atau pengungkit</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Batang horizontal bertujuan untuk menambah momen gaya pada sistem dengan atlet atau performarnce sebagai pusat. Sehingga sistem menjadi lebih setimbang dan atlet atau performance menekan tali lebih kuat.</li><li>Batang horizontal bertujuan untuk menambah momen inersia pada sistem dengan atlet atau performarnce sebagai pusat. Sehingga sistem menjadi lebih setimbang dan atlet atau performance menekan tali lebih kuat.</li><li>Batang horizontal bertujuan untuk menambah momen kopel pada sistem dengan atlet atau performarnce sebagai pusat. Sehingga sistem menjadi lebih setimbang dan atlet atau performance menekan tali lebih kuat.</li><li>Batang horizontal bertujuan untuk menambah momentum sudur pada sistem dengan atlet atau performarnce sebagai pusat. Sehingga sistem menjadi lebih setimbang dan atlet atau performance menekan tali lebih kuat.</li><li>Batang horizontal bertujuan untuk menambah impuls pada sistem dengan atlet atau performarnce sebagai pusat. Sehingga sistem menjadi lebih setimbang dan atlet atau performance menekan tali lebih kuat.</li></ol>', 0.203, 1.718, -5.45, 2.14, 3.13, 0, 'A', 'A', 'LS.PG.3.1.23D'),
('S.346', 'MD.14', '<p>Bandul Lot biasa digunakan oleh tukang untuk menentukan kemiringan dinding, pintu, atau jendela. Bandul lot memiliki bentuk seperti kerucut terbalik yang diikatkan pada tali ringan seperti pada gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%208A%20(FILEminimizer).jpg\" alt=\"\" width=\"200\" height=\"309\" /></p>\r\n<p><strong>Pertanyaan: </strong>&nbsp;Pernyataan yang <strong>tidak tepat</strong> mengenai penggunaan Bandul Lot dalam menentukan kemiringan benda adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Perbedaan jarak A dan B mengindikasikan kemiringan benda</li><li>Pemasangan bandul dengan posisi terbalik bertujuan untuk menekan pusat massa</li><li>Pemasangan bandul dengan posisi terbalik bertujuan untuk mengondisikan momen inersia bandul</li><li>Bentuk bandul seperti kerucut bertujuan untuk memudahkan pengukuran</li><li>Panjang tali tidak berpengaruh dalam penentuan kemiringan benda.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pada sistem kesetimbangan bandul lot, semua gaya bekerja dalam satu garis lurus.</li><li>Pada sistem kesetimbangan bandul lot, kemiringan disebabkan oleh perbedaan pusat massa dari bandul.</li><li>Pada sistem kesetimbangan bandul lot, gaya berat bekerja tepat pada ujung bandul.</li><li>Pada sistem kesetimbangan bandul lot, momen gaya yang bekerja tepat berada pada pusat massa bandul.</li><li>Pada sistem kesetimbangan bandul lot, momen gaya yang bekerja tepat berada pada pusat massa sistem.</li></ol>', 0.181, 3.543, -0.65, 5.48, -4.83, 0, 'C', 'A', 'LS.KT.3.1.8A'),
('S.347', 'MD.14', '<p style=\"text-align: justify;\">Anda mungkin sudah sering melihat atraksi sulap baik profesional ataupun jalanan yang membakar uang. Namun, uang yang dibakar tidak mengalami kerusakan sedikit pun. Kunci dari atraksi ini adalah uang dicelupkan terlebih dahulu ke dalam air dan kemudian baru dicelupkan ke dalam bensin/spiritus lalu dibakar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%209A-%20(FILEminimizer).jpg\" alt=\"\" width=\"500\" height=\"213\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Penjelasan fisika yang tepat berkaitan dengan atraksi pembakaran uang tersebut adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Uang tidak terbakar karena titik swasulut kertas lebih tinggi dibandingkan air</li><li>Uang tidak terbakar karena titik swasulut kertas lebih tinggi dibandingkan bensin/spiritus</li><li>Uang tidak terbakar karena titik swasulut air lebih tinggi dibandingkan air</li><li>Uang tidak terbakar karena titik uap air lebih rendah dibandingkan titik uap bensin/spiritus</li><li>Uang tidak terbakar karena titik uap air lebih tinggi dibandingkan titik uap bensin/spiritus</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Air akan menguap lebih dulu dibandingkan Bensin/spiritus pada saat pembakaran, sehingga api tidak menyentuh kertas uang.</li><li>Bensin/spiritus akan menguap lebih dulu dibandingkan air pada saat pembakaran, sehingga api tidak menyentuh kertas uang.</li><li>Bensin/spiritus akan menguap bersamaan dengan air pada saat pembakaran, sehingga api tidak menyentuh kertas uang.</li><li>Air tidak menguap pada saat pembakaran karena suhu pembakaran tidak mencapai titik didih air.</li><li>Air akan menguap sesaat setelah pembakaran selesai sebagai bentuk reaksi berantai.</li></ol>', 0.354, 1.175, 0.14, 0.44, -0.58, 0, 'E', 'B', 'LS.KP.3.5.9A');
INSERT INTO `soal` (`id_soal`, `id_mode`, `soal`, `jawaban`, `alasan`, `a`, `b`, `bi1`, `bi2`, `bi3`, `c`, `kunci_jawaban`, `kunci_alasan`, `kode`) VALUES
('S.348', 'MD.14', '<p style=\"text-align: justify;\">Jam tangan karet saat ini menjadi salah satu opsi dari sekian banyak pilihan jam tangan. Faktor kenyamanan biasanya menjadi alasan utama yang digunakan pada saat memilih jam tangan karet. Secara fisis, jam tangan karet mengikuti karakteristik hukum Hooke karena terbuat dari bahan yang bersifat elastis.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2010A%20(FILEminimizer).jpg\" alt=\"\" width=\"200\" height=\"266\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan karakteristik fisis dari jam karet, sikap yang tepat dilakukan pada saat menggunakan jam karet adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Memasang jam karet pada lubang yang lebih kecil dari lingkar tangan karena bahan karet dapat menyesuaikan ukuran.</li><li>Memasang jam karet pada lubang yang lebih besar dari lingkar tangan karena bahan karet dapat menyesuaikan ukuran.</li><li>Memasang jam karet pada lubang yang lebih besar dari lingkar tangan karena merupakan batas awal berlaku hukum Hooke.</li><li>Memasang jam karet pada lubang yang lebih besar dari lingkar tangan karena merupakan batas akhir berlaku hukum Hooke.</li><li>Memasang jam karet pada lubang yang lebih besar dari lingkar tangan karena bahan karet bersifat kedap udara.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Ukuran tangan yang lebih besar dari diameter karet jam menerima gaya pegas yang lebih besar.</li><li>Ukuran tangan yang lebih besar dari diameter karet jam menerima gaya pegas yang lebih kecil.</li><li>Ukuran tangan yang lebih besar dari diameter karet jam menerima gaya tekan yang lebih besar.</li><li>Ukuran tangan yang lebih besar dari diameter karet jam memberi gaya pegas yang lebih kecil.</li><li>Ukuran tangan yang lebih besar menyebabkan pegas tidak bisa kembali pada bentuk semula karena berada pada daerah deformasi elastis.</li></ol>', 0.157, 3.087, -3.3, 1.62, 1.68, 0, 'C', 'C', 'LS.SK.3.2.10A'),
('S.349', 'MD.14', '<p style=\"text-align: justify;\">Perhatikan Gambar Berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2011A.jpg\" alt=\"\" width=\"400\" height=\"224\" /></p>\r\n<p style=\"text-align: justify;\">Pada tahap nomor 2, terdapat tahapan menambahkan garam kedalam balok es.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Tujuan dari penambahan garam pada balok es tersebut adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Meningkatkan kapasitas panas sistem</li><li>Menurunkan kapasitas panas sistem</li><li>Meningkatkan kalor jenis sistem</li><li>Menurunkan kalor jenis sistem</li><li>Menurunkan titik beku sistem</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga temperature sistem menjadi lebih tinggi.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga temperature sistem menjadi lebih rendah.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga menyebabkan kalor yang diserap menjadi lebih banyak.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga menyebabkan kalor yang diserap menjadi lebih sedikit.</li><li>Penambahan larutan garam merupakan penerapan dari sifat kolagatif sehingga menyebabkan titik beku sistem menjadi lebih tinggi</li></ol>', 0.367, 1.53, -0.23, 2.2, -1.97, 0, 'E', 'C', 'LS.PG.3.5.11A'),
('S.350', 'MD.14', '<p style=\"text-align: justify;\">Lemak pada makanan memiliki sifat yang identik dengan minyak dan sering menjadi masalah tersendiri. Sebagai contoh, lemak pada makanan sup akan mengganggu mulut untuk menikmati makanan. Bahkan setelah selesai makan, lemak yang menempel pada rongga mulut tetap akan menimbulkan ketidaknyamanan. Salah satu cara untuk mengurangi jumlah lemak pada sup dalam makanan adalah dengan memasukkan bongkahan es ke dalam sup yang masih panas. Hal ini akan menyebabkan lemak menempel pada bongkahan es. Cara lainnya adalah dengan memasukkan sup yang masih panas ke dalam lemari pendingin. Dalam beberapa saat, lemak sup akan mengapung di bagian atas.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2012A%20(FILEminimizer).jpg\" alt=\"\" width=\"360\" height=\"240\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Prosedur memisahkan lemak dari sup dengan memasukkan ke dalam lemari pendingin pada saat panas bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Menambah kekentalan kuah sup</li><li>Menambah kekentalan lemak sup</li><li>Menggumpalkan bumbu sup</li><li>Menggumpalkan kuah sup</li><li>Menggumpalkan lemak sup</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Lemak lebih sulit menggumpal dibandingkan dengan kuah sup</li><li>Lemak lebih mudah menggumpal dibandingkan dengan kuah sup</li><li>Lemak lebih sulit menggumpal dibandingkan dengan bumbu sup</li><li>Lemak lebih mudah menggumpal dibandingkan dengan bumbu sup</li><li>Titik beku lemak lebih rendah dibandingkan dengan kuah dan bumbu sup.</li></ol>', 0.553, -0.27, -1.01, 1.65, -0.64, 0, 'E', 'B', 'LS.KP.3.3.12A'),
('S.351', 'MD.14', '<p style=\"text-align: justify;\">Dalam fisika, sistem hidrolik adalah bentuk perubahan daya yang dilakukan dengan media fluida cair sehingga memperoleh daya yang lebih besar dari daya semula yang dikeluarkan. Tekanan pada fluida penghantar ini dinaikkan dengan menggunakan pompa pembangkit tekanan. Kemudian, tekanan ini diteruskan menuju silinder kerja dengan melewati pipa-pipa saluran dan katup seperti pada pompa sepeda.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2020C%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"262\" /></p>\r\n<p style=\"text-align: justify;\">Dari sini dapat diketahui bahwa cara kerja pompa hidrolik dalam sebuah sistem hidrolik memang krusial. Meski begitu, perlu dipahami bahwa pompa hidrolik tidak menghasilkan tekanan, namun menghasilkan sebuah aliran energi potensial dari fluida. Tanpa adanya aliran ini, maka energi mekanis tidak akan timbul dari sistem hidrolik.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pernyataan yang tepat mengenai penggunaan pompa hidrolik untuk mengisi udara dalam ban sepeda adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Volum udara yang dimasukkan ke dalam ban berbanding lurus dengan volum ruang pompa</li><li>Volum udara yang dimasukkan ke dalam ban berbanding terbalik dengan volum ruang pompa</li><li>Volum udara yang dimasukkan ke dalam ban berbanding lurus dengan gaya tekan yang diberikan</li><li>Volum udara yang dimasukkan ke dalam ban berbanding terbalik dengan gaya tekan yang diberikan</li><li>Volum udara yang dimasukkan ke dalam ban berbanding lurus dengan tekanan dalam ban</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Ketika ruangan mengecil, fluida secara otomatis masuk dalam ruang pompa</li><li>Ketika ruangan membesar, fluida secara otomatis masuk dalam ruang pompa</li><li>Ketika tekanan pompa mengecil, fluida secara otomatis masuk dalam ruang ban</li><li>Ketika tekanan pompa mengecil, fluida secara otomatis keluar dari ruang ban</li><li>Ketika tekanan pompa membesar, fluida secara otomatis keluar dari ruang ban</li></ol>', 0.216, 2.542, -0.73, 1.72, -0.99, 0, 'A', 'B', 'LS.KT.3.4.20A'),
('S.352', 'MD.14', '<p style=\"text-align: justify;\"><em>Resistance Band</em> adalah alat olahraga terbuat dari karet yang berguna untuk menambahkan beban pada gerakan <em>workout</em> yang tengah Anda lakukan. Ukurannya yang kecil dan mudah dibawa menjadikan alat ini cocok untuk digunakan di rumah ataupun dibawa saat <em>traveling</em>. Layaknya <em>dumbell</em> (barbel), alat ini juga memiliki beragam ukuran dengan varian daya renggang yang berbeda-beda seperti pada tabel berikut.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Paket%20A/21.png\" alt=\"\" width=\"388\" height=\"117\" /></p>\r\n<p>Penggunaan <em>resistance band </em>juga mempertimbangkan bentuk latihan dan kemampuan pengguna. Semakin terlatih pengguna, maka semakin tinggi level <em>resistance band </em>yang diperbolehkan. Selain itu, bagi pengguna yang pelatihan lebih lanjut, <em>resistance band </em>dapat dirangkai paralel seperti pada Gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2021A%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"400\" /></p>\r\n<p><strong>Pertanyaan: </strong>Tujuan dari perangkaian <em>resistance band </em>secara seperti pada Gambar adalah....</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengurangi beban dari resistance band</li><li>Meningkatkan kerja dari resistance band</li><li>Menambahkan tingkat kesulitan resistance band</li><li>Menambah ketebalan dari resistance band</li><li>Menambah kekakuan dari resistance band</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Pegas yang dirangkai secara paralel akan mengurangi tingkat kelenturannya</li><li>Pegas yang dirangkai secara paralel akan meningkatkan tingkat kelenturannya</li><li>Pegas yang dirangkai secara seri akan mengurangi tingkat kelenturannya</li><li>Pegas yang dirangkai secara seri akan meningkatkan tingkat kelenturannya</li><li>Pegas yang dirangkai secara paralel akan mengurangi konstanta pegasnya</li></ol>', 0.509, 1.201, -1.03, 0.86, 0.17, 0, 'E', 'A', 'LS.KP.3.2.21A'),
('S.353', 'MD.14', '<p style=\"text-align: justify;\">Alat pemanas air atau <em>water heater</em> yang berada di kamar mandi biasanya akan memanaskan air secara otomatis dan menjaga pada suhu yang ditetapkan. Meskipun demikian, suhu air yang dihasilkan cenderung sangat tinggi sehingga untuk menggunakan air panas, air akan dicampur ke dalam bak terlebih dahulu. Meskipun demikian, beberapa kejadian menemukan bahwa kulit pengguna tetap mengalami gangguan karena dinilai campuran air yang dihasilkan tidak optimal.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan:</strong> Sikap yang tepat dilakuka nuntuk menghasilkan campuran air panas dan air dingin yang optimal pada saat menggunakan water heater adalah&hellip;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Memasukkan air dingin terlebih dahulu kemudian baru air panas dengan jumlah volum yang sama</li><li>Memasukkan air panas terlebih dahulu kemudian baru air dingin dengan jumlah volum yang sama</li><li>Memasukkan air panas dan air dingin secara bersamaan dengan jumlah volum yang sama</li><li>Memasukkan air panas terlebih dahulu kemudian baru air dingin dengan perbandingan volum 1:2</li><li>Memasukkan air dingin terlebih dahulu kemudian baru air panas dengan perbandingan volum 1:2</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Air panas memiliki kalor jenis yang lebih tinggi dibandingkan air dingin</li><li>Air panas memiliki kalor jenis yang lebih rendah dibandingkan air dingin</li><li>Air panas memiliki massa jenis yang lebih tinggi dibandingkan air dingin</li><li>Air panas memiliki massa jenis yang lebih rendah dibandingkan air dingin</li><li>Air panas dan air dingin memiliki massa jenis yang sama</li></ol>', 0.345, 1.414, -2.15, 3.29, -1.44, 0, 'D', 'D', 'LS.SK.3.5.22A'),
('S.354', 'MD.14', '<p style=\"text-align: justify;\">Keran air pada tempat umum didesain agar dapat digunakan oleh banyak orang sekaligus. Oleh karena itu, pada tempat umum sering dijumpai banyak keran yang berjejer seperti pada Gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2023%20A%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"191\" /></p>\r\n<p style=\"text-align: justify;\">Jika setiap keran dihubungkan dengan pipa horizontal yang sama, dan diameter keran berbeda-beda.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Konsep fisika yang digunakan sebagai acuan dalam cara kerja peralatan tersebut adalah.....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar ukuran diameter keran, maka kecepatan aliran keran semakin besar.</li><li>Semakin kecil ukuran diameter keran, maka kecepatan aliran keran semakin besar.</li><li>Semakin besar ukuran diameter keran, maka volum air yang dikeluarkan semakin banyak.</li><li>Semakin kecil ukuran diameter keran, maka volum air yang dikeluarkan semakin banyak.</li><li>Diameter keran tidak berpengaruh pada kecepatan aliran dan volum air yang dipindahkan.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena terhubung pada satu pipa sumber maka berlaku <img title=\"A_{1} v_{1} = A_{2}v_{2}\" src=\"https://latex.codecogs.com/gif.latex?A_{1}&amp;space;v_{1}&amp;space;=&amp;space;A_{2}v_{2}\" /></li><li>Karena terhubung pada satu pipa sumber maka berlaku <img title=\"\\frac {A_{1}}{v_{1}}=\\frac{A_{2}}{v_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\frac&amp;space;{A_{1}}{v_{1}}=\\frac{A_{2}}{v_{2}}\" /></li><li>Karena terhubung pada satu pipa sumber maka berlaku <img title=\"V=Q t\" src=\"https://latex.codecogs.com/gif.latex?V=Q&amp;space;t\" /></li><li>Karena terhubung pada satu pipa sumber maka berlaku <img title=\"V = \\frac{Q}{t}\" src=\"https://latex.codecogs.com/gif.latex?V&amp;space;=&amp;space;\\frac{Q}{t}\" /></li><li>Karena terhubung pada satu pipa sumber maka berlaku <img title=\"\\frac {Q_{1} A_{1}}{t_{1}}=\\frac {Q_{2}A_{2}}{t_{2}}\" src=\"https://latex.codecogs.com/gif.latex?\\frac&amp;space;{Q_{1}&amp;space;A_{1}}{t_{1}}=\\frac&amp;space;{Q_{2}A_{2}}{t_{2}}\" /></li></ol>', 0.283, 1.801, -0.86, 2.11, -1.24, 0, 'B', 'A', 'LS.PG.3.3.23A'),
('S.355', 'MD.14', '<p style=\"text-align: justify;\">Crane merupakan salah satu pesawat pengangkat dan pemindah material yang banyak di gunakan. Crane juga merupakan mesin alat berat <em>(heavy equitment</em>) yang memiliki bentuk dan kemampuan angkat yang besar dan mampu berputar hingga 360 derajat dan jangkauan hingga puluhan meter. Crane biasanya digunakan dalam pekerjaan proyek, pelabuhan, perbengkelan, industri, pergudangan dll.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%208B%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"268\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pernyataan yang tepat mewakili sistem Crane seperti pada Gambar agar tidak mengalami kecelakaan adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin besar massa benda yang akan dipindahkan, semakin besar jarak ARM yang diperlukan</li><li>Semakin besar massa benda yang akan dipindahkan, semakin kecil jarak ARM yang diperlukan</li><li>Semakin besar massa benda yang akan dipindahkan, semakin besar jarak JIB yang diperbolehkan</li><li>Semakin besar massa benda yang akan dipindahkan, semakin besar Climbing Frame yang diperbolehkan</li><li>Semakin besar massa benda yang akan dipindahkan, semakin kecil Counterweight yang dibutuhkan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Agar <img title=\"\\sum I = 0\" src=\"https://latex.codecogs.com/gif.latex?\\sum&amp;space;I&amp;space;=&amp;space;0\" /></li><li>Agar <img title=\"\\sum F =0\" src=\"https://latex.codecogs.com/gif.latex?\\sum&amp;space;F&amp;space;=0\" /></li><li>Agar <img title=\"\\sum p = 0\" src=\"https://latex.codecogs.com/gif.latex?\\sum&amp;space;p&amp;space;=&amp;space;0\" /></li><li>Agar <img title=\"\\sum L =0\" src=\"https://latex.codecogs.com/gif.latex?\\sum&amp;space;L&amp;space;=0\" /></li><li>Agar <img title=\"\\sum \\tau =0\" src=\"https://latex.codecogs.com/gif.latex?\\sum&amp;space;\\tau&amp;space;=0\" /></li></ol>', 0.295, 2.448, -1.64, 4.73, -3.09, 0, 'A', 'E', 'LS.KT.3.1.8B'),
('S.356', 'MD.14', '<p style=\"text-align: justify;\">Indonesia sendiri memiliki permainan sepak bola versi ekstrem yang melibatkan api. Permainan bola api biasanya dimainkan sebagai sarana hiburan seperti pada perayaan kemerdekaan, idul fitri, idul adha, dan sebagainya. Uniknya lagi, bola api tidak menggunakan bola sungguhan seperti pada permainan sepak bola. Bola api biasanya terbuat dari kelapa tua yang sudah dikeringkan. Selanjutnya kelapa tersebut akan direndam dalam minyak tanah selama beberapa hari, barulah pada saat akan memulai pertandingan, bola tersebut dibakar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2022B%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"207\" /></p>\r\n<p style=\"text-align: justify;\">Meskipun dengan tingkat risiko cedera berupa luka bakar pada kulit, permainan bola api justru dilakukan tanpa menggunakan pelindung kaki seperti pada olahraga sepak bola pada umumnya. Selain itu, sepak bola api hanya dilakukan pada malam hari saja.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pada proses pembuatan bola api, pengeringan buah kelapa dan perendaman bola ke dalam minyak tanah selama beberapa hari bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengurangi risiko ledakan pada saat bola dibakar.</li><li>Mengurangi risiko bola hangus saat terbakar</li><li>Memperlambat waktu bola menjadi hangus</li><li>Mengurangi risiko luka bakar pada saat bola ditendang</li><li>Mempermudah untuk membakar bola ketika mati pada saat pertandingan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Minyak tanah cenderung mudah dibakar akan tetapi memiliki titik didih yang lebih tinggi dibandingkan bensin sehingga penguapan lebih lama</li><li>Minyak tanah cenderung mudah dibakar akan tetapi memiliki titik didih yang lebih rendah dibandingkan bensin sehingga penguapan lebih cepat</li><li>Minyak tanah cenderung mudah dibakar dan menghasilkan panas yang lebih tinggi dibandingkan dengan bensin sehingga penguapan lebih cepat</li><li>Minyak tanah cenderung mudah dibakar dan menghasilkan panas yang lebih rendah dibandingkan dengan bensin sehingga penguapan lebih lama</li><li>Minyak tanah cenderung mudah dibakar dan menghasilkan panas yang aman pada saat ditendang dan penguapan lebih cepat.</li></ol>', 0.275, 2.056, -1.32, 3.43, -2.11, 0, 'C', 'A', 'LS.KP.3.5.9B'),
('S.357', 'MD.14', '<p style=\"text-align: justify;\">Laptop merupakan sistem kompleks karena mampu menyederhanakan ukuran komputer yang besar. Dengan ukuran yang kecil, laptop masih memiliki fungsi yang sama dengan komputer. Bagian hardware pada laptop dibuat lebih compact dan ukuran yang lebih kecil. Keyboard misalnya, tetap menerapkan konsep elastisitas pada katup elastis sehingga pada saat menekan tombol, tombol tersebut akan kembali kepada posisi semula. Bahan yang digunakan untuk membuat bagian elastis dari keyboard adalah campuran silika dan karet sehingga berlaku hukum Hooke.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2010B%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"169\" /></p>\r\n<p><strong>Pertanyaan: </strong>Aktivitas berikut yang tidak merusak sifat elastis pada <em>keyboard</em> adalah.....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Menumpahkan air pada keyboard</li><li>Menumpahkan minyak pada keyboard</li><li>Menekan tombol keyboard terlalu lama</li><li>Memutar-mutar katup elastis</li><li>Menggores keyb<em>oard</em> dengan benda tajam</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Sifat elastis hanya bekerja pada daerah deformasi plastis</li><li>Sifat elastis hanya bekerja pada daerah deformasi elastis</li><li>Air dapat mengurangi sifat elastis bahan</li><li>Minyak dapat menambah sifat elastis bahan</li><li>Benda tajam dapat menghilangkan sifat elastis</li></ol>', 0.339, 1.478, 0.61, -0.28, -0.33, 0, 'A', 'B', 'LS.SK.3.1.10C'),
('S.358', 'MD.14', '<p style=\"text-align: justify;\">Perhatikan Gambar berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2023D%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"198\" /></p>\r\n<p style=\"text-align: justify;\">Pada saat memasukan es atau air dingin ke dalam gelas, terdapat gumpalan gumapalan di dinding gelas.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pernyataan yang tepat mengenai pembentukan bulir air di dinding gelas adalah...</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Butiran air terbentuk dari udara yang mengalami evaporasi</li><li>Butiran air terbentuk dari udara yang mengalami kondensasi</li><li>Butiran air terbentuk dari udara yang mengalami adveksi</li><li>Butiran air terbentuk dari udara yang mengalami presipitasi</li><li>Butiran air terbentuk dari udara yang mengalami infiltrasi</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Terjadi aliran kalor dari dinding gelas yang dingin ke udara di sekitar yang lebih panas</li><li>Terjadi aliran kalor dari dinding gelas yang dingin ke udara di sekitar yang lebih dingin</li><li>Terjadi aliran kalor dari udara di sekitar gelas yang panas menuju gelas yang lebih dingin.</li><li>Terjadi aliran kalor dari udara di sekitar gelas yang panas menuju gelas yang lebih panas.</li><li>Terjadi kesetimbangan termal antara air es, gelas, dan udara di sekitar gelas.</li></ol>', 0.245, 1.351, -2.47, 5.45, -2.98, 0, 'B', 'C', 'LS.PG.3.5.11B'),
('S.359', 'MD.14', '<p style=\"text-align: justify;\">Permasalahan minyak sisa makanan sering ditemui pada saat mencuci piring. Minyak pada wadah plastik cukup sulit dihilangkan karena menempel pada permukaan plastik. Sedangkan pada wadah berbahan kaca, minyak cenderung lebih mudah dibersihkan.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2012B%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"168\" /></p>\r\n<p style=\"text-align: justify;\">Cara paling ampuh untuk membersihkan tempelan minyak pada wadah plastik adalah dengan menggunakan sabun cuci piring. Selain itu, minyak pada wadah juga bisa dibersihkan dengan menaburkan tepung jagung/maizenda, ampas kelapa, dan kopi.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Penambahan tepung jagung atau ampas kelapa ke dalam wadah plastik sebelum proses pencucian bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengurangi jumlah minyak dalam piring</li><li>Memisahkan minyak dalam piring</li><li>Menggumpalkan minyak dalam piring</li><li>Mengikat minyak pada piring</li><li>Membersihkan minyak dalam piring</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Gaya adhesi antara minyak dengan tepung/ampas kelapa lebih kecil dibandingkan dengan adhesi antara minyak dengan plastik.</li><li>Gaya adhesi antara minyak dengan tepung/ampas kelapa lebih besar dibandingkan dengan adhesi antara minyak dengan plastik.</li><li>Gaya kohesi antara minyak dengan tepung/ampas kelapa lebih besar dibandingkan dengan adhesi antara minyak dengan plastik.</li><li>Gaya kohesi antara minyak dengan tepung/ampas kelapa lebih kecil dibandingkan dengan adhesi antara minyak dengan plastik.</li><li>Gaya adhesi dan kohesi antara partikel minyak meningkat setelah ditambahkan tepung/ampas kelapa.</li></ol>', 0.308, 1.585, -0.55, 0.81, -0.26, 0, 'D', 'B', 'LS.KP.3.3.12B'),
('S.360', 'MD.14', '<p>Karburator umum digunakan untuk mobil berbahan bakar bensin sampai akhir 1980-an. Setelah banyak kontrol elektronik digunakan pada mobil, penggunaan karburator mulai digantikan oleh sistem injeksi bahan bakar karena lebih mudah terintegrasi dengan sistem yang lain untuk mencapai efisiensi bahan bakar. Karburator berfungsi mencampur bahan bakar dengan udara dalam ukuran yang tepat (sesuai kebutuhan) untuk kemudian disalurkan ke dalam ruang bakar (silinder) dalam bentuk kabut Oleh karena itu, karburator biasanya disambungkan dengan saringan hawa yang menyaring udara. Perhatikan skema karburator berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2020D%20(FILEminimizer).png\" alt=\"\" width=\"300\" height=\"387\" /></p>\r\n<p>Pada setiap saat beroperasinya, karburator harus mampu untuk:</p>\r\n<ul>\r\n<li>Mengatur besarnya aliran udara yang masuk kedalam ruang bakar</li>\r\n<li>Menyalurkan bahan bakar dengan jumlah yang tepat sesuai dengan aliran udara yang masuk kedalam ruang bakar sehingga rasio bahan bakar/udara tetap terjaga.</li>\r\n<li>Mencampur airan udara dan bahan bakar dengan rata dan sempurna</li>\r\n</ul>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan bacaan tersebut, pernyataan yang menunjukkan keterkaitan antara karburator dan saringan hawa adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Semakin kotor saringan hawa, maka semakin banyak volum bahan bakar yang masuk ke karburator</li><li>Semakin kotor saringan hawa, maka semakin sedikit volum bahan bakar yang masuk ke karburator</li><li>Semakin kotor saringan hawa, maka semakin banyak volum udara yang masuk ke karburator</li><li>Semakin kotor saringan hawa, maka semakin sedikit volum udara yang masuk ke karburator</li><li>Semakin kotor saringan hawa, maka semakin rendah efisiensi perbandingan bahan bakar dan udara di karburator</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Saringan hawa berfungsi untuk menjaga kebersihan udara untuk pembakaran</li><li>Saringan hawa berfungsi untuk menjaga kebersihan bahan bakar untuk pembakaran</li><li>Saringan hawa berfungsi menyuplai udara untuk proses pembakaran</li><li>Saringan hawa berfungsi menyuplai bahan bakar untuk proses pembakaran</li><li>Saringan hawa berfungsi menjaga temperatur di dalam karburator</li></ol>', 0.333, 2.544, 0.21, 0.88, -1.09, 0, 'E', 'A', 'LS.KT.3.4.20B'),
('S.361', 'MD.14', '<p style=\"text-align: justify;\">Tali karet memiliki banyak manfaat bagi kehidupan seperti untuk sarana permainan, olahraga, pengikat, dan keperluan rumah tangga lainnya. Pembuatan tali karet juga tergolong <em>reusable </em>artinya memanfaatkan bahan bekas seperti ban dalam sepeda, motor, ataupun mobil.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2021B%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"196\" /></p>\r\n<p style=\"text-align: justify;\">Sebagai pengikat, tali karet mampu memberikan ikatan yang kuat sehingga barang yang diikat dengan menggunakan tali karet cenderung lebih aman. Dengan catatan bahwa pada saat pemasangan tali karet diregangkan hingga mencapai panjang maksimal terlebih dahulu. Selanjutnya baru diikatkan pada benda.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Tujuan dari meregangkan tali karet kepada panjang maksimum sebelum diikatkan pada benda adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Supaya tali karet tidak mudah memulur atau memanjang pada saat diikat</li><li>Supaya tali karet lebih mudah memulur atau memanjang pada saat diikat</li><li>Supaya tali karet memiliki cengkeraman yang lebih kuat</li><li>Supaya tali karet tidak mudah putus pada saat diikat</li><li>Supaya tali karet lebih mudah untuk dilepaskan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Setelah diregangkan, tali karet akan kembali kepada panjang semula sehingga ikatan menjadi lebih lemah</li><li>Setelah diregangkan, tali karet akan kembali kepada panjang semula sehingga ikatan menjadi lebih kuat</li><li>Setelah diregangkan, tali karet memiliki ukuran yang lebih panjang sehingga lebih mudah untuk dilepaskan</li><li>Pada saat diikatkan, tali karet akan memulur sehingga kekuatan ikatan menjadi lebih kuat</li><li>Pada saat diikatkan, tali karet akan memulur sehingga kekuatan ikatan menjadi lebih lemah</li></ol>', 0.202, 2.169, 1.07, 0.99, -2.05, 0, 'C', 'B', 'LS.KP.3.2.21B'),
('S.362', 'MD.14', '<p style=\"text-align: justify;\">Indonesia sendiri memiliki permainan sepak bola versi ekstrem yang melibatkan api. Permainan bola api biasanya dimainkan sebagai sarana hiburan seperti pada perayaan kemerdekaan, idul fitri, idul adha, dan sebagainya. Uniknya lagi, bola api tidak menggunakan bola sungguhan seperti pada permainan sepak bola. Bola api biasanya terbuat dari kelapa tua yang sudah dikeringkan. Selanjutnya kelapa tersebut akan direndam dalam minyak tanah selama beberapa hari, barulah pada saat akan memulai pertandingan, bola tersebut dibakar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2022B%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"207\" /></p>\r\n<p style=\"text-align: justify;\">Meskipun dengan tingkat risiko cedera berupa luka bakar pada kulit, permainan bola api justru dilakukan tanpa menggunakan pelindung kaki seperti pada olahraga sepak bola pada umumnya. Selain itu, sepak bola api hanya dilakukan pada malam hari saja.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyan: </strong>Untuk menghindari kebakaran, sikap yang tepat dilakukan pada saat memainkan sepak bola api adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Menggunakan celana berbahan karet pada saat permaian</li><li>Melapisi kaki dengan minyak goreng sebelum permaian</li><li>Merendam kaki dengan air es sebelum permaian</li><li>Menggunakan sepatu berbahan dasar karet</li><li>Menggunakan sepatu berbahan dasar kulit</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Suhu kaki diusahsakan serendah mungkin sehingga pada saat terjadi kontak dengan bola, api tidak membakar kulit</li><li>Kaki harus dilapisi dengan cairan yang susah terbakar sehingga pada saat terjadi kontak dengan bola, api tidak membakar kulit</li><li>Kaki harus dilapisi dengan bahan yang tahan panas sehingga pada saat terjadi kontak dengan bola, api tidak membakar kulit</li><li>Kaki harus dilapisi dengan bahan yang memiliki konduktifitas tinggi sehingga pada saat terjadi kontak dengan bola, api tidak membakar kulit</li><li>Kaki harus dilapisi oleh cairan dengan kalor jenis yang tinggi sehingga pada saat terjadi kontak dengan bola, api tidak membakar kulit</li></ol>', 0.244, 1.593, -3.69, 2.68, 1.01, 0, 'C', 'A', 'LS.SK.3.5.22B'),
('S.363', 'MD.14', '<p style=\"text-align: justify;\">Salah satu penerapan dari konsep fluida dalam dunia pertukangan adalah untuk menentukan kedataran menggunakan selang kecil. Selang kecil akan diisi air yang salah satu ujungnya dijadikan acuan ketinggian dan ujung lain digerakkan untuk menyesuaikan ketinggian di sisi yang berbeda seperti pada Gambar berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2023%20B%20(FILEminimizer).jpg\" alt=\"\" width=\"361\" height=\"154\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Konsep fisika yang digunakan sebagai acuan dalam cara kerja peralatan tersebut adalah.....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Hukum Pascal</li><li>Hukum Archimedes</li><li>Tekanan Hidrostatis</li><li>Asas Bernoulli</li><li>Persamaan Kontinuitas</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Dalam sistem, tekanan hidrostatis adalah sama sehingga ketinggian permukaan air akan sama.</li><li>Dalam sistem, terjadi aliran fluida yang menciptakan keseimbangan air di dalam selang.</li><li>Dalam selang, kedudukan air akan dipengaruhi oleh gaya apung dan gaya tekan sehingga ketinggian permukaan akan sama</li><li>Dalam sistem, terjadi kesetimbangan fluida karena luas penampang, kecepatan aliran, dan tekanan adalah sama.</li><li>Dalam sistem, luas penampang selang adalah sama sehingga gaya yang bekerja masing-masing ujung juga sama.</li></ol>', 0.351, 1.267, -1.47, 1.58, -0.11, 0, 'C', 'A', 'LS.PG.3.3.23B'),
('S.364', 'MD.14', '<p style=\"text-align: justify;\">Perancangan <em>Shockbreaker </em>pada sistem transportasi darat sangat menentukan kenyamanan pengguna. Hal ini karena secara korelasi <em>Shockbreaker </em>berpengaruh pada suspensi dari kendaraan yang ada. <em>Shockbreaker </em>sendiri bekerja dengan mengadopsi prinsip pegas untuk mengurangi faktor redaman. Pada kenyataannya kita menemukan bahwa tidak semua <em>Shockbreaker </em>menghasilkan kenyamanan kepada pengguna.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%208C%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"265\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Bagaimanakah ukuran <em>Shockbreaker </em>yang baik untuk digunakan sehingga menghasilkan suspensi yang baik?</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Shockbreaker dengan konstanta pegas yang besar dan ukuran yang besar.</li><li>Shockbreaker dengan konstanta pegas yang besar dan ukuran yang kecil.</li><li>Shockbreaker dengan konstanta pegas yang kecil dan ukuran yang besar.</li><li>Shockbreaker dengan konstanta pegas yang kecil dan ukuran yang kecil.</li><li>Shockbre<em>aker </em>dengan konstanta pegas yang kecil dan panjang yang kecil.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Konstanta pegas yang besar akan menyebabkan pertambahan panjang yang kecil sehingga akan membuat sistem menjadi lebih kaku, sedangkan panjang pegas yang besar membuat sistem berosilasi lebih jauh.</li><li>Konstanta pegas yang besar akan menyebabkan pertambahan panjang yang kecil sehingga akan membuat sistem menjadi lebih kaku, sedangkan panjang pegas yang besar membuat sistem berosilasi lebih pendek.</li><li>Konstanta pegas yang besar akan menyebabkan pertambahan panjang yang besar sehingga akan membuat sistem menjadi lebih kaku, sedangkan panjang pegas yang besar membuat sistem berosilasi lebih jauh.</li><li>Konstanta pegas yang besar akan menyebabkan pertambahan panjang yang besar sehingga akan membuat sistem menjadi lebih kaku, sedangkan panjang pegas yang besar membuat sistem berosilasi lebih pendek.</li><li>Konstanta pegas yang besar akan menyebabkan pertambahan panjang yang kecil sehingga akan membuat sistem menjadi lebih kaku, sedangkan ukuran pegas yang besar membuat sistem berosilasi lebih pendek.</li></ol>', 0.316, 1.976, 0.7, 0.73, -1.43, 0, 'C', 'A', 'LS.KT.3.2.8C'),
('S.365', 'MD.14', '<p>Pernahkah kamu menggunakan timbangan lengan gantung seperti pada gambar?</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%209C%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"377\" /></p>\r\n<p>Timbangan gantung sering digunakan untuk menimbang hasil panen karena jangkauan pengukuran yang relatif besar. Disisi lain, timbangan gantung juga memiliki pengait yang memudahkan petani menimbang hasil panen yang biasanya dikumpulkan dalam karung. Terdapat keunikan dari timbangan gantung yaitu timbangan tidak memiliki anak timbangan seperti pada timbangan duduk. Petani ataupun pembeli akan menggerakkan pemberat yang berada pada lengan timbangan sehingga mencapai posisi setimbang. Massa yang terukur sesuai dengan skala pengukuran yang terdapat pada lengan timbangan.</p>\r\n<p><strong>Pertanyaan: </strong>Proses menggeser batu pemberat yang terdapat pada lengan timbangan bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Meningkatkan gaya berat pada lengan timbangan</li><li>Meningkatkan momen inersia pada lengan timbangan</li><li>Meningkatkan momen gaya pada lengan timbangan</li><li>Mengubah pusat massa antara beban dan lengan timbangan</li><li>Memberikan tekanan pada lengan timbangan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena memenuhi persamaan <img title=\"\\tau = \\overrightarrow{F} \\times \\overrightarrow{r}\" src=\"https://latex.codecogs.com/gif.latex?\\tau&amp;space;=&amp;space;\\overrightarrow{F}&amp;space;\\times&amp;space;\\overrightarrow{r}\" /></li><li>Karena memenuhi persamaan <img title=\"I=mr^^2\" src=\"https://latex.codecogs.com/gif.latex?I=mr^^2\" /></li><li>Karena memenuhi persamaan <img title=\"F = mg\" src=\"https://latex.codecogs.com/gif.latex?F&amp;space;=&amp;space;mg\" /></li><li>Karena memenuhi persamaan <img title=\"x = m_{1} x_{1} + m_{2} x_{2} + .... + m_{n} x_{n}\" src=\"https://latex.codecogs.com/gif.latex?x&amp;space;=&amp;space;m_{1}&amp;space;x_{1}&amp;space;+&amp;space;m_{2}&amp;space;x_{2}&amp;space;+&amp;space;....&amp;space;+&amp;space;m_{n}&amp;space;x_{n}\" /></li><li>Karena memenuhi persamaan <img title=\"P_{total} = \\frac {mg}{r^^2}\" src=\"https://latex.codecogs.com/gif.latex?P_{total}&amp;space;=&amp;space;\\frac&amp;space;{mg}{r^^2}\" /></li></ol>', 0.171, 3.867, 0.65, 1.56, -2.21, 0, 'C', 'A', 'LS.KP.3.1.9C'),
('S.366', 'MD.14', '<p style=\"text-align: justify;\">Pada tanggal 17 Maret 2017 lalu, lift atau elevator di pusat perbelanjaan Blok M Square Jakarta Selatan jatuh dari lantai 7 ke lantai dasar. Kejadian ini diduga karena lift yang ditumpangi mengalami <em>overload</em> dengan jumlah penumpang dalam lift tersebut adalah 25 orang.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2010C-%20(FILEminimizer).jpg\" alt=\"\" width=\"499\" height=\"314\" /></p>\r\n<p style=\"text-align: justify;\">Kejadian lift yang jatuh sudah cukup sering terjadi. Beberapa penyebab lift terjatuh adalah kelebihan beban, kesalahan teknis, peralatan yang sudah tua, dan proses <em>maintenance</em> yang jarang dilakukan. Selain faktor tersebut, lift juga mungkin terjatuh ketika gedung mengalami kerusakan seperti kebakaran, kegagalan sistem, dan guncangan (gempa bumi)</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Berdasarkan sudut pandang fisika, sikap yang tepat pada saat memasuki lift adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Masuk lift secara teratur dan tidak saling berdesakan</li><li>Tidak berlama-lama di dalam lift pada dan keluar dengan teratur</li><li>Tidak menggunakan lift jika hanya seorang diri.</li><li>Tidak menggunakan lift untuk perpindahan lantai yang pendek.</li><li>Tidak memaksakan masuk ke dalam lift jika sudah hampir penuh.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Penggunaan lift membutuhkan daya yang besar, sehingga kita perlu menghemat energi</li><li>Lift bergerak secara vertikal, sehingga gaya akan semakin besar pada saat diam</li><li>Lift bergerak secara vertikal, sehingga gaya akan semakin besar pada saat bergerak ke atas</li><li>Lift bergerak secara vertikal, sehingga gaya akan semakin besar pada saat bergerak ke bawah</li><li>Lift bergerak secara vertikal, sehingga semakin banyak beban, semakin besar gaya yang bekerja.</li></ol>', 0.395, 0, -1.51, 0.47, 1.04, 0, 'E', 'E', 'LS.SK.3.1.10CC'),
('S.367', 'MD.14', '<p style=\"text-align: justify;\">Timbangan/neraca pegas adalah salah satu bentuk aplikasi dari konsep pegas dalam kehidupan sehari-hari.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2011C%20(FILEminimizer).jpg\" alt=\"\" width=\"282\" height=\"317\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Prinsi kerja pada neraca pegas adalah...</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Massa memberikan gaya berupa gaya berat, kemudian diidentifikasi oleh penampang dengan luas A melalui perngurangan panjang pegas dengan konstanta k dan perputaran anak panah.</li><li>Massa memberikan gaya berupa gaya berat, kemudian penampang dengan luas A menyebabkan tekanan yang diidentifikasi oleh pegas dengan konstanta k melalui perubahan panjang pegas dan memutar anak panah.</li><li>Massa memberikan gaya berupa gaya berat, kemudian penampang dengan luas A meneruskan tekanan pada pegas dengan konstanta k. Pegas yang tertekan memutar anak panah tanpa mengalami perubahan panjang.</li><li>Massa memberikan gaya berupa gaya berat, kemudian penampang dengan luas A menyebabkan tekanan pada anak panah.</li><li>Massa memberikan gaya berupa gaya berat, kemudian pegas dengan konstanta k menghasilkan perputaran pada anak panah.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Tekanan berbanding lurus dengan luas penampang yang digunakan pada timbangan</li><li>Tekanan berbanding lurus dengan pertambahan panjang pada pegas</li><li>Tekanan berbanding terbalik dengan pertambahan panjang pada pegas</li><li>Pertambahan panjang pegas berbanding terbalik dengan perubahan sudut pada jarum</li><li>Pertambahan panjang pegas berbanding lurus dengan perubahan sudut pada jarum</li></ol>', 0.31, 2.332, -1.23, 2.71, -1.47, 0, 'C', 'E', 'LS.PG.3.2.11C'),
('S.368', 'MD.14', '<p style=\"text-align: justify;\">Percobaan mengenai hukum Archimedes bertujuan untuk menunjukkan fenomena mengapung, melayang, dan tenggelam. Dalam salah satu percobaan, objek yang digunakan adalah telur yang dimasukkan ke dalam larutan garam seperti pada Gambar.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2014A%20(FILEminimizer).jpg\" alt=\"\" width=\"400\" height=\"225\" /></p>\r\n<p style=\"text-align: justify;\">Pada kondisi normal, telur akan tenggelam dan berada pada bagian dasar gelas. Untuk membuat telur menjadi melayang, garam ditambahkan secara perlahan dan diaduk hingga dengan campuran tertentu menjadi melayang dan mengapung.</p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Pembuatan larutan garam dalam percobaan bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengurangi konsentrasi larutan</li><li>Menambah massa larutan</li><li>Mengurangi massa telur</li><li>Menambah massa jenis larutan</li><li>Menambah massa jenis telur</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Benda akan mengapung ketika massa benda lebih kecil dibandingkan dengan massa larutan</li><li>Benda akan melayang ketika massa jenis benda sama dengan massa jenis larutan</li><li>Benda akan tenggelam ketika massa benda lebih besar dibandingkan dengan massa larutan</li><li>Gaya apung benda berbanding terbalik dengan konsentrasi larutan</li><li>Gaya berat benda berbanding lurus dengan konsentrasi larutan</li></ol>', 0.372, 1.368, -1.71, 3.71, -2, 0, 'D', 'B', 'LS.KP.3.3.12C'),
('S.369', 'MD.14', '<p>Perhatikan Gambar berikut!</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2020A%20(FILEminimizer).jpg\" alt=\"\" width=\"100\" height=\"370\" /></p>\r\n<p>Secara fisika maupun kimia, larutan yang tersusun dari bahan yang sama akan melarut sehingga menghasilkan larutan yang homogen. Sebagai contoh, pada saat menggabungkan larutan teh dengan larutan gula akan menghasilkan larutan teh + gula tanpa bisa membedakan antara partikel teh, partikel air, dan partikel gula. Akan tetapi, dalam salah satu percobaan fisika, kita dapat membuat larutan yang berasal dari campuran yang sama, sebagai contoh larutan gula, dapat disusun hingga membentuk lapisan pelangi seperti pada Gambar.</p>\r\n<p><strong>Pertanyaan: </strong>Pernyataan yang tepat mengenai fenomena larutan warna-warni seperti pada gambar adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Lapisan larutan terbentuk karena memiliki massa yang berbeda</li><li>Lapisan larutan terbentuk karena memiliki volum yang berbeda</li><li>Lapisan larutan terbentuk karena memiliki massa jenis yang berbeda</li><li>Lapisan larutan terbentuk karena memiliki tegangan permukaan yang sama</li><li>Lapisan larutan terbentuk karena memiliki gaya adhesi yang lebih besar</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Larutan yang memiliki massa yang lebih besar akan tenggelam karena memiliki berat jenis yang lebih besar.</li><li>Larutan yang memiliki volum larutan yang lebih kecil akan mengapung karena memiliki berat jenis yang lebih kecil</li><li>Larutan yang memiliki massa jenis berbeda tidak akan tercampur karena perbedaan konsentrasi</li><li>Tegangan permukaan pada setiap larutan menghambat proses pencampuran</li><li>Gaya adhesi pada setiap larutan mempertahankan konsentrasi larutan</li></ol>', 0.412, -0.35, -1.37, 0.34, 1.04, 0, 'C', 'C', 'LS.KT.3.3.20C'),
('S.370', 'MD.14', '<p style=\"text-align: justify;\">Pembalap Moto GP biasanya memiliki kemampuan untuk mengendalikan sepeda motor dengan kecepatan tinggi. Pada jalanan lurus, seorang pembalap MotoGP bergerak dengan kecepatan lebih dari 200 Km/jam, sedangkan pada saat menikung kecepatan pembalap ada pada kisaran 80-100 km/jam. Sehingga, kita sering melihat bahwa pembalap akan menundukkan kepala pada saat bergerak lurus dan mengangkat kepala pada saat memasuki area tikungan.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2021C%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"200\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan: </strong>Perubahan posisi pembalap dari menunduk menjadi tegak pada saat akan memasuki tikungan bertujuan untuk....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mengurangi gaya tekan yang diterima oleh punggung</li><li>Meningkatkan gaya tekan yang diterima oleh punggung</li><li>Mengurangi aliran udara dari arah depan</li><li>Meningkatkan aliran udara dari arah depan</li><li>Mengontrol aliran udara dari arah belakang.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Aliran udara dan gaya tekan dari aliran udara bersifat konstan</li><li>Aliran udara dan gaya tekan dari aliran udara bersifat dinamis</li><li>Aliran udara bersifat dinamis, akan tetapi gaya tekan dari aliran udara bersifat konstan</li><li>Aliran udara bersifat konstan, akan tetapi gaya tekan dari aliran udara bersifat dinamis</li><li>Aliran udara dan gaya tekan berbanding terbalik.</li></ol>', 0.182, 3.131, -1.98, 3.7, -1.72, 0, 'A', 'D', 'LS.KP.3.4.21C'),
('S.371', 'MD.14', '<p>Kebocoran tabung gas merupakan permasalahan yang sering ditemukan dalam keseharian. Jumlah korban yang dihasilkan dari kebocoran gas juga sudah cukup banyak.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2022C%20(FILEminimizer).jpg\" alt=\"\" width=\"278\" height=\"182\" /></p>\r\n<p>Berdasarkan hasil investigasi, kecenderungan ledakan terjadi pada tabung gas yang disimpan pada ruang tertutup. Hal ini disebabkan karena pada saat gas bocor, gas akan mengendap di sekitar lantai sehingga pada saat terjadi percikan api akan menyebabkan kebakaran. Selain faktor tersebut, ledakan tabung gas juga terjadi karena faktor kecemasan yang berlebihan pada saat terjadi kebocoran gas.</p>\r\n<p><strong>Pertanyaan: </strong>Sikap yang tepat dilakukan pada saat terjadi gas bocor adalah....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Mematikan semua perangkat elektronik yang ada di rumah</li><li>Mematikan semua peralatan yang berhubungan dengan listrik</li><li>Menutup tabung gas dengan kain basah</li><li>Membuka pintu dan semua jendela</li><li>Menutup pintu dan semua jendela</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Massa jenis gas lebih besar dibandingkan dengan udara, sehingga dengan mengalirkan gas keluar rumah memperkecil risiko terjadi ledakan</li><li>Massa jenis gas lebih kecil dibandingkan dengan udara, sehingga dengan mengalirkan gas keluar rumah memperkecil risiko terjadi ledakan</li><li>Gas memiliki titik swasulut yang tinggi sehingga dapat dengan mudah terbakar, sehingga sumber percikan harus dihilangkan</li><li>Gas memiliki titik swasulut yang rendah sehingga dapat dengan mudah terbakar, sehingga sumber percikan harus dihilangkan</li><li>Gas memiliki titik didih yang rendah sehingga dapat dengan mudah menguap pada saat terjadi kebocoran</li></ol>', 0.29, 1.883, -1.6, 1.88, -0.28, 0, 'D', 'A', 'LS.SK.3.3.22C'),
('S.372', 'MD.14', '<p style=\"text-align: justify;\">Timbangan pasar merupakan salah satu bentuk penerapan dari kesetimbangan fisika dalam kehidupan sehari-hari. Batu timbangan digunakan sebagai acuan massa yang ditempatkan pada sisi sebelah kiri, sedangkan barang yang akan ditimbang ditempatkan di wadah di bagian kanan.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%2011A%20(FILEminimizer).jpg\" alt=\"\" width=\"409\" height=\"237\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pertanyaan:</strong> Berdasarkan penempatan batu timbangan, pernyataan yang tepat adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Torsi sistem, dipengaruhi oleh penempatan batu timbangan</li><li>Torsi sistem, tidak dipengaruhi oleh penempatan batu timbangan</li><li>Momen kopel sistem, dipengaruhi oleh penempatan batu timbangan</li><li>Momen kopel sistem, tidak dipengaruhi oleh penempatan batu timbangan</li><li>Momen inersia sistem, dipengaruhi oleh penempatan batu timbangan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Penempatan batu timbangan menentukan panjang lengan beban.</li><li>Penempatan batu timbangan tidak menentukan panjang lengan beban.</li><li>Penempatan batu timbangan menentukan pusat massa sistem.</li><li>Penempatan batu timbangan menentukan beban.</li><li>Penempatan batu timbangan tidak menentukan panjang lengan beban.</li></ol>', 0.25, 2.162, -2.86, 2.25, 0.61, 0, 'B', 'B', 'LS.PG.3.1.23C');
INSERT INTO `soal` (`id_soal`, `id_mode`, `soal`, `jawaban`, `alasan`, `a`, `b`, `bi1`, `bi2`, `bi3`, `c`, `kunci_jawaban`, `kunci_alasan`, `kode`) VALUES
('S.373', 'MD.15', '<p>Sebuah pintu otomatis memiliki tahanan sebesar 40 N yang berfungsi menahan pintu ketika bergerak kembali menuju posisi semula. Pada pintu yang bermassa 45 kg, sistem mampu menahan hingga menyebabkan pintu tertutup sepenuhnya selama 5 detik dengan kondisi awal pintu terbuka 90<sup>o</sup>. Diketahui bahwa system tahanan tersebut bekerja berdasarkan gaya gesek yang terdapat dalam system tahanan pintu dan bekerja berlawanan arah dengan arah gerak pintu.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%20Soal%201A.jpg\" alt=\"\" width=\"208\" height=\"385\" /></p>\r\n<p>Jika gaya tahanan sistem dan massa pintu adalah konstan, konsep fisika yang dapat dipertimbangkan untuk memperbesar atau memperkecil waktu hingga pintu tertutup adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Gaya gesek</li><li>Momen Gaya</li><li>Gerak melingkar</li><li>Gaya Gravitasi</li><li>Momen inersia</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Gaya gesek bekerja sebagai gaya reaksi pada system tahanan pintu</li><li>Momen gaya bekerja sebagai gaya aksi pada system tahanan pintu</li><li>Sistem gerak pada pintu memenuhi kriteria gerak melingkar</li><li>Gaya gravitasi gaya reaksi pada system tahanan pintu</li><li>Momen inersia menentukan gaya aksi pada sistem tahanan pintu</li></ol>', 0.095, 0, -1.99, 4.04, 1.95, 0, 'B', 'B', '*CT.DC.3.1.1'),
('S.374', 'MD.15', '<p>Pembangunan jembatan dengan panjang tertentu didesain dengan kemiringan tertentu. Kemiringan biasanya dipengaruhi oleh timbunan tanah pada setiap ujung-ujung jembatan dan panjang jembatan. Semakin panjang jembatan biasanya kemiringan jembatan menjadi lebih tinggi seperti pada gambar. Selain itu, kemirigan jembatan juga menjadi nilai estetika tersendiri.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%20Soal%202A.jpg\" alt=\"\" width=\"540\" height=\"270\" /></p>\r\n<p style=\"text-align: justify;\">Berdasarkan sudut pandang fisika, permasalahan yang ingin diselesaikan adalah&hellip;...</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Berapakah kemiringan ideal jembatan supaya mengkonsumsi bahan yang minimum?</li><li>Berapakah kemiringan ideal jembatan untuk mengurangi resiko banjir pada saat air pasang?</li><li>Berapakah kemiringan ideal jembatan untuk menahan beban maksimal?</li><li>Berapakah kemiringan ideal jembatan supaya tidak rusak pada saat memuai?</li><li>Berapakah kemiringan ideal jembatan supaya tidak rusak pada saat menyusut?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Jembatan yang tidak melengkung cenderung mudah rusak saat memuai</li><li>Jembatan yang tidak melengkung membutuhkan tiang penyangga lebih banyak</li><li>Jembatan yang tidak melengkung memiliki batas beban maksimum lebih kecil</li><li>Jembatan yang tidak melengkung menggunakan bahan yang lebih banyak</li><li>&nbsp;Jembatan yang tidak melengkung mudah kebanjiran saat terjadi pasang</li></ol>', 0.308, -0.43, -2, 1.18, 0.82, 0, 'C', 'C', 'CT.RD.3.1.14C'),
('S.375', 'MD.15', '<p>Dalam suatu pertandingan gasing, Rudi mengurangi bagian pada gasing sehingga menyebabkan massa gasing berkurang setelah mengetahui gasing lawan memiliki ukuran yang lebih kecil seperti pada Gambar berikut.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%202B%20(FILEminimizer).jpg\" alt=\"\" width=\"485\" height=\"342\" /></p>\r\n<p>Langkah yang dilakukan oleh Rudi bertujuan untuk menyelesaikan masalah&hellip;&hellip;</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Momen gaya, karena massa besar akan menyebabkan momen gaya menjadi besar dan gasing berputar menjadi lebih cepat</li><li>Momen gaya, karena massa besar akan menyebabkan momen gaya menjadi besar dan gasing berputar menjadi lebih lambat</li><li>Momen inersia, karena massa besar akan menyebabkan momen inersia menjadi besar dan gasing berputar menjadi lebih cepat</li><li>Momen inersia, karena massa besar akan menyebabkan momen inersia menjadi besar dan gasing berputar menjadi lebih lambat</li><li>Momen dipole karena kedua gasing akan berputar secara berdempatan dan saling beradu.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li><img title=\"I=m r ^{2}\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;I=m&amp;space;r&amp;space;^{2}\" /></li><li><img title=\"I=\\frac{F\\times r}{\\omega }\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;I=\\frac{F\\times&amp;space;r}{\\omega&amp;space;}\" /></li><li><img title=\"I=\\frac{\\tau }{\\alpha }\" src=\"http://latex.codecogs.com/gif.latex?I=\\frac{\\tau&amp;space;}{\\alpha&amp;space;}\" /></li><li><img title=\"I=mgr\\sin \\theta\" src=\"http://latex.codecogs.com/gif.latex?I=mgr\\sin&amp;space;\\theta\" /></li><li><img title=\"I=\\frac{F\\times\\alpha}{r\\sin \\theta}\" src=\"http://latex.codecogs.com/gif.latex?I=\\frac{F\\times\\alpha}{r\\sin&amp;space;\\theta}\" /></li></ol>', 0.233, 3.841, -1.29, 5.93, -4.64, 0, 'D', 'C', 'CT.RP.3.1.14D'),
('S.376', 'MD.15', '<p>Trampolin merupakan salah satu jenis permainan yang bisa dimainkan oleh anak anak maupun orang dewasa. Trampolin dapat dimainkan secara berkelompok maupun secara perorangan tergantung pada spesifikasi trampoline. Perhatikan spesifikasi dari dua jenis trampoline berikut!</p>\r\n<table style=\"width: 674px; height: 109px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 37px;\">\r\n<th style=\"width: 51.1406px; height: 37px; text-align: center;\">No</th>\r\n<th style=\"width: 200.594px; height: 37px; text-align: center;\">Spesifikasi</th>\r\n<th style=\"width: 222.688px; height: 37px; text-align: center;\">Trampolin A</th>\r\n<th style=\"width: 171.578px; text-align: center; height: 37px;\">Trampolin B</th>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 51.1406px; height: 18px; text-align: center;\">1</td>\r\n<td style=\"width: 200.594px; height: 18px; text-align: center;\">Diameter Rangka</td>\r\n<td style=\"width: 222.688px; height: 18px; text-align: center;\">4,27 meter</td>\r\n<td style=\"width: 171.578px; text-align: center; height: 18px;\">2,4 meter</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 51.1406px; height: 18px; text-align: center;\">2</td>\r\n<td style=\"width: 200.594px; height: 18px; text-align: center;\">Ukuran pegas</td>\r\n<td style=\"width: 222.688px; height: 18px; text-align: center;\">18 cm</td>\r\n<td style=\"width: 171.578px; text-align: center; height: 18px;\">3,2 cm</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 51.1406px; text-align: center; height: 18px;\">3</td>\r\n<td style=\"width: 200.594px; text-align: center; height: 18px;\">Jumlah pegas</td>\r\n<td style=\"width: 222.688px; text-align: center; height: 18px;\">88 buah</td>\r\n<td style=\"width: 171.578px; text-align: center; height: 18px;\">48 buah</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 51.1406px; text-align: center; height: 18px;\">4</td>\r\n<td style=\"width: 200.594px; text-align: center; height: 18px;\">Beban Maksimum</td>\r\n<td style=\"width: 222.688px; text-align: center; height: 18px;\">150 kg</td>\r\n<td style=\"width: 171.578px; text-align: center; height: 18px;\">80 kg</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Kedua trampoline tersebut diketahui berasal dari perusahaan yang sama sehingga jenis bahan untuk kedua jenis trampoline dapat diasumsikan serupa.</p>\r\n<p>Permasalahan yang didasarkan pada klasifikasi trampoline berdasarkan informasi yang terdapat dalam table adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Bagaimana pengaruh dari ukuran diameter rangka terhadap beban maksimum di dalam trampoline?</li><li>Bagaimana pengaruh ukuran pegas dan diameter rangka terhadap jumlah orang di dalam trampoline?</li><li>Bagaimana pengaruh jumlah pegas dan diameter rangka terhadap beban maksimum di dalam trampoline?</li><li>Bagaimana pengaruh jumlah dan ukuran pegas terhadap beban maksimum dalam trampolin?</li><li>Bagaimana pengaruh jenis pegas dan diameter ragka terhadap beban maksimum dalam trampoline?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li><img title=\"F=\\frac{Y.A.\\Delta x}{x}\" src=\"http://latex.codecogs.com/gif.latex?F=\\frac{Y.A.\\Delta&amp;space;x}{x}\" /></li><li><img title=\"F=\\frac{k_{pegas}^{n}}{\\sum_{i}^{n}k_{pegas}}\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?F=\\frac{k_{pegas}^{n}}{\\sum_{i}^{n}k_{pegas}}\\cdot&amp;space;\\Delta&amp;space;x\" /></li><li><img title=\"F=- \\left ( \\frac{k _{pegas}}{n _{pegas}} \\right )\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?F=-&amp;space;\\left&amp;space;(&amp;space;\\frac{k&amp;space;_{pegas}}{n&amp;space;_{pegas}}&amp;space;\\right&amp;space;)\\cdot&amp;space;\\Delta&amp;space;x\" /></li><li><img title=\"F=-\\frac{k_{pegas}}{\\sum_{1}^{n}k_{pegas}}\\left ( \\frac{Y\\cdot A}{L} \\right )\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?F=-\\frac{k_{pegas}}{\\sum_{1}^{n}k_{pegas}}\\left&amp;space;(&amp;space;\\frac{Y\\cdot&amp;space;A}{L}&amp;space;\\right&amp;space;)\\cdot&amp;space;\\Delta&amp;space;x\" /></li><li><img title=\"F=-n_{pegas} \\left ( \\frac{Y\\cdot A}{L} \\right )\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?F=-n_{pegas}&amp;space;\\left&amp;space;(&amp;space;\\frac{Y\\cdot&amp;space;A}{L}&amp;space;\\right&amp;space;)\\cdot&amp;space;\\Delta&amp;space;x\" /></li></ol>', 0.344, 2.214, -1.89, 3.49, -1.59, 0, 'D', 'E', 'CT.RP.3.2.2C'),
('S.377', 'MD.15', '<p style=\"text-align: justify;\">Tali elastis yoga merupakan inovasi produk olahraga yang memanfaatkan hukum fisika dalam penerapannya. Produk ini menjadi inovasi untuk melakukan yoga atau fitness dengan skala rumahan tanpa harus dating ke gym atau kelas yoga tertentu. Tali elastis yoga memungkinkan pengguna untuk menyesuaikan tingkat kekauan dengan menambah atau mengurangi jumlah tali yang digunakan pada saat melakukan latihan. Semakin banyak tali yang digunakan, maka semakin besar beban yang dirasakan. Perlu diketahui bahawa peralatan tersebut memiliki jenis, panjang, dan diameter tali yang seragam.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%202D.png\" alt=\"\" width=\"297\" height=\"250\" /></p>\r\n<p>Berdasarkan penjabaran diatas, penambahan dan pengurangan jumlah tali yang digunakan berkaitan dengan permasalahan....</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Bagaimana menambah massa tali yang digunakan sebagai pegas?</li><li>Bagaimana menambah menambah ketebalan dari tali yang digunakan sebagai pegas?</li><li>Bagaimana menambag luas area tali yang digunakan sebagai pegas</li><li>Bagaimana menambah panjang tali yang digunakan sebagai pegas</li><li>Bagaimana menambah kekakuan tali yang digunakan sebagai pegas?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li><img title=\"F=\\frac{Y \\cdot A \\cdot \\Delta x}{x}\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;F=\\frac{Y&amp;space;\\cdot&amp;space;A&amp;space;\\cdot&amp;space;\\Delta&amp;space;x}{x}\" /></li><li><img title=\"F=-\\frac{k_{pegas}^{n}}{\\sum_{1}^{n}k_{pegas}}\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;F=-\\frac{k_{pegas}^{n}}{\\sum_{1}^{n}k_{pegas}}\\cdot&amp;space;\\Delta&amp;space;x\" /></li><li><img title=\"F=-\\left ( \\frac{k_{pegas}}{n_{pegas}} \\right )\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;F=-\\left&amp;space;(&amp;space;\\frac{k_{pegas}}{n_{pegas}}&amp;space;\\right&amp;space;)\\cdot&amp;space;\\Delta&amp;space;x\" /></li><li><img title=\"F=-n_{pegas}\\cdot k_{pegas}\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;F=-n_{pegas}\\cdot&amp;space;k_{pegas}\\cdot&amp;space;\\Delta&amp;space;x\" /></li><li><img title=\"F=-\\frac{k_{pegas}}{n_{pegas}}\\cdot \\Delta x\" src=\"http://latex.codecogs.com/gif.latex?\\inline&amp;space;F=-\\frac{k_{pegas}}{n_{pegas}}\\cdot&amp;space;\\Delta&amp;space;x\" /></li></ol>', 0.28, 2.281, 0.03, 2.27, -2.3, 0, 'E', 'D', 'CT.RP.3.2.2D'),
('S.378', 'MD.15', '<p>Empat blender digunakan untuk membuat empat jus yang berbeda yaitu jus manga, jus pisang, jus nanas, dan jus apel. Setiap jus memiliki takaran dan komposisi bahan yang dijaga sama sehingga hanya dibedakan berdasarkan jenis buah yang digunakan. Setelah semua bahan halus, blender dimatikan secara bersamaan. Namun, tidak ada blender yang berhenti berputar persis sama. Oleh karena itu, Randi melakukan pengamatan dan memperoleh data sebagai berikut:</p>\r\n<table style=\"width: 573px; height: 220px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 20px;\">\r\n<th style=\"width: 151.828px; text-align: center; height: 20px;\">&nbsp;</th>\r\n<th style=\"width: 92.5156px; text-align: center; height: 20px;\">Mangga</th>\r\n<th style=\"width: 112.625px; text-align: center; height: 20px;\">Pisang</th>\r\n<th style=\"width: 84.4688px; text-align: center; height: 20px;\">Nanas</th>\r\n<th style=\"width: 97.5625px; text-align: center; height: 20px;\">Apel</th>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<td style=\"width: 151.828px; text-align: center; height: 20px;\">Volume Akhir</td>\r\n<td style=\"width: 92.5156px; text-align: center; height: 20px;\">750 ml</td>\r\n<td style=\"width: 112.625px; text-align: center; height: 20px;\">730 ml</td>\r\n<td style=\"width: 84.4688px; text-align: center; height: 20px;\">750 ml</td>\r\n<td style=\"width: 97.5625px; text-align: center; height: 20px;\">740 ml</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<td style=\"width: 151.828px; text-align: center; height: 20px;\">Massa akhir</td>\r\n<td style=\"width: 92.5156px; text-align: center; height: 20px;\">60 gr</td>\r\n<td style=\"width: 112.625px; text-align: center; height: 20px;\">65 gr</td>\r\n<td style=\"width: 84.4688px; text-align: center; height: 20px;\">65 gr</td>\r\n<td style=\"width: 97.5625px; text-align: center; height: 20px;\">60 gr</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<td style=\"width: 151.828px; text-align: center; height: 20px;\">Daya mesin</td>\r\n<td style=\"width: 92.5156px; text-align: center; height: 20px;\">350 Watt</td>\r\n<td style=\"width: 112.625px; text-align: center; height: 20px;\">330 Watt</td>\r\n<td style=\"width: 84.4688px; text-align: center; height: 20px;\">360 Watt</td>\r\n<td style=\"width: 97.5625px; text-align: center; height: 20px;\">300 Watt</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<td style=\"width: 151.828px; text-align: center; height: 20px;\">RPM</td>\r\n<td style=\"width: 92.5156px; text-align: center; height: 20px;\">28000</td>\r\n<td style=\"width: 112.625px; text-align: center; height: 20px;\">25000</td>\r\n<td style=\"width: 84.4688px; text-align: center; height: 20px;\">300000</td>\r\n<td style=\"width: 97.5625px; text-align: center; height: 20px;\">23000</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<td style=\"width: 151.828px; text-align: center; height: 20px;\">Durasi blender</td>\r\n<td style=\"width: 92.5156px; text-align: center; height: 20px;\">180 detik</td>\r\n<td style=\"width: 112.625px; text-align: center; height: 20px;\">200 detik</td>\r\n<td style=\"width: 84.4688px; text-align: center; height: 20px;\">170 detik</td>\r\n<td style=\"width: 97.5625px; text-align: center; height: 20px;\">220 detik</td>\r\n</tr>\r\n<tr style=\"height: 13px;\">\r\n<td style=\"width: 151.828px; height: 13px;\">\r\n<p style=\"text-align: center;\">Waktu hingga berhenti</p>\r\n</td>\r\n<td style=\"width: 92.5156px; text-align: center; height: 13px;\">10 detik</td>\r\n<td style=\"width: 112.625px; text-align: center; height: 13px;\">5 detik</td>\r\n<td style=\"width: 84.4688px; text-align: center; height: 13px;\">6 detik</td>\r\n<td style=\"width: 97.5625px; text-align: center; height: 13px;\">8 detik</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Berdasarkan informasi yang diperoleh oleh Randi, variable yang <strong>tidak</strong> perlu dipertimbangkan untuk menganalisis waktu hingga berhenti adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Volume Akhir</li><li>Massa Akhir</li><li>Daya Mesin</li><li>Rpm</li><li>Durasi Blender</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Volume akhir dari jus tidak mempengaruhi torsi dari mesin blendert</li><li>Massa akhir dari jus tidak mempengaruhi torsi dari mesin blender</li><li>Daya mesin tidak mempengaruhi torsi dari mesin blender</li><li>Rpm tidak mempengaruhi torsi dari mesin blender</li><li>Durasi blender tidak mempengaruhi torsi dari blender</li></ol>', 0.306, 1.906, -4.51, -1.21, 5.27, 0, 'E', 'E', 'CT.MD.3.1.3A'),
('S.379', 'MD.15', '<p>Sebuah bianglala raksasa dengan diameter 100 meter digerakan dengan sebuah mesin 25000 rpm (rotasi per menit) dan Daya 10 HP (1 Hp = 745,7 Watt). Bianglala diputar pada poros yang memiliki diameter 2 meter, selannjutnya poros dihubungkan dengan piringan mesin. Piringan roda mesin memiliki perbandingan jari-jari terhadap bianglala 1:50. Dalam keadaan kosong, setiap kursi gantung pada bianglala memiliki massa yang sama.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%203B.png\" alt=\"\" /></p>\r\n<p>Berdasarkan penjabaran dan ilustrasi diatas, variable yang <strong>tidak</strong> dapat digunakan untuk mempercepat gerakan bianglala adalah&hellip;..</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Daya mesin</li><li>RPM Mesin</li><li>Jari-jari bianglala</li><li>Jari-jari poros</li><li>Jari-jari mesin</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Perputaran bianglala disebabakan oleh hubungan roda dan roda</li><li>Perputaran bianglala bergantung pada torsi dari bianglala pada saat kosong maupun terisi.</li><li>Perputaran bianglala ditentukan oleh torsi mesin yang digunakan.</li><li>Perputaran bianglala ditentukan kecepatan radial dari piringan roda mesin</li><li>Perputaran bianglala ditentukan oleh daya mesin yang digunakan.</li></ol>', 0.144, 2.686, -0.45, 2.25, 2.29, 0, 'C', 'C', 'CT.MD.3.1.3B'),
('S.380', 'MD.15', '<p>Perhatikan Gambar berikut!<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/assets/source/Gambar%203C%20(FILEminimizer).jpg\" alt=\"\" width=\"300\" height=\"225\" />Suatu larutan santan 70% dimasukan ke dalam kulkas dengan temperature 5<sup>o</sup>C. Setelah satu malam, santan menggumpal di bagian atas dan air berada di bagian bawah. Kamu kemudian bertanya kepada rekan kelasmu untuk menanyakan penyebab hal tersebut dan diperoleh variable dugaan sebagai berikut:</p>\r\n<ol>\r\n<li>Massa jenis air</li>\r\n<li>Massa jenis santan</li>\r\n<li>Persentase larutan</li>\r\n<li>Kalor jenis air</li>\r\n<li>Kalor jenis santan</li>\r\n</ol>\r\n<p>Berdasarkan informasi yang dikemukakan, variable yang <strong>tidak </strong>mempengaruhi proses pembekuan santan dibagian atas dan air dibagian bawah adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Massa jenis air</li><li>Massa jenis santan</li><li>Persentase larutan</li><li>Kalor jenis air</li><li>Kalor jenis santan</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Santan mengapung karena memiliki kalor jenis yang lebih tinggi dan massa jenis yang kebih rendah</li><li>Santan mengapung karena memiliki kalor jenis yang lebih tinggi dan massa jenis yang lebih tinggi</li><li>Santan mengapung karena memiliki kalor jenis yang lebih rendah dan massa jenis yang lebih rendah</li><li>Santan mengapung karena memiliki kalor jenis yang lebih rendah dan massa jenis yang lebih tinggi</li><li>Santan mengapung karena memiliki konsentrasi yang lebih pekat dibandingkan air.</li></ol>', 0.24, 1.392, -4.24, 5.84, -1.6, 0, 'C', 'C', 'CT.MD.3.3.3C'),
('S.381', 'MD.15', '<p>Pada saat membangun bendungan, para arsitek akan menghitung kedalaman air, ketinggian mercusuar, kemiringan, lebar tinggi bendungan, lebar bendungan, debit air, curah hujan, struktur tanah dan area buangan sebelum menentukan membuat desain dari bendungan tersebut. Berdasarkan data-data tersebut biasanya akan diperoleh model bendungan yang memiliki trapezium dengan dasar bendungan memiliki ketebalan yang paling besar.</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/Gambar%203D%20(FILEminimizer).jpg\" alt=\"\" width=\"500\" height=\"323\" /></p>\r\n<p>Berdasarkan informasi dan ilustrasi yang diberikan, variable yang menentukan ketebalan dinding bendungan adalah&hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Tinggi bendungan, lebar bendungan, dan debit air</li><li>Tinggi bendungan, lebar bendungan, dan kemiringan</li><li>Kedalaman air, tinggi bendungan, dan debit air.</li><li>Kedalaman air, tinggi bendungan dan kemiringan.</li><li>Kedalaman air, lebar bendungan, dan struktur tanah.</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Ketebalan dinding bendungan mempertimbangkan besar tekanan hidrsotatis.</li><li>Ketebalan dinding bendungan mempertimbangkan asas kontinuitas.</li><li>Ketebalan dinding bendungan mempertimbangkan laju aliran .</li><li>Ketebalan dinding bendungan mempertimbangkan asas Bernouli.</li><li>Ketebalan dinding bendungan mempertimbangkan Hukum Toriceli.</li></ol>', 0.467, -0.49, 0.72, -0.95, 0.23, 0, 'C', 'A', 'CT.MD.3.3.3D'),
('S.382', 'MD.15', '<p style=\"text-align: justify;\">Turi bekerja di divisi perawatan pada salah satu perusahaan pertambangan minyak. Ia bertugas untuk mengontrol laju aliran minyak dari tempat pengolahan ke tempat penyimpanan. Oleh karena itu, Turi berencana membuat venturimeter yang dipasang pada setiap titik percabangan. Akan tetapi, ketinggian maksimal pipa tambahan yang bisa dibuat oleh turi adalah 1-meter sehingga ia perlu melakukan pengujian jenis cairan yang akan digunakan. Adapun hasil percobaan yang dilakukan oleh Turi adalah sebagai berikut:</p>\r\n<p style=\"text-align: center;\"><img src=\"/assets/source/13D.png\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">Untuk mendapatkan hasil pengukuran yang optimal, disyaratkan bahwa massa jenis zat cair tidak boleh lebih rendah dari massa jenis minyak yaitu 0,75 g/cm<sup>3</sup>.</p>\r\n<p><strong>Pertanyaan: </strong>Berdasarkan informasi yang diberikan, permasalahan yang ingin diselesaikan oleh turi adalah &hellip;.</p>', '<ol style=\"list-style-type: upper-alpha;\"><li>Bagaimana perbandingan diameter pipa besar dan pipa kecil?</li><li>Berapakah massa jenis yang ideal untuk mengisi pipa kecil?</li><li>Berapakah jari-jari pipa besar yang ideal untuk pengukuran?</li><li>Bagaimana hubungan antara ketinggian pipa dengan jari-jari?</li><li>Berapakah ketinggian pipa kecil yang ideal untuk melakukan pengukuran?</li></ol>', '<ol style=\"list-style-type: upper-alpha;\"><li>Karena sesuai dengan persamaan <img title=\"\\rho _{zat cair} = \\frac{2v^{2}\\rho_{minyak}}{gh}\\left ( 1-\\frac{d_{minyak}^{2}}{d_{zat cair}^{2}} \\right )+\\rho _{minyak}\" src=\"https://latex.codecogs.com/gif.latex?\\rho&amp;space;_{zat&amp;space;cair}&amp;space;=&amp;space;\\frac{2v^{2}\\rho_{minyak}}{gh}\\left&amp;space;(&amp;space;1-\\frac{d_{minyak}^{2}}{d_{zat&amp;space;cair}^{2}}&amp;space;\\right&amp;space;)+\\rho&amp;space;_{minyak}\" /></li><li>Karena sesuai dengan persamaan <img title=\"\\rho _{zat cair} = \\frac{v^{2}\\rho_{minyak}}{2gh}\\left ( d_{minyak}^{2}- d_{zat cair}^{2} \\right )+\\rho _{minyak}\" src=\"https://latex.codecogs.com/gif.latex?\\rho&amp;space;_{zat&amp;space;cair}&amp;space;=&amp;space;\\frac{v^{2}\\rho_{minyak}}{2gh}\\left&amp;space;(&amp;space;d_{minyak}^{2}-&amp;space;d_{zat&amp;space;cair}^{2}&amp;space;\\right&amp;space;)+\\rho&amp;space;_{minyak}\" /></li><li>Karena sesuai dengan persamaan <img title=\"\\rho _{zat cair} = \\frac{2gh}{v^{2}\\rho_{minyak}}\\left ( d_{minyak}^{2}-d_{zat cair}^{2} \\right )+\\rho _{minyak}\" src=\"https://latex.codecogs.com/gif.latex?\\rho&amp;space;_{zat&amp;space;cair}&amp;space;=&amp;space;\\frac{2gh}{v^{2}\\rho_{minyak}}\\left&amp;space;(&amp;space;d_{minyak}^{2}-d_{zat&amp;space;cair}^{2}&amp;space;\\right&amp;space;)+\\rho&amp;space;_{minyak}\" /></li><li>Karena sesuai dengan persamaan<img title=\"\\rho _{zat cair} = \\frac{v^{2}\\rho_{minyak}}{2gh}\\left ( 1-\\frac{d_{minyak}^{2}}{d_{zat cair}^{2}} \\right )+\\rho _{minyak}\" src=\"https://latex.codecogs.com/gif.latex?\\rho&amp;space;_{zat&amp;space;cair}&amp;space;=&amp;space;\\frac{v^{2}\\rho_{minyak}}{2gh}\\left&amp;space;(&amp;space;1-\\frac{d_{minyak}^{2}}{d_{zat&amp;space;cair}^{2}}&amp;space;\\right&amp;space;)+\\rho&amp;space;_{minyak}\" /></li><li>Karena sesuai dengan persamaan <img title=\"\\rho _{zat cair} = \\frac{2v^{2}\\rho_{minyak}}{gh}\\left ( \\frac{d_{minyak}^{2}}{d_{zat cair}^{2}} -1\\right )+\\rho _{minyak}\" src=\"https://latex.codecogs.com/gif.latex?\\rho&amp;space;_{zat&amp;space;cair}&amp;space;=&amp;space;\\frac{2v^{2}\\rho_{minyak}}{gh}\\left&amp;space;(&amp;space;\\frac{d_{minyak}^{2}}{d_{zat&amp;space;cair}^{2}}&amp;space;-1\\right&amp;space;)+\\rho&amp;space;_{minyak}\" /></li></ol>', 0.335, -0.8, -1.16, 1.93, -0.78, 0, 'B', 'D', 'CT.RP.3.4.2A'),
('S.383', 'MD.15', '<p>Cakram memiliki fungsi yang vital dalam konstruksi kendaraan bermotor. Dalam sistem kendaraan, cakram berfungsi dalam sistem pengereman kendaraan sehingga memerlukan tingkat ketelitian yang tinggi untuk membuat suatu cakram. Cakram terbuat dari banyak lapisan cakram tipis yang dipanaskan sehingga menjadi cakram dengan ketebalan tertentu. Oleh karena itu, Toni yang bekerja sebagai divisi R&amp;D dalam suatu pabrik cakram melakukan eksperimen dengan data sebagai berikut:</p>\r\n<table style=\"width: 567px; height: 299px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 37px;\">\r\n<th style=\"width: 22.5521px; height: 37px; text-align: center;\"><em>n</em></th>\r\n<th style=\"width: 113.75px; height: 37px; text-align: center;\"><em>m</em> (kg)</th>\r\n<th style=\"width: 96.5625px; height: 37px; text-align: center;\"><em>r</em> (m)</th>\r\n<th style=\"width: 95.9375px; text-align: center; height: 37px;\"><em>I</em> (kg.m2)</th>\r\n<th style=\"width: 108.047px; text-align: center; height: 37px;\"><em>L</em> (kg.m2/s)</th>\r\n<th style=\"width: 92.7474px; text-align: center; height: 37px;\"><em>&omega;</em>&nbsp;(rad/s)</th>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 22.5521px; height: 18px; text-align: center;\">1</td>\r\n<td style=\"width: 113.75px; height: 18px; text-align: center;\">0.1</td>\r\n<td style=\"width: 96.5625px; height: 18px; text-align: center;\">0.20</td>\r\n<td style=\"width: 95.9375px; text-align: center; height: 18px;\">0.002</td>\r\n<td style=\"width: 108.047px; text-align: center; height: 18px;\">0.04</td>\r\n<td style=\"width: 92.7474px; height: 18px; text-align: right;\">20.00</td>\r\n</tr>\r\n<tr style=\"height: 18px; text-align: center;\">\r\n<td style=\"width: 22.5521px; height: 18px; text-align: center;\">2</td>\r\n<td style=\"width: 113.75px; height: 18px; text-align: center;\">0.2</td>\r\n<td style=\"width: 96.5625px; height: 18px; text-align: center;\">0.20</td>\r\n<td style=\"width: 95.9375px; t